(14, 90727, 'Lara Babalola', '/pHxBJFpi3FloZXbgccO9xY12FQx.jpg', 'Lara Babalola is a Canadian actress and TV presenter living in Berlin, Germany. She can be seen on Focus on Europe - Deutsche Welle\'s European affairs program. Lara speaks fluent German and her native language in English. Lara was born in Saskatoon, Saskatchewan to a Canadian mother and Nigerian father. In addition to presenting and acting, Lara works as a news writer and voice artist.', NULL, NULL, NULL, '2025-05-09 10:18:02', '2025-05-09 10:18:02'),
(15, 3266915, 'Samuel Tehrani', '/1fQtIuq0XxuprjH25M2GPW8Awwo.jpg', 'Samuel Tehrani is an Austrian actor. He’s notable for his role as “Shivaz Jamshidpour” in the feature film “The Persian Version” by Maryam Keshavarz, “ Arian Mohajerani” in the feature film \"Dinner for Eight\" by Bernhard Ratka - as well as for his roles in short movies like \"Paragraph 140\" by Louis Derfert & \"In the Dark\" by Tobias Vees. Due to his Persian roots, close family ties to the United States & his residence in Austria, he was raised a trilingual. He’s also a multi-instrumentalist, writer & songwriter.', '1988-01-19', NULL, 'Vienna, Austria', '2025-05-09 10:18:02', '2025-05-09 10:18:02'),
