(29, 2710333, 'D\'Pharaoh Woon-A-Tai', '/ozEGeNK9r2EFn4rNU0DSuNQaia0.jpg', 'D\'Pharaoh Miskwaatez Loescher McKay Woon-A-Tai (born September 19, 2001) is a Canadian actor of Oji-Cree descent. He is best known for his role as Indigenous teenager Bear Smallhill in the FX on Hulu comedy-drama series Reservation Dogs (2021–2023), for which he received several accolades, including a nomination for a Primetime Emmy Award for Outstanding Lead Actor\n\nDescription above from the Wikipedia article D\'Pharaoh Woon-A-Tai, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '2001-09-19', NULL, 'Toronto, Canada', '2025-05-09 10:18:08', '2025-05-09 10:18:08'),
(30, 93491, 'Will Poulter', '/9blYMaj79VGC6BHTLmJp3V5S8r3.jpg', 'William Jack Poulter (born 28 January 1993) is an English actor. He first gained recognition in School of Comedy (2009) and then for his role as Eustace Scrubb in the adventure film The Chronicles of Narnia: The Voyage of the Dawn Treader (2010) and his starring role in the comedy film We\'re the Millers (2013). He won the BAFTA Rising Star Award in 2014.\n\nPoulter starred in the first and third films of the dystopian science fiction trilogy The Maze Runner (2014–2018), the period film The Revenant (2015), the drama film Detroit (2017), the interactive film Black Mirror: Bandersnatch (2018), and the horror film Midsommar (2019). In 2021, he was featured in the Hulu miniseries Dopesick, for which he received a Primetime Emmy Award nomination for Outstanding Supporting Actor. In 2023, he joined the Marvel Cinematic Universe as Adam Warlock in Guardians of the Galaxy Vol. 3. He had a recurring role in FX\'s series The Bear, which earned him another Emmy Award nomination.\n\nDescription above from the Wikipedia article Ke Huy Quan, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1993-01-28', NULL, 'Hammersmith, London, England, UK', '2025-05-09 10:18:09', '2025-05-09 10:18:09'),
(31, 1363054, 'Cosmo Jarvis', '/1kgghZ558CxZCJip5ufO6BAqUGp.jpg', 'Harrison Cosmo Krikoryan Jarvis is an English actor and singer-songwriter. He has starred in the films Lady Macbeth (2016), Calm with Horses (2019), and Persuasion (2022). In 2024, he portrayed John Blackthorne in the historical drama series Shōgun.\n\nDescription above from the Wikipedia article Cosmo Jarvis, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1989-09-01', NULL, 'Ridgewood, New Jersey, USA', '2025-05-09 10:18:09', '2025-05-09 10:18:09'),
(32, 1538851, 'Kit Connor', '/6BDubD35VfSa0uyPr0UuYznuiM4.jpg', 'Kit Sebastian Connor (born 8 March 2004) is an English actor. He has appeared in the films Get Santa (2014), Rocketman (2019) and Little Joe (2019). On television, he had a recurring role in the CBBC series Rocket\'s Island (2014–2015) and a voice role in the BBC One and HBO series His Dark Materials. He gained recognition for his starring role as Nick Nelson in the Netflix teen series Heartstopper (2022), for which he won the Children\'s and Family Emmy Award for Outstanding Lead Performance in 2022.', '2004-03-08', NULL, 'London, England, UK', '2025-05-09 10:18:10', '2025-05-09 10:18:10'),
