(34, 1369329, 'Taylor John Smith', '/6dXZRf8ePa1oxQN9a5hFGEjDoI0.jpg', 'Taylor John Smith is an American actor. He is known for his role as John Keene in the series Sharp Objects. Notable films in which he has appeared are Wolves (2016), You Get Me (2017), Hunter Killer (2018), The Outpost (2020), Shadow in the Cloud (2020), and Where the Crawdads Sing (2022).', '1995-05-13', NULL, 'Los Angeles, California, USA', '2025-05-09 10:18:10', '2025-05-09 10:18:10'),
(35, 1900369, 'Michael Gandolfini', '/28b4ER8m7AJ40vsgocFIhwTKkzp.jpg', 'Michael Gandolfini (born May 10, 1999) is an American actor. Gandolfini made his major film debut in Ocean\'s 8 (2018) and appeared in The Many Saints of Newark (2021), in which he played the role of Tony Soprano, which was originally portrayed by his father, James Gandolfini, in the television series The Sopranos.\n\nGandolfini was born on May 10, 1999, in New York City to actor James Gandolfini and Marcy Wudarski. He is of Italian, Polish, and Slovak heritage and has a younger half-sister from his father\'s second marriage. While he was a teenager, Gandolfini enjoyed performing, but his father advised against an acting career; he wanted him to pursue sports or \"be a director. They have the power,\" he said.\n\nHis father, James Gandolfini, died at age 51 of a heart attack in Rome on June 19, 2013.\n\nAfter his father\'s death, Michael Gandolfini decided to pursue acting. He enrolled at New York University after graduating from high school. After early auditions, he was cast in the HBO drama series The Deuce as Joey Dwyer. In 2019, he was cast in The Many Saints of Newark to play the young version of Tony Soprano, the role played by his father in the television series The Sopranos. Gandolfini had never watched the show. He described watching it while preparing for the role as an intense process. He was later cast in the Russo brothers\' crime drama Cherry. In 2024, he was cast in Warfare, a war film written and directed by Ray Mendoza and Alex Garland.\n\nHe has been sober since 2017. As of January 2024, he has been in a relationship with fellow actress Mia Healey.\n\nDescription above from the Wikipedia article Michael Gandolfini, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1999-05-10', NULL, 'New York, New York', '2025-05-09 10:18:11', '2025-05-09 10:18:11'),
(36, 2120814, 'Adain Bradley', '/qPe2AgBrIIOOv4uLK984dxgGzxE.jpg', '', '1998-05-07', NULL, 'Salina, Kansas, USA', '2025-05-09 10:18:11', '2025-05-09 10:18:11'),
(37, 1253353, 'Noah Centineo', '/kXLuzSWRqM2P45uNcgb0v3H8dnE.jpg', 'Noah Gregory Centineo (born May 9, 1996) is an American actor. He began his career performing on television and had a main role in the television series The Fosters from 2015 to 2018. He achieved wider recognition by starring in the Netflix romantic comedy films To All the Boys I\'ve Loved Before (2018) and its sequels, Sierra Burgess Is a Loser (2018), and The Perfect Date (2019).\n\nIn 2022, Centineo played Atom Smasher in the superhero film Black Adam. He is also a co-founder of the charity Favored Nations.', '1996-05-09', NULL, 'Miami, Florida, USA', '2025-05-09 10:18:11', '2025-05-09 10:18:11'),
(38, 1734935, 'Evan Holtzman', '/6bMtNQloX5g4d1xNa4QLKaQKL0z.jpg', 'Evan Holtzman is an American film and television actor.', '1978-03-31', NULL, 'Dallas, Texas, USA', '2025-05-09 10:18:12', '2025-05-09 10:18:12'),
(39, 1563169, 'Henry Zaga', '/ievztVvYh3chqStu5ZdZI6anxfh.jpg', 'Henrique Chagas Moniz de Aragão Gonzaga (born April 30, 1993), also known as Henry Zaga, is a Brazilian actor.', '1995-03-30', NULL, 'Brasília, Federal District, Brazil', '2025-05-09 10:18:12', '2025-05-09 10:18:12'),
(40, 1597365, 'Joseph Quinn', '/zshhuioZaH8S5ZKdMcojzWi1ntl.jpg', 'Joseph Quinn (born 26 January 1994) is an English actor. He is known for playing Eddie Munson in the fourth season of the Netflix series Stranger Things (2022). He has also appeared in the BBC One series Dickensian (2016), Howards End (2017), Les Misérables (2018), and the Sky Atlantic series Catherine the Great (2019). He starred in the science fiction horror film A Quiet Place: Day One and portrayed Geta in the historical action film Gladiator II, released in 2024.\n\nDescription above from the Wikipedia article Joseph Quinn, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1994-01-26', NULL, 'London, England, UK', '2025-05-09 10:18:12', '2025-05-09 10:18:12'),
(41, 1907002, 'Charles Melton', '/sxWslNRZdiBcPgwdVqoj7nSclr6.jpg', 'Charles Michael Melton (born January 4, 1991) is an American actor. After working as a fashion model, Melton ventured to acting with guest roles on the television series Glee (2014) and American Horror Story: Hotel (2015–2016). His breakthrough came with his portrayal of Reggie Mantle in the CW series Riverdale (2017–2023). \n\nMelton gained recognition for his leading role in the romance film The Sun Is Also a Star (2019). Melton earned nominations for a Critics\' Choice Movie Award and a Golden Globe Award for his acclaimed portrayal of a young man married to a much older woman in the drama film May December (2023).\n\nDescription above from the Wikipedia article Charles Melton, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1991-01-04', NULL, 'Juneau, Alaska, USA', '2025-05-09 10:18:13', '2025-05-09 10:18:13'),
