(43, 2303015, 'Alex Brockdorff', '/cL4Y87y98WLjOiKxglBQF0z5qNG.jpg', 'Alex Brockdorff (born Alexander von Brockdorff) is a British actor. He has appeared in several television dramas, including the final season of Homeland (2020), FBI: International (2021), and The Midwich Cuckoos (2022).\n\nDescription above from the Wikipedia article Alex Brockdorff, licensed under CC-BY-SA, full list of contributors on Wikipedia.', NULL, NULL, 'London, England', '2025-05-09 10:18:13', '2025-05-09 10:18:13'),
