(60, 1373737, 'Florence Pugh', '/6Sjz9teWjrMY9lF2o9FCo4XmoRh.jpg', 'Florence Pugh (/pjuː/ PEW; born 3 January 1996) is an English actress. Her accolades include nominations for an Academy Award and two BAFTA Awards.\n\nAfter making her acting debut in the drama film The Falling (2014), Pugh gained praise for starring in the independent drama Lady Macbeth (2016) and the miniseries The Little Drummer Girl (2018). Her international breakthrough came in 2019 with her portrayals of professional wrestler Paige in the sports film Fighting with My Family, a despondent American woman in the horror film Midsommar, and Amy March in the period drama Little Women. For the last of these, she was nominated for the Academy Award for Best Supporting Actress.\n\nPugh has played Yelena Belova in the Marvel Cinematic Universe, beginning with the film Black Widow (2021). In her highest-grossing releases, she voiced Goldilocks in Puss in Boots: The Last Wish (2022) and portrayed Jean Tatlock in Oppenheimer (2023) and Princess Irulan in Dune: Part Two (2024). She also continued to gain praise for her performances in dramas such as We Live in Time (2024).\n\nDescription above from the Wikipedia article Florence Pugh, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1996-01-03', NULL, 'Oxford, Oxfordshire, England UK', '2025-05-09 10:18:20', '2025-05-09 10:18:20'),
(61, 60898, 'Sebastian Stan', '/nKZgixTbHFXpkzzIpMFdLX98GYh.jpg', 'Sebastian Stan (born August 13, 1982) is a Romanian-American actor. He gained recognition for his role as Bucky Barnes / Winter Soldier in the Marvel Cinematic Universe media franchise, beginning with 2011\'s Captain America: The First Avenger. He later returned in Captain America: The Winter Soldier (2014), and went on to star in Captain America: Civil War (2016), Avengers: Infinity War (2018), Avengers: Endgame (2019) and The Falcon and the Winter Soldier (2021).\n\nOn television, he has played Carter Baizen in Gossip Girl, Prince Jack Benjamin in Kings, Jefferson in Once Upon a Time, and T.J. Hammond in Political Animals. The latter earned him a nomination for the Critics\' Choice Television Award for Best Supporting Actor in a Movie/Miniseries. In films, he co-starred in Jonathan Demme\'s comedy-drama Ricki and the Flash and Ridley Scott\'s science fiction film The Martian. In 2017, he portrayed Jeff Gillooly in the biopic I, Tonya, and in 2022, he stars in the miniseries Pam & Tommy.', '1982-08-13', NULL, 'Constanța, Romanian SR [now Romania]', '2025-05-09 10:18:20', '2025-05-09 10:18:20'),
(62, 15886, 'Julia Louis-Dreyfus', '/2QK4qNUB5iyGSqoQBPM1F5bNUfo.jpg', 'Julia Scarlett Elizabeth Louis-Dreyfus (/ˌluːiˈdraɪfəs/ LOO-ee DRY-fəs; born January 13, 1961) is an American actress and comedian. Often described as one of the most outstanding performers in television history, she is widely known for her roles as various characters on Saturday Night Live (1982–1985), Elaine Benes on Seinfeld (1990–1998), Christine Campbell on The New Adventures of Old Christine (2006–2010), and Selina Meyer on Veep (2012–2019). Her list of accolades makes her one of the most award-winning actresses in American television history, and she has received more Primetime Emmy Awards and more Screen Actors Guild Awards than any other performer.\n\nLouis-Dreyfus was born in New York City, the daughter of the French billionaire Gérard Louis-Dreyfus, and entered comedy as a performer with the Practical Theatre Company in Chicago. This led to her being cast in the sketch show Saturday Night Live. Her breakthrough came in 1990 with her debut at the start of a nine-season run on Seinfeld, which became one of the most critically and commercially successful sitcoms. In addition to leading roles on The New Adventures of Old Christine and Veep, she has made guest appearances on shows such as Arrested Development, Curb Your Enthusiasm, and 30 Rock. On film, Louis-Dreyfus has had supporting film roles in Hannah and Her Sisters (1986), National Lampoon\'s Christmas Vacation (1989), Deconstructing Harry (1997), and You People (2023), and leading film roles in Enough Said (2013), Downhill (2020), You Hurt My Feelings (2023), and Tuesday (2023). Her voice-acting work includes A Bug\'s Life (1998), Planes (2013), and Onward (2020). Since 2021, she has played Valentina Allegra de Fontaine in the Marvel Cinematic Universe in three films and one Disney+ miniseries.\n\nLouis-Dreyfus has received 11 Primetime Emmy Awards (eight for acting and three for producing), nine Screen Actors Guild Awards, and one Golden Globe Award. She received a star on the Hollywood Walk of Fame in 2010. She was inducted into the Television Academy Hall of Fame in 2014. She was named one of Time magazine\'s 100 most influential people in the world in 2016. She has also received numerous honors including the Mark Twain Prize for American Humor in 2018 and the National Medal of Arts in 2021.\n\nDescription above from the Wikipedia article Julia Louis-Dreyfus, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1961-01-13', NULL, 'New York City, New York, USA', '2025-05-09 10:18:21', '2025-05-09 10:18:21'),
(63, 1700685, 'Lewis Pullman', '/jAo0Rxl9EYVxLnhUlBww5Uxl89v.jpg', 'Lewis James Pullman (born January 29, 1993) is an American actor. A son of actor Bill Pullman, he began his acting career with the film The Ballad of Lefty Brown (2017), starring his father. His subsequent film credits include supporting roles in The Strangers: Prey at Night (2018), Bad Times at the El Royale (2018) and Top Gun: Maverick (2022), and a starring role in \'Salem\'s Lot (2024). \n\nOn television, Pullman played Major Major Major Major in Catch-22 (2019) and starred in Outer Range (2022–2024) and Lessons in Chemistry (2023), for which the latter, he was nominated for a Primetime Emmy Award and Critics\' Choice TV Award.', '1993-01-29', NULL, 'Los Angeles, California, USA', '2025-05-09 10:18:21', '2025-05-09 10:18:21'),
(64, 35029, 'David Harbour', '/chPekukMF5SNnW6b22NbYPqAStr.jpg', 'David Kenneth Harbour (born April 10, 1975) is an American actor. He has received nominations for two Primetime Emmy Awards, a Tony Award, and a Golden Globe Award. \n\nHe began his career acting in Shakespearean theatre productions. After his professional debut on Broadway in the 1999 revival of The Rainmaker, he was nominated for a Tony Award for his performance in a production of Who\'s Afraid of Virginia Woolf?. He made his television debut on Law & Order in 1999 and had supporting roles in films such as Brokeback Mountain (2005), Revolutionary Road (2008) and Black Mass(2015).\n\nHarbour gained global recognition for his portrayal of Jim Hopper in the Netflix science fiction series Stranger Things (2016–present), for which he received a Critics\' Choice Television Award as well as nominations for two Primetime Emmy Awards. His starring film roles include the title character in Hellboy (2019), Santa Claus in Violent Night (2022) and a former racer in the sports film Gran Turismo (2023). In the Marvel Cinematic Universe, Harbour has played Red Guardian since the film Black Widow (2021).', '1975-04-10', NULL, 'New York City, New York, USA', '2025-05-09 10:18:21', '2025-05-09 10:18:21'),
(65, 986808, 'Wyatt Russell', '/zIldBzXdBWskPZB7x35G2hYEVDo.jpg', 'Wyatt Hawn Russell (born July 10, 1986) is an American actor and former ice hockey player. He is the son of actors Kurt Russell and Goldie Hawn.\n\nAs an actor, he portrayed Corporal Lewis Ford in Julius Avery\'s 2018 horror film Overlord, Dud in AMC\'s Lodge 49 and John Walker / U.S. Agent in the Marvel Cinematic Universe Disney+ series The Falcon and the Winter Soldier (2021) and What If…? (2024). He is set to reprise the role of John Walker in the film Thunderbolts* (2025).', '1986-07-10', NULL, 'Los Angeles, California, USA', '2025-05-09 10:18:22', '2025-05-09 10:18:22'),
(66, 1408809, 'Hannah John-Kamen', '/2fqNQQW3B7upH4rBubhxXkIIoGk.jpg', 'Hannah John-Kamen (born 7 September 1989) is an English actress. She is known for her roles as a bounty hunter in the Syfy television series Killjoys (2015–2019), Ava Starr / Ghost in the Marvel Cinematic Universe, the title character in the Netflix mystery miniseries The Stranger (2020), and Jill Valentine in the film Resident Evil: Welcome to Raccoon City (2021).', '1989-09-07', NULL, 'Anlaby, East Yorkshire, England, UK', '2025-05-09 10:18:22', '2025-05-09 10:18:22'),
(67, 18182, 'Olga Kurylenko', '/ei6eYUhQFw2AaV6U5fyPptBaPF0.jpg', 'Olga Kostyantynivna Kurylenko (Ukrainian: Ольга Костянтинівна Куриленко, IPA: [ˈɔlʲɦɐkosʲtʲɐnˈtɪn⁽ʲ⁾iu̯nɐ kʊrɪˈlɛnko]; born 14 November 1979) is a Ukrainian-born French actress. She rose to prominence by playing Camille Montes in the James Bond film Quantum of Solace (2008).\n\nKurylenko had a successful modelling career in Paris before refocusing on acting in 2004. She had her breakthrough role in the action film Hitman (2007). She has also starred in the romantic drama To the Wonder (2012), the crime comedy Seven Psychopaths (2012), the science fiction film Oblivion (2013), the political satire The Death of Stalin (2017), the comedy The Man Who Killed Don Quixote (2018), the superhero film Black Widow (2021), the Netflix spy thriller miniseries Treason (2022) and the action thriller Extraction 2 (2023).\n\nDescription above from the Wikipedia article Olga Kurylenko, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1979-11-14', NULL, 'Berdiansk, Ukrainian SSR, USSR [now Zaporizhzhia Oblast, Ukraine]', '2025-05-09 10:18:23', '2025-05-09 10:18:23'),
(68, 1803287, 'Geraldine Viswanathan', '/mZ1dKqL2ymRipGEudzr8TQliB52.jpg', 'Geraldine Indira Viswanathan (/ˌvɪswəˈnɑːθən/VISS-wə-NAH-thən; born 20 June 1995) is an Australian actress, comedian, writer and producer. She gained attention in the role of Kayla in the 2018 film Blockers, for which Refinery29 referred to her as \"the film\'s breakout star\". Viswanathan starred in the 2019 coming-of-age film Hala and Bad Education. She also played a recurring role in the Australian series Janet King and stars in the TBS comedy anthology Miracle Workers (2019–2023).  In January 2024, Viswanathan was cast in the Marvel Cinematic Universe film Thunderbolts*. In 2025, she appeared in the comedy film You\'re Cordially Invited.\n\nDescription above from the Wikipedia article Geraldine Viswanathan, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1995-06-20', NULL, 'Newcastle, New South Wales, Australia', '2025-05-09 10:18:23', '2025-05-09 10:18:23'),
(69, 17859, 'Wendell Pierce', '/uOsldo9Pkl0E79UbIXX5tZZmC8F.jpg', 'Wendell Edward Pierce (born December 8, 1962) is an American actor and businessman. Having trained at Juilliard School, Pierce rose to prominence as a character actor portraying roles on both stage and screen. He first gained recognition portraying the role of Detective Bunk Moreland in the acclaimed HBO drama series The Wire from 2002 to 2008.\n\nHis other notable television roles include the trombonist Antoine Batiste in Treme (2010–2013), James Greer in Tom Clancy\'s Jack Ryan (2018–2023), the attorney Robert Zane in Suits (2013–2019), and Clarence Thomas in Confirmation (2016). He earned Independent Spirit Awards nominations for his film roles in Four (2012) and Burning Cane (2019), on which he also served as a producer. Other notable film roles include Malcolm X (1992), Waiting to Exhale (1995), Ray (2004), Selma (2014), The Gift (2015), and Clemency (2019).\n\nPierce made his Broadway debut in John Pielmeier\'s 1985 play The Boys of Winter, followed by Caryl Churchill\'s Serious Money in 1988. As a theatrical producer, he earned a Tony Award for Best Play nomination for August Wilson\'s Radio Golf (2007), then won for Bruce Norris\'s Clybourne Park (2012). He performed the lead role of Willy Loman in the revival of Death of a Salesman on the West End in London in 2019 and on Broadway in New York in 2022, for which he earned Laurence Olivier Award and Tony Award nominations.\n\nDescription above from the Wikipedia article Wendell Pierce, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1963-12-08', NULL, 'New Orleans, Louisiana, USA', '2025-05-09 10:18:23', '2025-05-09 10:18:23'),
(70, 4445, 'Chris Bauer', '/1AjdNxbVmy6azlOxIfnCX5OruEA.jpg', 'Chris Bauer is an American actor. He is best known for his television work in The Wire, Third Watch, True Blood, Survivor\'s Remorse, The Deuce and the Apple TV+ original science fiction space drama series For All Mankind. He has also appeared on Broadway as Mitch in A Streetcar Named Desire. He has originated roles in plays by David Mamet, John Patrick Shanley and Jez Butterworth.\n\nDescription above from the Wikipedia article Chris Bauer, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1966-10-28', NULL, 'Los Angeles, California, USA', '2025-05-09 10:18:24', '2025-05-09 10:18:24'),
(71, 2131391, 'Violet McGraw', '/8Aih35KuAt9mHUiJk09wFTF6SN1.jpg', 'Violet Elizabeth McGraw (born April 22, 2011) is an American child actress. She began acting at age five, with her debut credited role being a recurring role in the 2016 television series Love as Nina, and her first feature film being in 2018\'s Ready Player One. In 2019, she was nominated for an OFTA Television Award for Best Ensemble in a Motion Picture or Limited Series for The Haunting of Hill House. She is also known for her role as Cady in the 2022 horror film M3GAN.\n\nDescription above from the Wikipedia article Violet McGraw, licensed under CC-BY-SA, is a full list of contributors on Wikipedia.', '2011-04-22', NULL, 'California, USA', '2025-05-09 10:18:24', '2025-05-09 10:18:24'),
