(98, 976, 'Jason Statham', '/whNwkEQYWLFJA8ij0WyOOAD5xhQ.jpg', 'Jason Statham (/ˈsteɪθəm/ STAY-thəm; born 26 July 1967) is an English actor and producer. He is known for portraying tough, gritty, or violent characters in various action thriller films and has been credited for leading the resurgence of action films during the 2000s and 2010s. By 2017, his films had grossed over £1.1 billion ($1.5 billion), making him one of the industry\'s most bankable stars.\n\nWhile working at local market stalls, Statham began practising Chinese martial arts, kickboxing, and karate recreationally in his youth. An avid footballer and diver, he was a member of Britain\'s national diving team and competed for England in the 1990 Commonwealth Games. Shortly after, he was asked to model for French Connection, Tommy Hilfiger, and Levi\'s in various advertising campaigns.\n\nStatham\'s history of working at market stalls inspired his casting in the Guy Ritchie crime films Lock, Stock and Two Smoking Barrels (1998) and Snatch (2000). Both films were commercial hits, and they helped catapult Statham to stardom. He played supporting roles in the American action films Turn It Up (2000), Ghosts of Mars and The One (2001). From 2002 to 2008, he played the title role in the first three films in the Transporter film series (2002–2008), which solidified his status as an action star. In 2003, he appeared in the ensemble heist action film The Italian Job. He went on to play leading roles in the commercially successful films Crank (2006), The Bank Job (2008), The Mechanic (2011), Homefront (2013), Mechanic: Resurrection (2016), The Meg (2018), Wrath of Man (2021), Meg 2: The Trench (2023), and The Beekeeper (2024).\n\nStatham has also starred as Lee Christmas in the ensemble action film series The Expendables (2010–2023) and as Deckard Shaw in the Fast & Furious franchise (2013–2023), including the spin-off Hobbs & Shaw (2019), which he co-produced. His voice acting work includes the documentaries Thai Boxing: A Fighting Chance (2002), Truth in 24 (2008) and its 2012 sequel, and the animated film Gnomeo & Juliet (2011).\n\nDescription above from the Wikipedia article Jason Statham, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1967-07-26', NULL, 'Shirebrook, Derbyshire, England, UK', '2025-05-09 10:18:36', '2025-05-09 10:18:36'),
(99, 973, 'Jason Flemyng', '/nYl0180ACnLzVlGbaAfuPtdGr9K.jpg', 'Jason Iain Flemyng (born September 25, 1966) is an English actor. He is known for his film work, which has included roles in British films such as Lock, Stock and Two Smoking Barrels (1998) and Snatch (2000), both for Guy Ritchie, as well as Hollywood productions such as Rob Roy (1995) along with the Alan Moore comic book adaptations From Hell (2001) and The League of Extraordinary Gentlemen (2003). He has also appeared in prominent roles in both theatre and television in the UK. Flemyng can speak reasonable French, and has made three films in that language. He won the Best Actor Award at the Geneva Film Festival for his role in 1996\'s Alive and Kicking.\n\nDescription above from the Wikipedia article Jason Flemyng, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1966-09-25', NULL, 'Putney, London, England', '2025-05-09 10:18:37', '2025-05-09 10:18:37'),
(100, 17817, 'Merab Ninidze', '/jnJ4lQULt6Ga3lXkIqAhMR7xYdE.jpg', 'Merab Ninidze is a Georgian actor. He is best known for the roles of Oleg Penkovsky in The Courier and Vadim Kalyagin in McMafia.', '1965-11-03', NULL, 'Tbilisi, USSR', '2025-05-09 10:18:37', '2025-05-09 10:18:37'),
(101, 1011106, 'Maximilian Osinski', '/wMRtFsZSR9FvYj1wzsziKQqpZ0C.jpg', '', NULL, NULL, 'Eisenstadt, Burgenland, Austria', '2025-05-09 10:18:37', '2025-05-09 10:18:37'),
(102, 950125, 'Cokey Falkow', '/2VEMBUOHKZbpypEuso8jyxSo3Yc.jpg', 'Cokey Falkow is an actor, writer, voice artist, and comedian originally from South Africa. His father spoke 12 languages and was a shoe salesman. His mother is an award-winning PR practitioner based in Florida, USA. He is the brother of actor and writer Mike Falkow. In his native South Africa, he began his career in theatre with a small part in Hamlet at the Natal Playhouse. That same year he wrote a play with actor Colin Moss which won \"Best new play\" at the Adams Playwright festival in Durban, South Africa. He is one of only 30 people in South Africa to be chosen to study under improvisation theatre luminary Augusto Boal. In 2008 he was nominated as best supporting actor in a feature film (South African Film And Television Awards 09) for his role as \"Alfonso \" the albino serial killer in quirky South African comedy \"Big Fellas.\" Due to his talent with accents he also provided voices for radio and animation series, including 10 characters in hit South African kids show \'Urbo.\' Since then he has voiced large video game franchises and done various voices for BBC Radio4.', '1974-10-14', NULL, 'Durban, Natal, South Africa', '2025-05-09 10:18:38', '2025-05-09 10:18:38'),
(103, 454, 'Michael Peña', '/ft9e3EX4JG9MwK9pXwgbJ8ZvFoV.jpg', 'Michael Anthony Peña (born January 13, 1976) is an American film and television actor, probably best known for his prominent roles in Crash, Observe and Report, and Oliver Stone\'s World Trade Center. He also appeared in the Nickelback music video for their song Savin\' Me. Peña portrays Luis in the Ant Man film series in the Marvel Cinematic Universe, appearing as the character in Ant-Man (2015) and Ant-Man and the Wasp (2018).\n\nDescription above from the Wikipedia article Michael Peña, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1976-01-13', NULL, 'Chicago, Illinois, USA', '2025-05-09 10:18:38', '2025-05-09 10:18:38'),
