(105, 3953574, 'Arianna Rivas', '/a4dRvxh2csK8pnMVz5Xrh8MrE8X.jpg', 'Arianna Rivas (born May 5, 2001) is an American actress and model. She is known for co-starring in the film A Working Man alongside Jason Statham.\n\nDescription above from the Wikipedia article Arianna Rivas, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '2001-05-05', NULL, NULL, '2025-05-09 10:18:39', '2025-05-09 10:18:39'),
