(107, 1111204, 'Emmett Scanlan', '/1NmZuOXJ9XXLU5Yez5iedoEZWRp.jpg', 'Emmett J. Scanlan is an Irish actor from Dublin. He is best known for playing the villain Brendan Brady in Hollyoaks. He is currently filming BBC2 drama The Fall in 2013-2014 and hitman movie Breakdown in which he appears alongside Craig Fairbrass, James Cosmo, Bruce Payne, Olivia Grant and Tamer Hassan. Scanlan recently finished filming BBC3 In The Flesh Series 2, and Guardians of the Galaxy.', '1979-01-31', NULL, 'Dublin, Ireland', '2025-05-09 10:18:40', '2025-05-09 10:18:40'),
