(127, 1922337, 'Alana Boden', '/rbql1VGkF64OJnET9u5yAb2vkHR.jpg', 'Alana Evie Boden (born January 14, 1997) is a British actress. She began her career as a child model before moving to television commercials and short films. She is known for appearing in a variety of television shows and films, such as Uncharted, Flowers in the Attic: The Origin, The Invitation, and Geek Girl.', '1997-01-14', NULL, 'Surrey, England, UK ', '2025-05-09 10:18:47', '2025-05-09 10:18:47'),
