(146, 1945371, 'Benjamin Schnau', '/btNIFHnPfvkMOUR3W6tFK4JOcly.jpg', 'Benjamin Schnau (born 23 January 1987) is a German-born actor and television host, living in Los Angeles. He is best known for his role as George Westinghouse\'s secretary starring in the movie The Current War and as lead role General Jupp Klein in the historical piece Nazi Megastructures for National Geographic.', '1987-01-23', NULL, 'Magdeburg, East Germany', '2025-05-09 10:18:54', '2025-05-09 10:18:54'),
(147, 7447, 'Alec Baldwin', '/hzKy7x574eeUS3wt1R3yvWBRpeR.jpg', 'Alexander Rae Baldwin III (born April 3, 1958) is an American actor, comedian, and producer. He is known for his leading and supporting roles in a variety of genres, from comedy to drama, and has received numerous accolades including three Primetime Emmy Awards and three Golden Globe Awards as well as nominations for a Academy Award, a BAFTA Award, and Tony Award.\n\nDescription above from the Wikipedia article Alec Baldwin, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1958-04-03', NULL, 'Amityville, New York, USA', '2025-05-09 10:18:55', '2025-05-09 10:18:55'),
(148, 31532, 'Josh Hopkins', '/gPcG3xAnuUP9pMxGWkhb5nQqOPQ.jpg', 'William Joshua Hopkins is an American actor, best known as Raymond Millbury on Ally McBeal, Grayson Ellis on Cougar Town, and Liam O\'Connor on Quantico.', '1970-09-12', NULL, 'Lexington, Kentucky, USA', '2025-05-09 10:18:55', '2025-05-09 10:18:55'),
