(150, 77700, 'Travis Fimmel', '/i6wEoE9P6PgYe75g6QT8Y7JjX6n.jpg', 'Travis Fimmel (born 15 July 1979) is an Australian actor and former model. He is known for his role as Ragnar Lothbrok in the History Channel television series Vikings (2013–2017), and as Anduin Lothar in the live-action adaptation of Warcraft (2016). He also starred in the HBO Max science fiction series Raised by Wolves (2020–2022).', '1979-07-15', NULL, 'Echuca, Victoria, Australia', '2025-05-09 10:18:56', '2025-05-09 10:18:56'),
(151, 3713, 'Frances Fisher', '/3iNDgd54IIj8g8hGqhhUjM6TeWd.jpg', 'Frances Fisher (born 11 May 1952) is a British-born American actress. She is best known for her roles as Strawberry Alice, the madame prostitute in Unforgiven (1992), directed by Clint Eastwood; and Ruth DeWitt Bukater, the mother of Kate Winslet\'s character in Titanic (1997); directed by James Cameron. Both films won the Academy Award for Best Picture.\n\nShe is also known for her roles as Jane Crawford on the HBO series Watchmen, Mary Windsor in The Lincoln Lawyer, Evelyn Nolan (John Nolan\'s mother) on CBS\'s The Rookie, Barbara Schoenberg in Woman in Gold, Gwen in You\'re Not You, Lucille Langston on ABC\'s scifi drama Resurrection, Maggie Stryder in The Host (2013), Nicole Farmington on ABC\'s scifi drama Touch, Blanche Tipton on CBS\'s A Gifted Man, Elaine Flowers in The Kingdom (2007), The Mother on BBC\'s Torchwood, Eva Thorne on Syfy\'s Eureka, Connie Walsh in House of Sand and Fog, Sara Miller in Laws of Attraction, Junie in Gone in 60 Seconds, Donna Garcia in Striptease, Angie in FOX\'s Strange Luck, June in L.A. Story, and Rochelle Bossetti in Welcome Home, Roxy Carmichael.', '1952-05-11', NULL, 'Milford-on-the-sea, Hampshire, England, UK', '2025-05-09 10:18:56', '2025-05-09 10:18:56'),
(152, 113563, 'Rhys Coiro', '/pjPbrZHU0kJUiMOPYfxK8FeBwWQ.jpg', 'From Wikipedia, the free encyclopedia.\n\nRhys Coiro (born March 12, 1979) is an American film, television and stage actor. Coiro may be best-known for his role on the HBO original series Entourage as Billy Walsh.\n\nDescription above from the Wikipedia article Rhys Coiro, licensed under CC-BY-SA, full list of contributors on Wikipedia.​', '1979-03-12', NULL, 'Calabria, Italy', '2025-05-09 10:18:56', '2025-05-09 10:18:56'),
(153, 127725, 'Devon Werkheiser', '/d26EvfaVfDymIySVsi4d29Xey38.jpg', 'Besides being an actor, Devon is also a very talented singer.  He is perhaps best known for his role as Ned Bigby on the Nickelodeon series Ned\'s Declassified School Survival Guide.', '1991-03-08', NULL, 'Atlanta, Georgia, USA', '2025-05-09 10:18:57', '2025-05-09 10:18:57'),
(154, 3982, 'Xander Berkeley', '/oBoKGfngGGZmSVGFslphYjc23WO.jpg', 'Alexander Harper Berkeley (born December 16, 1955) is an American actor. He is known for his television roles as Sheriff Thomas McAllister on the crime drama The Mentalist, George Mason on the political thriller series 24, Percy Rose on the action thriller series Nikita, the Man on The Booth At The End and Gregory in AMC\'s The Walking Dead. His notable film roles include Todd Voight in Terminator 2: Judgment Day, Agent Gibbs in Air Force One, Bowery Snax in Sid and Nancy, Dr. Lamar in Gattaca, Trevor Lyle in Candyman and Ralph in Heat.', '1955-12-16', NULL, 'Brooklyn, New York City, New York, USA', '2025-05-09 10:18:57', '2025-05-09 10:18:57'),
(155, 28410, 'Jake Busey', '/3WknfRePAvwFJfrbYVvfYXTQCh9.jpg', 'William Jacob \"Jake\" Busey (born June 15, 1971) is an American actor, musician and film producer. He is sometimes credited as \"Jacob Busey\" or \"William Busey\". He is the son of actor Gary Busey.\n\nFrom Wikipedia, the free encyclopedia.', '1971-06-15', NULL, 'Los Angeles, California, USA', '2025-05-09 10:18:57', '2025-05-09 10:18:57'),
(156, 21132, 'Abraham Benrubi', '/d5pQ1PCv0XDnYXZTbX2t5r4AMph.jpg', 'Abraham Rubin Hercules Benrubi (born October 4, 1969) is an American actor. He is known for his appearances as Jerry Markovic on the long-running medical television drama ER, for his first role as Larry Kubiac on the series Parker Lewis Can\'t Lose, Dennis in Without a Paddle, and for his voice acting on the Adult Swim claymation series Robot Chicken as well as numerous video games including many in the World of Warcraft series.\n\nFrom Wikipedia, the free encyclopedia', '1969-10-04', NULL, 'Bloomington, Indiana, USA', '2025-05-09 10:18:58', '2025-05-09 10:18:58'),
(157, 128560, 'Travis Hammer', '/oiYzy7turdp3GICqprkIBOwaNg.jpg', 'Travis Hammer is an actor, known for Godless (2017), Ray Donovan (2013) and The Last Ship (2014).', NULL, NULL, NULL, '2025-05-09 10:18:58', '2025-05-09 10:18:58'),
