(164, 956385, 'Meadow Williams', '/7CQHKHgjAEcKaeTOZ2XsBVoT6Uz.jpg', '', '1966-02-10', NULL, 'Miami, Florida, USA', '2025-05-09 10:19:01', '2025-05-09 10:19:01'),
(165, 117642, 'Jason Momoa', '/3troAR6QbSb6nUFMDu61YCCWLKa.jpg', 'Joseph Jason Namakaeha Momoa (born August 1, 1979) is an American actor and filmmaker. He made his acting debut as Jason Ioane on the syndicated action drama series Baywatch: Hawaii (1999–2001), which was followed by his portrayal of Ronon Dex on the Syfy science fiction series Stargate Atlantis (2005–2009), Khal Drogo in the first two seasons of the HBO fantasy drama series Game of Thrones (2011–2012), Declan Harp on the Discovery Channel historical drama series Frontier (2016–2018), and Baba Voss on the Apple TV+ science fiction series See (2019–present). Momoa was featured as the lead of the two lattermost series.\n\nSince 2016, Momoa portrays Arthur Curry / Aquaman in the DC Extended Universe (DCEU), headlining the eponymous 2018 film and its 2023 sequel. Momoa also played Duncan Idaho in the 2021 film adaptation of the science fiction novel Dune.\n\nDescription above from the Wikipedia article Jason Momoa, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1979-08-01', NULL, 'Honolulu, Hawaii, USA', '2025-05-09 10:19:01', '2025-05-09 10:19:01'),
(166, 70851, 'Jack Black', '/rtCx0fiYxJVhzXXdwZE2XRTfIKE.jpg', 'Thomas Jacob Black (born August 28, 1969) is an American actor, comedian, and musician. He is known for his roles in family and comedy films and his voice work in animated films. His awards include a Children\'s and Family Emmy Award, a Grammy Award, and three Golden Globe Award nominations.\n\nAfter portraying supporting roles in films including Dead Man Walking (1995), The Cable Guy(1996), Mars Attacks! (1996), and Enemy of the State (1998), Black had his breakout role in the musical film High Fidelity (2000). This led to larger roles in films like Shallow Hal (2001) and Orange County (2002) before he solidified his leading-man status with his starring role in School of Rock (2003). Black has since starred in King Kong (2005), The Holiday (2006), Nacho Libre(2006), Tropic Thunder (2008), Bernie (2011), Goosebumps (2016), Jumanji: Welcome to the Jungle (2017), its sequel Jumanji: The Next Level(2019),  The House with a Clock in Its Walls(2018) and A Minecraft Movie (2025). He has also voiced Po in the Kung Fu Panda franchise (2008–present) and Bowser in The Super Mario Bros. Movie (2023). \n\nBlack is the lead vocalist of the duo Tenacious D, which he formed in 1994 with long-time friend Kyle Gass. In 2015, they won the Grammy Award for Best Metal Performance for \"The Last in Line.\" Since 2018, Black has run a YouTube channel called Jablinski Games.\n\nDescription above from the Wikipedia article Jack Black, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1969-08-28', NULL, 'Santa Monica, California, USA', '2025-05-09 10:19:02', '2025-05-09 10:19:02'),
(167, 2680307, 'Sebastian Eugene Hansen', '/40HNkoB3RKPMPgLhTyKQU6kG0sc.jpg', 'Sebastian Eugene Hansen (born April 6, 2010) is an American actor.', '2010-04-06', NULL, 'USA', '2025-05-09 10:19:02', '2025-05-09 10:19:02'),
(168, 2604515, 'Emma Myers', '/xBJsFGAL3sOIxMUA0sMVEKKpAL4.jpg', 'Emma Elizabeth Myers (born April 2, 2002) is an American actress. She began her career as a child actress in 2010 when she appeared in The Glades. She gained recognition for starring in the comedy horror series Wednesday (2022–present) and has since starred in the comedy film Family Switch (2023), the mystery series A Good Girl\'s Guide to Murder (2024), and the fantasy adventure comedy film A Minecraft Movie (2025).\n\nEmma Elizabeth Myers was born on April 2, 2002, in Orlando, Florida, to Nicole and Jeremy Myers. She has three sisters and is the second eldest among them. She attended a homeschool cooperative and, in her own words, \"never had a traditional school experience\". From her mother\'s side, she is of Greek ancestry.', '2002-04-02', NULL, 'Orlando, Florida, USA', '2025-05-09 10:19:02', '2025-05-09 10:19:02'),
(169, 1075037, 'Danielle Brooks', '/dEonf59ukDW8LaN7vwj8WMmXrXf.jpg', 'Danielle Brooks (born September 17, 1989) is an American actress. Her breakthrough role was as prison inmate Tasha \"Taystee\" Jefferson in the Netflix comedy-drama series Orange Is the New Black (2013–2019).\n\nIn 2015, Brooks made her Broadway debut in the musical revival of The Color Purple as Sofia, for which she received a nomination for a Tony Award and won a Grammy Award. In 2023, Brooks reprised her role as Sofia in the film adaptation of The Color Purple and was nominated for an Academy Award, British Academy Film Award, and Golden Globe Award for her performance. In 2021, she played gospel singer Mahalia Jackson in the made-for-television biographical film Robin Roberts Presents: Mahalia, for which she was nominated for the Primetime Emmy Award for Outstanding Television Movie as an executive producer.\n\nIn 2022, Brooks hosted Netflix\'s reality series Instant Dream Home and was nominated for a Daytime Emmy Award for Outstanding Daytime Program Host. The same year, Brooks starred in the superhero series Peacemaker (2022–present) and returned to Broadway in the revival of the August Wilson play The Piano Lesson, for which she received a Drama Desk Award nomination. She has since starred in the fantasy adventure comedy A Minecraft Movie.\n\nDescription above from the Wikipedia article Danielle Brooks, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1989-09-17', NULL, 'Augusta, Georgia, USA', '2025-05-09 10:19:03', '2025-05-09 10:19:03'),
(170, 38334, 'Jennifer Coolidge', '/hcpbV0dY4ZJxmZi1WcAWe8euqV2.jpg', 'Jennifer Coolidge (born August 28, 1961) is an American actress and comedian. Known for her work in the comedy genre, Coolidge is the recipient of several accolades, including a Golden Globe Award and two Primetime Emmy Awards. In 2023, she was included in the annual Time 100 list of the most influential people in the world.\n\nCoolidge had supporting roles in the American Pie film series (1999–2012) and the Legally Blonde film series (2001–2003). She has collaborated with Christopher Guest on four of his mockumentary films, Best in Show (2000), A Mighty Wind (2003), For Your Consideration (2006), and Mascots (2016). She has also appeared in the films A Cinderella Story (2004), Click (2006), Date Movie (2006), Epic Movie (2007), Promising Young Woman (2020), Single All the Way (2021), Shotgun Wedding (2022), and A Minecraft Movie (2025).\n\nOn television, Coolidge has appeared in the sitcoms Joey (2004–2006), The Secret Life of the American Teenager (2008–2012), 2 Broke Girls (2011–2017), and the drama series The Watcher (2022). She garnered critical acclaim for her role as Tanya McQuoid, an insecure wealthy woman, in the first two seasons of the HBO anthology series The White Lotus (2021–2022), winning two Primetime Emmy Awards and a Golden Globe.\n\nDescription above from the Wikipedia article Jennifer Coolidge, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1961-08-28', NULL, 'Boston, Massachusetts, USA', '2025-05-09 10:19:03', '2025-05-09 10:19:03'),
(171, 15298, 'Rachel House', '/2LCQF7Bn0I91o17GGkox0ZhhbE7.jpg', 'Rachel Jessica Te Ao Maarama House ONZM (born 20 October 1971) is a New Zealand actress and director. She is best known for her roles in the films of Taika Waititi. She has received numerous accolades, including an Arts Laureate, the NZ Order of Merit, \'Mana Wahine\' from WIFT NZ, and Te Waipuna a Rangi (Matariki Awards) for her contributions as an actor and director.\n\nDescription above from the Wikipedia article Rachel House, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1971-10-20', NULL, 'Auckland, New Zealand', '2025-05-09 10:19:04', '2025-05-09 10:19:04'),
