(174, 5345340, 'Moana Williams', '/xJnJYBEu2ATZetA6eqEDEDhNFUn.jpg', '', NULL, NULL, NULL, '2025-05-09 10:19:05', '2025-05-09 10:19:05'),
(175, 55936, 'Jemaine Clement', '/nFAD9b0MzFmujo8k4jXbhr5GQpq.jpg', 'Jemaine Atea Mahana Clement (born 10 January 1974) is a New Zealand actor, comedian, musician, and filmmaker. He has released several albums with Bret McKenzie as the musical comedy duo Flight of the Conchords and created a comedy TV series titled Flight of the Conchords for both the BBC and HBO, for which he received six Primetime Emmy nominations.\n\nHe has had featured parts in films such as Eagle vs Shark (2007), Gentlemen Broncos (2009), Men in Black 3 (2012), People Places Things(2015), Humor Me (2017), The Festival (2018) and Avatar: The Way of Water (2022). He has also done voice work for Despicable Me (2010), Rio (2011), Rio 2 (2014), Moana (2016) and The Lego Batman Movie (2017). In 2014, he made his directorial debut with What We Do in the Shadows, which he co-wrote, co-directed and co-starred in with Taika Waititi and later adapted into a show for the FX television series What We Do in the Shadows.\n\nDescription above from the Wikipedia article Jemaine Clement, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1974-01-10', NULL, 'Wellington, New Zealand', '2025-05-09 10:19:05', '2025-05-09 10:19:05'),
