(179, 105584, 'Bret McKenzie', '/xnoo95JB2XLdHbsYWHfUL7WkpIW.jpg', 'Bret Peter Tarrant McKenzie (born 29 June 1976 in Wellington, New Zealand) is a comedian, actor, musician and producer, best known for being one half of the musical comedy duo Flight of the Conchords along with Jemaine Clement. In the 2000s, the duo\'s comedy and music became the basis of a BBC radio series and then an oft-lauded American television series, which aired for two seasons on HBO. Active since 1998, the duo released their most recent comedy special, Live in London, in 2018.\n\nPrimarily a musician, McKenzie has worked as a songwriter and music supervisor for film and television since the 2010s. He served as music supervisor for two Muppet films, The Muppets (2011) and Muppets Most Wanted (2014), the former of which won him an Academy Award for Best Original Song for the song \"Man or Muppet\". In the 2000s, McKenzie was part of reggae fusion band The Black Seeds and Wellington International Ukulele Orchestra, and, in the 2010s, he began performing solo material. His debut album Songs Without Jokes was released in August 2022.\n\nAs an actor, he portrayed elves in Peter Jackson\'s The Lord of the Rings and The Hobbit film trilogies: in the first he remained unnamed with fans naming him Figwit, a character originally cast as an extra who gained attention thanks to the trilogy\'s fan community. He later appears in The Hobbit as Lindir, a minor character who originally appears in the book of The Fellowship of the Ring.', '1976-06-29', NULL, 'Wellington, New Zealand', '2025-05-09 10:19:06', '2025-05-09 10:19:06'),
(180, 53925, 'Jared Hess', '/AlZGAfdgo6PL0ZOooHf0kxk1wHG.jpg', 'Jared Lawrence Hess (born July 18, 1979) is an American filmmaker known for his work Napoleon Dynamite (2004), A Minecraft Movie (2025) and Nacho Libre (2006), which he co-wrote and directed with his wife, Jerusha Hess. (Nacho Libre was co-written with Mike White). He also produced the video for The Postal Service\'s third single, \"We Will Become Silhouettes\" and The Killers\' Christmas single, \"Boots\".', '1979-07-18', NULL, 'Preston, Idaho, USA', '2025-05-09 10:19:07', '2025-05-09 10:19:07'),
(181, 5234074, 'Batanai Mashingaidze', '/gyM8pC0xStN7lK2i4Dq6iWtlhbN.jpg', '', NULL, NULL, 'Zimbabwe', '2025-05-09 10:19:07', '2025-05-09 10:19:07'),
(182, 1236969, 'Amanda Billing', '/e5mTaNADAsMWv2FO9UMeYeqRZGq.jpg', 'From Wikipedia, the free encyclopedia\n\nAmanda Billing (born 12 April 1976 in New Zealand) is a New Zealand actress best known for her role as Doctor Sarah Potts on New Zealand soap opera Shortland Street.\n\nBilling grew up in Masterton, and spent her university years in Christchurch. After graduating with a Bachelor of Arts with 1st Class Honours in Geography from the University of Canterbury, she trained at the Christchurch College of Education and became a high school teacher.\n\nBilling was involved in drama throughout her teaching years and has acted in a few amateur stage productions including Cloud Nine and The Country Wife. She has worked at several schools throughout Auckland teaching Geography, English and Social Studies, most recently at Rangitoto College.', '1976-04-12', NULL, 'Masterton, New Zealand', '2025-05-09 10:19:07', '2025-05-09 10:19:07'),
