(196, 1488236, 'Matt Berry', '/1UCAuXgzQfeANlLnZFVSuq0OFhR.jpg', 'Matthew Charles Berry (born May 2, 1974) is an English actor, comedian, writer, and musician. He has appeared in comedy series such as The IT Crowd, Garth Marenghi\'s Darkplace, The Mighty Boosh, Snuff Box, The Wrong Door, and House of Fools. He currently plays the lead role of Steven Toast in the Channel 4 sitcom Toast of London, for which he won the 2015 BAFTA Award for Best Male Performance in a Comedy Programme. Starting in 2019, he has starred in the FX television series What We Do In the Shadows and the sitcom Year of the Rabbit.  Matt is a strikingly shy and retiring in person. His hair - long, luxuriant, constantly being pushed back from his face - might be the loudest thing about him.\n\nHe is, he says several times, “a very private person”. So much so, that when we talk briefly about the fact he has just moved out of London to somewhere with a bit more space, he looks suddenly stricken and asks me not to name the place. “I don’t want anyone to know where I am, really. If that’s alright.”', '1974-05-02', NULL, 'Bromham, Bedfordshire, England, UK', '2025-05-09 10:19:12', '2025-05-09 10:19:12'),
(197, 2089332, 'Alice May Connolly', '/nGZLHw788qEiX1G0ogY1kTNsgRp.jpg', '', NULL, NULL, NULL, '2025-05-09 10:19:13', '2025-05-09 10:19:13'),
(198, 1165391, 'Jens Bergensten', '/caJh6zmmgQRoyVPLcujORgERQvs.jpg', 'Jens Peder Bergensten (born 18 May 1979), known professionally as Jeb, is a Swedish video game programmer and designer. He is best known as the lead designer of Minecraft, and is the Chief Creative Officer of Mojang Studios.', '1979-05-18', NULL, 'Örebro, Sweden', '2025-05-09 10:19:13', '2025-05-09 10:19:13'),
(199, 4503356, 'Oliver Brotherhood', '/ujFldwpZja53lOvY9KNDvWkiXLp.jpg', 'Oliver \"Oli\" Brotherhood, often referred to by his screename MumboJumbo, is a YouTube creator with a primary focus on Minecraft content. His second channel, \"Mumbo,\" is focused on live-action short films. He gained attention outside of the Minecraft sphere for being a victim of YouTube\'s flawed copyright strike system, and was featured in Tom Scott\'s video on the subject.', '1995-12-01', NULL, NULL, '2025-05-09 10:19:13', '2025-05-09 10:19:13'),
(200, 2932608, 'Daniel Middleton', '/sx2DPUunARsqlcLlGuFZ8zw7WL9.jpg', 'Daniel Robert Middleton (born November 8, 1991), better known online as DanTDM (formerly TheDiamondMinecart), is a British YouTuber and gamer known for his video game commentaries. His online video channels have covered many video games including Minecraft, Roblox and Pokémon.\n\nHis channel has been listed among the top YouTube channels in the United Kingdom. In July 2015, he was listed as one of the most popular YouTubers in the world by viewership. He has won several Kids\' Choice Awards and set Guinness World Records for his gaming and presenting. In 2017, Middleton topped the Forbes list of Highest-Paid YouTube Stars, earning $16.5 million (about £12.2 million) in one year. As of July 2022, his YouTube channel has reached over 26.2 million subscribers, 18.6 billion video views, and has posted over 3,500 videos', '1991-11-08', NULL, 'Aldershot, Hampshire, England, UK', '2025-05-09 10:19:14', '2025-05-09 10:19:14'),
(201, 3819595, 'Elizabeth Batty', '/oC8gUVsjJFxMuTRW7pYnAz0skXT.jpg', '', '1992-10-07', NULL, 'UK', '2025-05-09 10:19:14', '2025-05-09 10:19:14'),
(202, 5338345, 'Jessica Bravura', '/dcKtrNoaFocpFvuT6TrGhNsxW8C.jpg', '', '1989-10-16', NULL, 'Houston, Texas, USA', '2025-05-09 10:19:14', '2025-05-09 10:19:14'),
(203, 1240487, 'Kate McKinnon', '/7o26OzpEPAUma65jGQZop9d52gy.jpg', 'Kate McKinnon Berthold (born January 6, 1984) is an American actress, comedian, impressionist, and writer. She was a cast member on the NBC sketch comedy series Saturday Night Live from 2012 to 2022, where she became known for her character work and celebrity impressions. For her work on the series, she was nominated for ten Primetime Emmy Awards, including one for Outstanding Original Music and Lyrics and nine for Outstanding Supporting Actress in a Comedy Series, winning in 2016 and 2017.\n\nMcKinnon starred in the Logo sketch comedy series The Big Gay Sketch Show (2007–2010), voiced lead roles in the PBS Kids animated series Nature Cat (2015–present) and the Netflix animated series The Magic School Bus Rides Again (2017–2021), and portrayed Carole Baskin in the Peacock miniseries Joe vs. Carole (2022).\n\nMcKinnon has also appeared in numerous films, such as Balls Out (2014), Ghostbusters (2016), Office Christmas Party (2016), Rough Night (2017), The Spy Who Dumped Me (2018), Yesterday (2019), Bombshell (2019), DC League of Super-Pets (2022), and Barbie (2023).\n\nDescription above from the Wikipedia article Kate McKinnon, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1984-01-06', NULL, 'Sea Cliff, New York, USA', '2025-05-09 10:19:15', '2025-05-09 10:19:15'),
(204, 2524, 'Tom Hardy', '/d81K0RH8UX7tZj49tZaQhZ9ewH.jpg', 'Edward Thomas Hardy CBE (born 15 September 1977) is an English actor, producer, writer and former model. After studying acting at the Drama Centre London, he made his film debut in Ridley Scott\'s Black Hawk Down (2001). He has since been nominated for the Academy Award for Best Supporting Actor, two Critics\' Choice Movie Awards and two British Academy Film Awards, receiving the 2011 BAFTA Rising Star Award.\n\nHardy has also appeared in films such as Star Trek: Nemesis (2002), RocknRolla (2008), Bronson (2008), Warrior (2011), Tinker Tailor Soldier Spy (2011), Lawless (2012), This Means War (2012), Locke (2013), The Drop (2014), and The Revenant (2015), for which he received a nomination for an Academy Award. In 2015, he portrayed \"Mad\" Max Rockatansky in Mad Max: Fury Road and both Kray twins in Legend. He has appeared in three Christopher Nolan films: Inception (2010) as Eames, The Dark Knight Rises (2012) as Bane, and Dunkirk (2017) as an RAF fighter-pilot. He starred as both Eddie Brock and Venom in the 2018 anti-hero film Venom and its sequel Venom: Let There Be Carnage (2021).\n\nHardy\'s television roles include the HBO war drama mini-series Band of Brothers (2001), the BBC historical drama mini-series The Virgin Queen (2005), Bill Sikes in the BBC\'s mini-series Oliver Twist (2007), Heathcliff in ITV\'s Wuthering Heights (2009), the Sky 1 drama series The Take (2009), and as Alfie Solomons in the BBC historical crime drama series Peaky Blinders (2014–present). He created, co-produced, and took the lead in the eight-part historical fiction series Taboo (2017) on BBC One and FX. In 2020, he also contributed narration work to the Amazon docuseries All or Nothing: Tottenham Hotspur.\n\nHardy has performed on both British and American stages. He was nominated for the Laurence Olivier Award for Most Promising Newcomer for his role as Skank in the production of In Arabia We\'d All Be Kings (2003), and was awarded the 2003 Evening Standard Theatre Award for Outstanding Newcomer for his performances in both In Arabia We\'d All Be Kings and Blood, in which he played Luca. He starred in the production of The Man of Mode (2007) and received positive reviews for his role in the play The Long Red Road (2010). Hardy is active in charity work and is an ambassador for the Prince\'s Trust. He was appointed a CBE in the 2018 Birthday Honours for services to drama.\n\nDescription above from the Wikipedia article Tom Hardy, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1977-09-15', NULL, 'Hammersmith, London, England, UK', '2025-05-09 10:19:17', '2025-05-09 10:19:17'),
(205, 2234003, 'Jessie Mei Li', '/t7LmlgmjsqGNRj0sA4tthejP3yI.jpg', 'Jessica Mei Li (born 27 August 1995) is an English actress. She stars as Alina Starkov in the Netflix fantasy series Shadow and Bone. She also appeared in the 2019 production of All About Eve and in Edgar Wright\'s Last Night in Soho.\n\nDescription above from the Wikipedia article Jessie Mei Li, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1995-08-27', NULL, 'Brighton, England, UK', '2025-05-09 10:19:17', '2025-05-09 10:19:17'),
(206, 18082, 'Timothy Olyphant', '/7pHmRHE2wBNC9cBgNIRCBqFLoyZ.jpg', 'Timothy David Olyphant (born May 20, 1968) is an American actor. He made his acting debut in an off-Broadway theater in 1995, in The Monogamist, and won the Theatre World Award for his performance, and then originated David Sedaris\' The Santaland Diaries in 1996. He then branched out to film; in the early years of his career, he was often cast in supporting villainous roles, most notably in Scream 2 (1997), Go (1999), A Man Apart (2003), Gone in 60 Seconds (2000), and The Girl Next Door (2004).\n\nHe came to the attention of a wider audience with his portrayal of Sheriff Seth Bullock in HBO\'s western Deadwood (2004–2006). He had starring roles in such films as Catch and Release (2006), Hitman (2007), A Perfect Getaway (2009), and The Crazies (2010), and he played the main antagonist, Thomas Gabriel, in Live Free or Die Hard (2007).  In 2020, he played himself in a brief cameo, parodying his Justified character, in the NBC award-winning show The Good Place. In the same year, he guest starred in season 10 of Curb Your Enthusiasm, as well as in the fourth season of Fargo and the second season of The Mandalorian in the episode \"Chapter 9: The Marshal\" as Cobb Vanth, a role he later reprised in The Book of Boba Fett.', '1968-05-20', NULL, 'Honolulu, Hawaii, USA', '2025-05-09 10:19:18', '2025-05-09 10:19:18'),
(207, 2178, 'Forest Whitaker', '/4w7l5JUwnwFNBy7J93ZwYN1nihm.jpg', 'Forest Steven Whitaker (born July 15, 1961) is an American actor, producer, director, and activist. He is the recipient of various accolades, including an Academy Award, a Golden Globe Award, a British Academy Film Award, and two Screen Actors Guild Awards.\n\nAfter making his film debut in Fast Times at Ridgemont High (1982), Whitaker went on to earn a reputation for intensive character study work for films, such as Platoon (1986), Good Morning, Vietnam (1987), Bird (1988), The Crying Game (1992), Phenomenon (1996), Ghost Dog: The Way of the Samurai (1999), The Great Debaters (2007), The Butler (2013), Arrival (2016), and Respect (2021). He has also appeared in blockbusters, such as Panic Room (2002), Rogue One: A Star Wars Story (2016) as Saw Gerrera, and Black Panther (2018) as Zuri. For his portrayal of Ugandan dictator Idi Amin in the British historical drama film The Last King of Scotland (2006), Whitaker won the Academy Award for Best Actor. Whitaker made his directorial debut with the television film Strapped (1993), and directed the films Waiting to Exhale (1995), Hope Floats (1998), and First Daughter (2004).\n\nApart from his film career, Whitaker is also known for his humanitarian work and activism. In 2011, he was inducted as a UNESCO Goodwill Ambassador, later receiving a promotion to Special Envoy for Peace and Reconciliation, and serves as the CEO of Whitaker Peace and Development Initiative (WPDI), a non-profit outreach program.\n\nDescription above from the Wikipedia article Forest Whitaker, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1961-07-15', NULL, 'Longview, Texas, USA', '2025-05-09 10:19:18', '2025-05-09 10:19:18'),
(208, 1684648, 'Justin Cornwell', '/xFmMBP5qtAiLDpbrziXOYdAkK7.jpg', '', NULL, NULL, NULL, '2025-05-09 10:19:18', '2025-05-09 10:19:18'),
(209, 3140018, 'Quelin Sepulveda', '/oNXfeaVbilHgKafs2ovn9XffG3g.jpg', 'Sepulveda graduated from LAMDA in 2020. Since graduating her credits include one of the lead roles opposite Tom Hardy in Gareth Evans’ Havoc for Netflix and The Man Who Fell To Earth (Showtime) opposite Chiwetel Ejiofor. She has also appeared in the short films The Other End (2021) as Shona and in Late Nights at the Movies (2018) as Livion.', '1991-08-23', NULL, 'North London, England, UK', '2025-05-09 10:19:19', '2025-05-09 10:19:19'),
(210, 40481, 'Luis Guzmán', '/kSdxUckOJj9R5VKrLUnRy14YhNV.jpg', 'Luis Guzmán (born August 28, 1956) is an actor from Puerto Rico. He is known for his character work. For much of his career, his squat build, wolfish features, and brooding countenance have garnered him roles largely as sidekicks, thugs, or policemen, but his later career has seen him move into more mainstream roles. He is a favorite of director Steven Soderbergh, who cast him in Out of Sight, The Limey, and Traffic, and Paul Thomas Anderson, who cast him in Boogie Nights, Magnolia and Punch-Drunk Love. He also voiced Ricardo Diaz in Grand Theft Auto: Vice City and Grand Theft Auto: Vice City Stories.', '1956-08-28', NULL, 'Cayey, Puerto Rico', '2025-05-09 10:19:19', '2025-05-09 10:19:19'),
(211, 1297561, 'Sunny Pang', '/tEhFEmOLwnoHcX0PJhzSLWr0Dw2.jpg', 'Sunny is a character actor with good screen presence. He is also an accomplished martial artist, MMA (Mixed Martial Arts) coach, Action Director and Fight Choreographer. He has appeared in numerous short films and TV serials (including the highly successful Code of Law on Mediacorp Ch5).\n\nHe has an impressive list of movie credits that include Call If You Need Me, One Last Dance, The Maid and Perth. His most recent feature films projects have seen him take on leading-roles and main cast roles. These include the Indonesian movie Headshot (opposite Iko Uwais as the main antagonist “Lee”).; Malaysian movies Petaling Street Warriors and The Collector; and local Singapore movies Siew Lap (Sam Loh) and “re: solve”. 2015 has seen him putting on the Action Director’s hat for TV productions such as 2025 and Premonition! He will also be appearing in upcoming movies such as Buffalo Boys (Mike Wiluan).', '1982-11-02', NULL, 'Singapore', '2025-05-09 10:19:19', '2025-05-09 10:19:19'),
(212, 130761, 'Yeo Yann Yann', '/ncOxEFlrrR35kVZW5MgA1uGTUMx.jpg', 'Yann Yann Yeo is a Malaysian born, Singapore-based actress.  She is a pioneer graduate of the Intercultural Theatre Institute.\n\nIn 2007 she won the LIFE! Theatre Award, Best Actress for the play \'Thunderstorm\'.\n\nIn 2013 she received the Golden Horse Festival Award, Best Supporting Actress for Ilo Ilo.', '1977-02-20', NULL, 'Johor Bahru, Johor, Malaysia', '2025-05-09 10:19:20', '2025-05-09 10:19:20'),
