(224, 2977460, 'Gareth Tidball', '/uqhFXcfgjNDdbCGk5cflwE5ioEV.jpg', 'Gareth Tidball is an award-winning actress and screenwriter with a romantic affinity for the macabre. She typically plays young, tough women with a strong sense of justice and an air of quiet mystery. Gareth first made waves in the indie film scene with her performance in the hard-hitting thriller \'My Autopsy\' - currently available on Amazon Prime. Since then, she has made appearances in several feature films: wacky horror-comedy \'Obstacle Corpse\' (MaddWolf Productions), neo-noir horror \'Casting Kill\' (Raya Films), and Tom Ryan\'s epic horror anthology \'Return to the Theatre of Terror\' (Theatre of Terror Productions.) Coming up, Gareth will be leading the cast in \'Foxglove Candy,\' a female-driven thriller from the mind of Daniel Emery Taylor (Debtor Entertainment.) Gareth is originally from Oakland, California, and is a proud dual citizen of both the US and UK.', NULL, NULL, 'Berkeley, California, United States', '2025-05-09 10:19:24', '2025-05-09 10:19:24'),
