(250, 1371452, 'David Cheung', '/z5Xkb20AgnBPUs01J7J2lykIPyR.jpg', 'David Cheung is a Hong Kong Chinese Action Actor, Martial Artist and Stunt Performer based in London United Kingdom. His passion for performance led him to study at the prestigious Identity School Of Acting known for producing stars such as John Boyega.\n\nDavid Cheung is currently appearing in Johnny Depp\'s Mortdecai, Joey Ansah\'s Street Fighter Resurrection, the award winning film Arene, with Taylor Lautner in the BBC TV series Cuckoo , the German/Chinese co-production Out Of Control with Cecilia Cheung, and the BBC TV series Snatch based on the Guy Richie film.', NULL, NULL, 'London, England', '2025-05-09 10:19:34', '2025-05-09 10:19:34'),
