(269, 3417, 'Tony Goldwyn', '/ptm8SG4MYIMn0hnDl2YJ70Dwal5.jpg', 'Anthony Howard \'Tony\' Goldwyn (born May 20, 1960) is an American actor, singer, producer, director, and political activist. He\'s known for his roles as Carl Bruner in Ghost, President Fitzgerald Grant on ABC\'s drama Scandal, district attorney Nicholas Baxter on Law & Order, Gordon Gray in Oppenheimer, Paul Cohen in King Richard (2021), Andrew Prior in Divergent and Insurgent, Colonel Bagley in The Last Samurai,  Michael Drucker in The 6th Day, Dr. William \'Will\' Rudolph in Kiss the Girls, Neil Armstrong in the HBO miniseries From the Earth to the Moon, Harold Nixon in Nixon (1995), Fletcher Cole in The Pelican Brief, and the voice of Tarzan in the Disney animated Tarzan.\n\nHe made his acting debut appearing as Darren in the slasher film Friday the 13th Part VI: Jason Lives (1986), and had his breakthrough for starring as Carl Bruner in the fantasy thriller film Ghost (1990), which earned him a nomination for the Saturn Award for Best Supporting Actor. He went on to star as Harold Nixon in the biographical film Nixon (1995), which earned him a Screen Actors Guild Award nomination, and as Neil Armstrong in the HBO miniseries From the Earth to the Moon (1998).\n\nHe portrayed Paul Cohen in King Richard (2021), which earned him a second nomination for a Screen Actors Guild Award. He starred as President Fitzgerald Grant III in the ABC legal/political drama Scandal (2012–2018) and directed a number of episodes for the series, for which he won a Peabody Award.\n\nHe is the son of film producer Samuel Goldwyn Jr. and actress Jennifer Howard. His paternal grandparents were film producer and movie studio mogul Samuel Goldwyn, a Polish Jewish immigrant from Warsaw, and actress Frances Howard, who was originally from Nebraska. His maternal grandparents were playwright Sidney Howard and actress Clare Eames. His brother John Goldwyn is a film producer, a former executive of Paramount Pictures and the executive producer of the series Dexter. His brother Peter is also a film producer and the current President of Samuel Goldwyn Films. His half-sister Liz Goldwyn is a filmmaker. His niece is writer/producer Emily Goldwyn (John\'s daughter - and her mother is actress Colleen Camp).\n\nHe has been married to production designer Jane Musky since 1987 and they have two daughters: Anna, a screenwriter, and Tess, an actress.\n\nMost info from ​Wikipedia, the free encyclopedia.', '1960-05-20', NULL, 'Los Angeles, California, USA', '2025-05-09 10:19:41', '2025-05-09 10:19:41'),
(270, 6613, 'Minnie Driver', '/OskQBuriLtKWNiCnLTHjMqV1ga.jpg', 'Amelia Fiona Jessica \"Minnie\" Driver (born January 31, 1970) is an English actress and singer. She\'s best known for her roles as Skylar in Good Will Hunting, Maya DiMeo on the sitcom Speechless, Dahlia Molloy on the series The Riches, Fiona on the sitcom About a Boy, Frances Kelly on the series The Deep, Queen Beatrice in Cinderella (2021), Debi Newberry in Grosse Point Blank, Mandy in Ella Enchanted, Carlotta in The Phantom of the Opera, Bernadette \'Benny\' Hogan in Circle of Friends, and the voice of Jane Porter in Disney\'s Tarzan.\n\nShe rose to prominence with her break-out role in 1995\'s Circle of Friends. She went on to star in a wide range of films including the cult classic Grosse Pointe Blank, Gus Van Sant\'s Good Will Hunting for which she was nominated for both the Academy Award for Best Supporting Actress and a Screen Actors Guild Award, the musical The Phantom of the Opera, Owning Mahowny, and providing the voice of Lady Eboshi in Hayao Miyazaki\'s Princess Mononoke.\n\nDescription above from the Wikipedia article Minnie Driver, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1970-01-31', NULL, 'Finsbury Park, London, England, UK', '2025-05-09 10:19:41', '2025-05-09 10:19:41'),
(271, 515, 'Glenn Close', '/eNTn3OmlnsQYLIp7HVGeH9kOJiA.jpg', 'Glenn Close (born March 19, 1947) is an American actress. In a career spanning over five decades of screen and stage, she has received numerous accolades, including three Primetime Emmy Awards, three Tony Awards and three Golden Globe Awards, in addition to nominations for eight Academy Awards and three Grammy Awards. She is one of the few performers to be nominated for the Triple Crown of Acting and EGOT. In 2009, she received a motion picture star on the Hollywood Walk of Fame, and in 2016, she was inducted into the American Theater Hall of Fame. Time named her one of the 100 most influential people in the world in 2019.\n\nDescription above from the Wikipedia article Glenn Close, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1947-03-19', NULL, 'Greenwich, Connecticut, USA', '2025-05-09 10:19:42', '2025-05-09 10:19:42'),
(272, 15789, 'Alex D. Linz', '/sGc3eYFDybC5lr0iWnRvJswZlH7.jpg', 'Alexander David Linz (born January 3, 1989) is an American former actor who starred in several late 1990s and early 2000s films and television programs as a child actor. He is most well-known for movies such as Home Alone 3 (1997) and Max Keeble\'s Big Move (2001). After 2007, Alex stepped away from the film industry and as of 2023, he was working as a legal researcher and lead science instructor in LA.', '1989-01-03', NULL, 'Santa Barbara, California, USA', '2025-05-09 10:19:42', '2025-05-09 10:19:42'),
(273, 12929, 'Rosie O\'Donnell', '/bfeIiPngsbLU7zK8sS18l3Pz3KR.jpg', 'Roseann \"Rosie\" O\'Donnell (born March 21, 1962) is an American stand-up comedienne, actress, singer, author and media personality. She has also been a magazine editor and continues to be a celebrity blogger, LGBT rights activist, television producer and collaborative partner in the LGBT family vacation company R Family Vacations.\n\nRaised Roman Catholic, O\'Donnell lost her mother to cancer as a pre-teen and has stressed the importance of protecting children and supporting families throughout her career. O\'Donnell started her comedy career while still a teenager and her big break was on the talent show Star Search when she was twenty years old. A TV sitcom and a series of movies introduced her to a larger national audience and in 1996 she started hosting The Rosie O\'Donnell Show which won multiple Emmy awards.\n\nDuring her years on The Rosie O\'Donnell Show she wrote her first book, a memoir called Find Me and developed the nickname \"Queen Of Nice\" as well as a reputation for philanthropic efforts. She used the book\'s $3 million advance to establish her own For All Kids foundation and promoted other charity projects encouraging other celebrities on her show to also take part. O\'Donnell came out stating \"I\'m a dyke!\" two months before finishing her talk show run, saying that her primary reason was to bring attention to gay adoption issues.  O\'Donnell is a foster—and adoptive—mother. She has since continued to support many LGBT causes and issues.\n\nIn 2006 O\'Donnell became the new moderator on The View boosting ratings and attracting controversies with her liberal views, and strong personality, dominating many of the conversations. She became a polarizing figure to many and her strong opinions resulted in several notable controversies including an on-air dispute regarding the Bush administration\'s policies with the war in Iraq resulting in a mutual agreement to cancel her contract. In 2007 O\'Donnell also released her second memoir, Celebrity Detox, which focuses on her struggles with fame and her time at The View. She continues to do charity work and remains involved with LGBT and family-related issues. She is best known for her inaccurate prediction that Donald Trump will never be the President of the United States. In 2008 O\'Donnell starred in and executive produced America (2009 film), a Lifetime channel original movie in which she plays the therapist of the title character, a 16-year-old boy aging out of the foster care system. The film is based on the E.R. Frank book of the same name. \n\nIn October 2009, she appeared in the original cast of Love, Loss, and What I Wore.  In November 2009 \"Rosie Radio\", a daily two-hour show with O\'Donnell discussing news and events on Sirius XM Radio, premiered. O\'Donnell said she was approached by the company after she appeared on The Howard Stern Show.   O\'Donnell has signed on with the Oprah Winfrey Network OWN to return to daytime TV with a talk show in Fall 2011. \n\nDescription above from the Wikipedia article Rosie O\'Donnell,   licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1962-03-21', NULL, 'Commack, Long Island, New York, USA', '2025-05-09 10:19:43', '2025-05-09 10:19:43'),
(274, 8318, 'Brian Blessed', '/3mLIr94V5IOA5ndY6GyqKKcyrX6.jpg', 'Brian Blessed OBE ( born 9 October 1936) is an English actor. He is known for his distinctive bushy beard, booming voice, and exuberant personality and performances. He portrayed PC \"Fancy\" Smith in Z-Cars; Augustus in the 1976 BBC television production of I, Claudius; King Richard IV in the first series of Blackadder; Prince Vultan in Flash Gordon; Bustopher Jones and Old Deuteronomy in the 1981 original London production of Cats at the New London Theatre; Thomas Beaufort, Duke of Exeter, in Henry V; Boss Nass in Star Wars: Episode I – The Phantom Menace; and the voice of Clayton and the Tarzan yell in Disney\'s Tarzan.\n\nIn 2016, Blessed was appointed Officer of the Order of the British Empire (OBE) for services to the arts and charity.\n\nBlessed was born on 9 October 1936 at Montagu Hospital in Mexborough, West Riding of Yorkshire, the son of William Blessed, a socialist coal miner at Hickleton Main Colliery (and himself the son of a coal miner) and cricketer for the Yorkshire second team, and Hilda (née Wall). He had a brother Alan, seven years younger, and the pair \"went everywhere together\" when they were growing up. Alan Blessed died from leukaemia aged 52; their mother died aged 87, and their father died aged 99. Blessed\'s great-great-grandfather, Jabez Blessed, was the father of 13 children and worked as a china and glass dealer in Brigg, Lincolnshire; many of Blessed\'s relatives hail from Brigg.\n\nBlessed went to Bolton on Dearne Secondary Modern School, and completed his national service in the RAF, in Bicester, before enrolling at the Bristol Old Vic Theatre School in 1956.', '1936-10-09', NULL, 'Mexborough, Yorkshire, England, UK', '2025-05-09 10:19:43', '2025-05-09 10:19:43'),
(275, 15788, 'Nigel Hawthorne', '/v8bin2HUa9gayqxmCnlRlh0taxq.jpg', 'From Wikipedia, the free encyclopedia.\n\nSir Nigel Barnard Hawthorne, CBE (5 April 1929 – 26 December 2001) was an English actor, perhaps best remembered for his role as Sir Humphrey Appleby, the Permanent Secretary in the 1980s sitcom Yes Minister and the Cabinet Secretary in its sequel, Yes, Prime Minister. For this role he would win four Bafta Awards during the 1980s in the \'Best Light Entertainment Performance\' Category. In the 1990s He would win two more Bafta Awards, one as Best TV Actor for \'The Fragile Heart\' and one as Best Film Actor for \'The Madness of King George\'. His role in the latter also garnered him his sole Oscar Nomination.\n\nDescription above from the Wikipedia article Nigel Hawthorne, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1929-04-05', '2001-12-26', 'Hertfordshire, England, UK', '2025-05-09 10:19:43', '2025-05-09 10:19:43'),
(276, 2714, 'Lance Henriksen', '/1PkFmD5HdjmRa2DumtwINnnAjTH.jpg', 'Lance Henriksen (born May 5, 1940) is an American actor and artist. He is best known to film and television audiences for his roles in science fiction, action, and horror films such as The Terminator, the Alien film franchise, and the television show Millennium. Henriksen is also a voice actor, noted for his deep, commanding voice.', '1940-05-05', NULL, 'Manhattan, New York City, New York, USA', '2025-05-09 10:19:44', '2025-05-09 10:19:44'),
(277, 4201, 'Wayne Knight', '/l5nD2XV6boxUk7bftceRUIi0ulW.jpg', 'Wayne Elliot Knight (born August 7, 1955) is an American actor. In television, he played Newman on Seinfeld (1992–1998) and Officer Don Orville on 3rd Rock from the Sun (1996–2001). He also voiced Igor on Toonsylvania (1998–1999), Mr. Blik on Catscratch (2005–2007) and Baron Von Sheldgoose on Legend of the Three Caballeros (2018).\n\nIn film, he played Dennis Nedry in Jurassic Park (1993), which earned him a Saturn Award for Best Supporting Actor nomination. He also portrayed Pete \"Piccolo\" Dugan in Dead Again (1991), John Correli in Basic Instinct (1992), Stan Podolak in Space Jam (1996) and Zach Mallozzi in Rat Race (2001) and provided the voices of Tantor in Tarzan (1999), Al McWhiggin in Toy Story 2 (1999) and The Elf Elder in Tom and Jerry: The Lost Dragon (2014).', '1955-08-07', NULL, 'New York City, New York, USA', '2025-05-09 10:19:44', '2025-05-09 10:19:44'),
(278, 116869, 'Taylor Dempsey', NULL, '', NULL, NULL, NULL, '2025-05-09 10:19:44', '2025-05-09 10:19:44'),
(279, 214701, 'Sherry Lynn', '/cp7SYig9JVbBWgc2YD4wEUNQGzh.jpg', 'Sherry Lynn is an American voice actress who has played roles in anime, animated television series and video games. She portrayed Sasami Jurai in the Tenchi Muyo! franchise.', '1952-05-20', NULL, 'Tacoma, Washington, USA', '2025-05-09 10:19:45', '2025-05-09 10:19:45'),
(280, 78317, 'Bob Bergen', '/soDD1xiV3zVQWOJzVdJwfgIqzfe.jpg', 'Robert \"Bob\" Bergen (born March 8, 1964) is an American voice actor. He is the current voice of Porky Pig (having performed the character in Tiny Toon Adventures, Space Jam, Looney Tunes: Back in Action, and the Duck Dodgers TV show), and formerly hosted Jep!, a kids\' version of the popular game show Jeopardy!\n\nBergen was born in St. Louis, Missouri. He is also responsible for the voice of Lupin the Third for the Streamline Pictures dubs in the late 1980s and early 1990s. Bob Bergen has played Lupin the Third in: Mystery of Mamo (directed by Soji Yoshikawa), The Castle of Cagliostro (directed by Hayao Miyazaki) and Lupin the Third\'s Greatest Capers (2 TV episodes from Series Two directed by Hayao Miyazaki). He also played the part of No-Face in the 2001 academy award winning movie Spirited Away and Kai and Masaru in the anime classic Akira.\n\nHe is also one of the announcers on Disney Channel and voices Bucky the squirrel in The Emperor\'s New School.\n\nHe is also responsible for the voice of Luke Skywalker in over a dozen Star Wars video games as well as Robot Chicken\'s Star Wars Episode I and Star Wars Episode II Specials. He also provided the voice of Wembley and the World\'s Oldest Fraggle from Fraggle Rock (animated). Bergen was selected to play the animated versions of Dr. Bunsen Honeydew and Link Hogthrob in the ill-fated Little Muppet Monsters and also voiced characters of the day in the 1987-1989 seasons of Jim Henson\'s Muppet Babies\n\nHe was the voice of Comet for the highly successful, \'The Santa Clause\', \'The Santa Clause 2\', and \'The Santa Clause 3: The Escape Clause\'.\n\nDescription above from the Wikipedia article Bob Bergen, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1964-03-08', NULL, 'St. Louis, Missouri, USA', '2025-05-09 10:19:45', '2025-05-09 10:19:45'),
(281, 70615, 'Rodger Bumpass', '/lGQkw6adxqB6Hcm7VK8nVHbKupe.jpg', 'Rodger Albert Bumpass (born November 20, 1951) is an American character actor and voice actor Noted as his long-running-role as Squidward Tentacles on the hit series SpongeBob SquarePants. He also voiced Professor Membrane on Invader Zim, created by Jhonen Vasquez. Bumpass had many other credits in animated films, animated television series, and video games. Bumpass\' voice acting credits go back as far as a 1962 episode of The Jetsons. He has repeatedly denied that his name is, in fact, a joke.\n\nDescription above from the Wikipedia article Rodger Bumpass, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1951-11-20', NULL, 'Little Rock, Arkansas, USA', '2025-05-09 10:19:46', '2025-05-09 10:19:46'),
(282, 112561, 'Lily Collins', '/aFSZkMNjmDR07JtkvhcbLAbDAMx.jpg', 'Lily Jane Collins (born 18 March 1989) is a British and American actress and model. Born in Guildford, Surrey and raised in Los Angeles, Collins began performing on screen at the age of two in the BBC sitcom Growing Pains. In the late 2000s, Collins began acting and modelling more regularly, and she had a career breakthrough with her performance in the sports-drama film The Blind Side, which was the third highest-grossing film of 2009. She went on to appear in leading roles across feature films such as the sci-fi action-horror Priest (2011), the psychological action-thriller Abduction (2011), the fantasy Mirror Mirror (2012), the urban fantasy The Mortal Instruments: City of Bones (2013), and the independent romantic comedies Stuck in Love (2012), The English Teacher (2013), and Love, Rosie (2014).\n\nCollins was critically acclaimed for her roles as Marla Mabrey in the comedy Rules Don\'t Apply (2016), which earned her a nomination for the Golden Globe Award for Best Actress – Motion Picture Musical or Comedy, and for her portrayal of a young adult with anorexia in the controversial Netflix drama To the Bone (2017). She has also achieved recognition for her work in biographical films: she starred as Liz Kendall in the Netflix drama Extremely Wicked, Shockingly Evil and Vile (2019), as J.R.R. Tolkien\'s wife Edith in Tolkien (2019), and as Rita Alexander in Mank (2020), the latter of which was a critical success, earning 10 Academy Award nominations.\n\nCollins played Fantine in the BBC miniseries adaptation of Les Misérables (2018–2019), and, since 2020, she has portrayed Emily Cooper in the Netflix series Emily in Paris. For the latter, she received a nomination for the Golden Globe Award for Best Actress – Television Series Musical or Comedy. She made her writing debut with Unfiltered: No Shame, No Regrets, Just Me (2017) in which she discussed her struggles with mental health, including an eating disorder she suffered as a teenager.', '1989-03-18', NULL, 'Guildford, Surrey, England, UK', '2025-05-09 10:19:46', '2025-05-09 10:19:46'),
(283, 12077, 'Jim Cummings', '/c0sQPRCM5Ri3F4gVyxPr4AcPmIq.jpg', 'Jim Cummings (born November 3, 1952) is an American voice actor. Since beginning his career in the 1980s, he has appeared in almost 400 roles. Cummings has frequently worked with The Walt Disney Company and Warner Bros., including as the official voice of Winnie the Pooh since 1988, Tigger since 1989, the Tasmanian Devil since 1991, and Pete since 1992. Other notable roles include Fat Cat and Monterey Jack on Chip \'n Dale: Rescue Rangers (1989–1990), the title character of Darkwing Duck (1991–1992), Dr. Robotnik on the Sonic the Hedgehog animated series (1993–1994), Kaa on Jungle Cubs (1996–1998), and Cat on CatDog (1998–2005).', '1952-11-03', NULL, 'Youngstown, Ohio, USA', '2025-05-09 10:19:46', '2025-05-09 10:19:46'),
(284, 73016, 'Debi Derryberry', '/aCVgHnvGBw7ssZA9kl1Pnr5pJjU.jpg', 'Deborah Lynn Derryberry (born September 27, 1967), known professionally as Debi Derryberry, is an American voice actress for a number of animated television series, anime, and video games. She is the voice of Jimmy Neutron in the Jimmy Neutron: Boy Genius film and television series. She has also voiced Wednesday in The Addams Family cartoon and Jackie in Bobby\'s World. In English language dubs of anime, she provided the voice of Ryo-Ohki in the Tenchi Muyo series. She received a Best Actress in a Comedy award at the American Anime Awards for her work as Zatch in Zatch Bell.\n\nDescription above from the Wikipedia article Debi Derryberry, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1967-09-27', NULL, 'Indio, California, USA', '2025-05-09 10:19:47', '2025-05-09 10:19:47'),
(285, 61983, 'Jason Marsden', '/68kkcU88K9vS6Rrw2ysfe2zFwZ0.jpg', 'Jason Marsden (born January 3, 1975) is an American screen and voice actor.', '1975-01-03', NULL, 'Providence, Rhode Island, USA', '2025-05-09 10:19:47', '2025-05-09 10:19:47'),
(286, 66193, 'Chris Sanders', '/6CtrIOCxggJ5eIAWeFQqd4Hs9FP.jpg', 'Christopher Michael \"Chris\" Sanders (born March 15, 1960) is an American film animator and voice actor best-known for co-directing and co-writing the Disney animated feature Lilo & Stitch, and providing the voice of Experiment 626 from Lilo & Stitch and Leroy from Disney\'s Leroy & Stitch. After being later dismissed from Walt Disney Animation Studios, Sanders went on to work for DreamWorks Animation, directing the highly acclaimed animated feature film, How to Train Your Dragon. He is currently serving as co-director on the upcoming feature, The Croods.\n\nDescription above from the Wikipedia article Chris Sanders, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1962-03-12', NULL, 'Colorado Springs, Colorado, USA', '2025-05-09 10:19:47', '2025-05-09 10:19:47'),
(287, 1303010, 'Aria Noelle Curzon', '/5fY6ojvZ3jmFyJrHGLFYxbgEFzS.jpg', '', '1987-12-08', NULL, 'Hollywood, California, USA', '2025-05-09 10:19:48', '2025-05-09 10:19:48'),
(288, 52699, 'Danny Mann', '/980QYqXIZCMn5Knx0vjROkw9vKo.jpg', 'From Wikipedia, the free encyclopedia.  Daniel \"Danny\" Mann is an American voice actor, writer, singer, musician, and production manager. He is best known for his voice of Hector from Heathcliff and the Catillac Cats, Freeway, Cloudraker and Lightspeed in Transformers, Backwoods Beagle in DuckTales, Kaltag in Balto, Ferdinand from Babe, and Serge in Open Season, Open Season 2, and as Serge and Kevin the porcupine Open Season 3.\n\nDescription above from the Wikipedia article Danny Mann, licensed under CC-BY-SA,full list of contributors on Wikipedia.', '1951-07-28', NULL, 'Mobile, Alabama, USA', '2025-05-09 10:19:48', '2025-05-09 10:19:48'),
(289, 15831, 'Frank Welker', '/xXODQ5AX6pG4my8ieeEIuiAREXs.jpg', 'Franklin Wendell Welker (born March 12, 1946) is an American voice actor with an extensive career spanning nearly six decades. As of 2021, Welker holds over 860 film, television, and video game credits, making him one of the most prolific voice actors of all time. With a total worldwide box-office gross of $17.4 billion, he is also the third highest-grossing film voice actor of all time.\n\nWelker is best known for voicing Fred Jones in the Scooby-Doo franchise since its inception in 1969, and Scooby-Doo himself since 2002. In 2020, Welker reprised the latter role in the CGI-animated film Scoob!, the only original voice actor from the series in the movie\'s cast. He has also voiced Oswald the Lucky Rabbit in Epic Mickey and its sequel, Megatron, Galvatron and Soundwave in the Transformers franchise, Shao Kahn and Reptile in the 1995 Mortal Kombat film, Curious George in the Curious George franchise, Garfield on The Garfield Show, Nibbler on Futurama, the titular character in Jabberjaw, Speed Buggy in the Scooby-Doo franchise, Astro and Orbitty on The Jetsons, Mushmouse on Punkin\' Puss & Mushmouse, and various characters in The Smurfs as well as numerous animal vocal effects in many works. In 2016, he was honored with an Emmy Award for his lifetime achievement.\n\nDescription above from the Wikipedia article Frank Welker, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1946-03-12', NULL, 'Denver, Colorado, USA', '2025-05-09 10:19:48', '2025-05-09 10:19:48'),
(290, 3162371, 'Scott Record', '/nQQ78s3Xx5mBqdX3LJK1QE7eu3S.jpg', '', '1952-05-06', NULL, 'Middleborough, Massachusetts, USA', '2025-05-09 10:19:49', '2025-05-09 10:19:49'),
(291, 24525, 'Joseph Ashton', '/soZIm3JZw3qflaXQ2yDOdj8rDTo.jpg', 'From Wikipedia, the free encyclopedia.\n\nJoseph Ashton (born November 18, 1986) is an American film and voice actor.\n\nDescription above from the Wikipedia article Joseph Ashton(actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.​', '1986-11-18', NULL, 'Cherokee, California, U.S.', '2025-05-09 10:19:49', '2025-05-09 10:19:49'),
(292, 1932648, 'Billy Bodine', NULL, '', NULL, NULL, NULL, '2025-05-09 10:19:50', '2025-05-09 10:19:50'),
(293, 2558691, 'Hillary Brooks', NULL, '', NULL, NULL, NULL, '2025-05-09 10:19:50', '2025-05-09 10:19:50'),
(294, 3193, 'Scott Martin Gershin', '/3UbacYnss8yrqtA2oqpAhTurbLQ.jpg', 'Scott Gershin is an award-winning sound designer who has been active in the film and gaming communities for over two decades. With films such as Pacific Rim, Hellboy 2, Chronicles of Riddick, Team America: World Police, Shrek, Star Trek, and American Beauty, as well as major games including the Gears of War series, Epic Mickey, and the Resident Evil and Fable series, he has garnered an impressive number of awards and nominations. Gershin has studied music since he was 10 years old and could easily be identified as that kid you grew up with who made sound effects and creature noises with his mouth—little did he know it would lead him into a career doing just that. His talent for creating personalities with his voice has been tapped for such memorable movie characters as Flubber, Disney’s Herbie, Reapers in Blade II, the dragon in Shrek, Kirchek in Tarzan, and numerous characters and creatures in Pacific Rim, Hellboy II, Book of Life, and Plants vs. Zombies Heroes, to name a few. After attending Berklee College of Music, Gershin made a name for himself as one of the pioneers of audio technology in film and games. Using what he learned as a synth programmer and recording engineer in the music industry, he was one of the first to utilize computers to edit and design sound against picture. He has embraced technology to better help him tell stories through audio and take audiences on an immersive journey. He feels that he is a bit of a “audio photographer,” capturing the sounds of the world and of life, manipulating those sounds in new and exciting ways, and using those sounds to bring directors\' visions to life. In his previous job at Soundelux, where he spent 27 years, he worked as a sound supervisor, sound designer, and founding executive creative director of Soundelux Design Music Group. He also created departments and was creative director at Formosa Interactive and the Soundlab at Technicolor.', '1960-11-07', NULL, NULL, '2025-05-09 10:19:50', '2025-05-09 10:19:50'),
(295, 19545, 'Jack Angel', '/5MsVwIULYJotUSbDs61uSJff7ei.jpg', 'Jack Angel (October 24, 1930 – October 18, 2021) was an American voice actor and radio personality. He provided voice-overs for animation and video games. Angel had voiced characters in shows by Hasbro and Hanna-Barbera such as Super Friends, The Transformers and G.I. Joe and was involved in numerous productions by Disney and Pixar. Before becoming involved with voiceover work, Angel was initially a disc jockey for radio stations, namely KMPC and KFI.', '1930-10-24', '2021-10-18', 'Modesto, California, USA', '2025-05-09 10:19:51', '2025-05-09 10:19:51'),
(296, 84493, 'Mickie McGowan', '/4K1HF10EvDjdaIoDAnWqFZjnmvk.jpg', 'Mickie (Maryanne) McGowan is the daughter of Robert A. McGowan, writer/director of the \"Our Gang Comedies.\" She was born in Culver City, Calif. and now resides in Palm Springs, Calif. She continues to work as an animation voice actor, mainly for Disney and Pixar.', '1938-01-02', '2022-03-11', 'Culver City, California, USA', '2025-05-09 10:19:51', '2025-05-09 10:19:51'),
(297, 61969, 'Phil Proctor', '/wAfx3qAEvcsLpEEIP0zwdhuDIcW.jpg', 'Philip Proctor (born July 28, 1940) is an American actor, voice actor and a member of the Firesign Theatre. He has performed voice-over work for video games, films and television series.\n\nOf the four members of Firesign Theatre, Proctor has had the greatest amount of mainstream exposure as an actor. A boy soprano, he worked extensively in musical theatre, including numerous juvenile female roles in productions of Gilbert & Sullivan operettas. In his early adult career, he worked in musical theatre on Broadway, the West Coast and in touring productions. During this period Proctor worked with many famous names, including composer Richard Rodgers, and forged important social connections, becoming close friends with notable figures including Henry Jaglom, Brandon de Wilde, Peter Fonda and Karen Black.\n\nProctor also appeared occasionally on television in small roles, including episodes of Daniel Boone, All in the Family, and Night Court, and Off-Broadway in the 1964 musical The Amorous Flea. He also provided the voices of Meltdown in Treasure Planet and \"Drunk Monkey\" in the Dr. Dolittle remake series. He has also provided uncredited ADR overdubs for numerous movies over the years. More recently, he has done voices for several cartoons and video games, including the voice of Howard Deville in Rugrats and All Grown Up! on Nickelodeon, \"background\" voices for Disney features, and voice work on Power Rangers Time Force. He also did two voices in the GameCube video game Eternal Darkness: Sanity\'s Requiem. He is the voice of The Professor and White Monkey in the Ape Escape series. Recently, his voice was featured in the video game Dead Rising as Russell Barnaby, in the Assassin\'s Creed series as Dr. Warren Vidic, and on Adventures in Odyssey as Leonard Meltsner and Detective Don Polehaus. In the 2007 live audio production of the Angie Award-winning screenplay Albatross (original screenplay written by Lance Rucker and Timothy Perrin) at the International Mystery Writers Festival, he played seven characters requiring four different accents: KGB agent Stefan Linnik, East German Communist Party apparatchik Kurt Mueller; a West Berlin gasthaus owner; an armed forces radio announcer; the Senate minority whip; a Secret Service guard; and Gerhard Derstman, the East German Cultural Attache/Stasi member. He also lent his voice to the game Battlezone. He was the announcer on Big Brother in seasons 3 through 6. Proctor also lent his voice in the Marvel: Ultimate Alliance series as the voices of Edwin Jarvis and Baron Mordo in the first game, and the Tinkerer in the sequel, Marvel: Ultimate Alliance 2. He currently serves among the repertory cast of featured voices in recent and current Disney animated films.\n\nStage versions of the records Don\'t Crush That Dwarf, Hand Me the Pliers; The Further Adventures of Nick Danger, Third Eye; and Waiting for the Electrician, or Someone Like Him and Temporarily Humboldt County are published Broadway Play Publishing Inc.\n\nIn 2017, Proctor published an autobiography entitled Where\'s My Fortune Cookie? coauthored with Brad Schreiber.\n\nIn recent years Proctor has performed on the radio program American Parlor Songbook in sketches called \"Boomers On a Bench\".\n\nSource: Article \"Philip Proctor\" from Wikipedia in English, licensed under CC-BY-SA 3.0.', '1940-07-28', NULL, 'Goshen, Indiana, USA', '2025-05-09 10:19:51', '2025-05-09 10:19:51'),
(298, 61425, 'Joe Whyte', '/b1jrcXsqiY5G4C9ieg1B7PrrnEl.jpg', '', '1961-04-18', NULL, 'Northridge, California, USA', '2025-05-09 10:19:52', '2025-05-09 10:19:52'),
