(300, 78315, 'Kat Cressida', '/np4jO1Qdv5Ch6DuFeWy8ZYolQQl.jpg', '', '1968-03-01', NULL, 'Long Beach, California, U.S.', '2025-05-09 10:19:53', '2025-05-09 10:19:53'),
(301, 81843, 'Jennifer Darling', '/g0sBNqwHOjCHo9KjPzGdYaCqh0h.jpg', 'Jennifer Darling (born Joan Darling; June 19, 1946, in Pittsburgh, Pennsylvania) is an American voice, film and television actress. Her best-known role on screen was as Peggy Callahan in The Six Million Dollar Man and its spin-off The Bionic Woman. In anime, she is the voice of Ayeka in the English dub of Tenchi Muyo for most of the English adaptions.', '1946-06-19', NULL, 'Oklahoma City, Oklahoma, USA', '2025-05-09 10:19:53', '2025-05-09 10:19:53'),
(302, 91024, 'Patti Deutsch', '/bRnTkHh29xiWrhiTBIZxAQGyvgj.jpg', 'Patricia Deutsch Ross (born Elaine Patricia Deutsch; December 16, 1943 – July 26, 2017) was an American actress and comedian who was well known as a recurring panelist on the 1970s game shows Match Game and Tattletales.', '1943-12-16', '2017-07-26', 'Pittsburgh, Pennsylvania, USA', '2025-05-09 10:19:53', '2025-05-09 10:19:53'),
(303, 86006, 'Paul Eiding', '/3Gxs9fTnkQLFlmMHROlgiDJ4p10.jpg', '​From Wikipedia, the free encyclopedia.  \n\nPaul Eiding (born March 28, 1957; Cleveland, Ohio) is an American voice actor, voice instructor, and actor, perhaps best known as the voice actor behind Perceptor in the original Transformers cartoon, Roy Campbell in the Metal Gear series, the narrator in Diablo, Judicator Aldaris in StarCraft, and Max Tennyson in Ben 10, Ben 10: Alien Force, and Ben 10: Ultimate Alien.\n\nDescription above from the Wikipedia article Paul Eiding, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1957-03-28', NULL, 'Cleveland, Ohio, USA', '2025-05-09 10:19:54', '2025-05-09 10:19:54'),
(304, 67385, 'Blake McIver Ewing', '/8TFz5gIYNNttwVQZgllHbygYKv6.jpg', 'Blake McIver Ewing, also known as Blake McIver and Blake Ewing, is an American singer-songwriter, actor, model and pianist. He was known for playing Michelle\'s friend, Derek, on the sitcom Full House, a role he reenacted on Fuller House.', '1985-03-27', NULL, 'Los Angeles, California, USA', '2025-05-09 10:19:54', '2025-05-09 10:19:54'),
