(339, 158124, 'Shane Sweet', '/3fVAoIbfMO2XKtMsIOVpo5fkXVq.jpg', 'Shane Sweet (born January 6, 1986) is an American actor, known for his role as Josh Stevenson on the Nickelodeon series The Journey of Allen Strange. He is also one of the voice actors for Tim Drake / Robin in the DC Animated Universe as well as a few appearances as Seven Wanker on the Fox sitcom Married... with Children and Figure It Out as a panelist.', '1986-01-06', NULL, ' Burbank, California, USA', '2025-05-09 10:20:06', '2025-05-09 10:20:06'),
