(345, 1243387, 'Michael Perl', '/tS7JydCfJG8w4gQ1YZCDaeCFiFg.jpg', 'Michael, a native Angeleno, got his first role as Danny Zuko in his 5th grade production of \"Grease.\" He played Winston in the TV series based on the popular Francine Pascal novels, \"Sweet Valley High.\" When the show ended, he pursued a BFA in Theatre from UCLA\'s school of Theatre, Film and Television. Since graduating, Michael has been working consistently in film, television and Los Angeles theatre.\n\nMichael started a production company, Burton Street Productions, with his wife Melissa Lugo. They have produced award-winning short films and web series under that banner.', NULL, NULL, 'Los Angeles, California, USA', '2025-05-09 10:20:08', '2025-05-09 10:20:08'),
