(348, 84213, 'Bill Farmer', '/lhezx68R12s5Bsv7d77BrQb7tWA.jpg', 'From Wikipedia, the free encyclopedia.\n\nWilliam Farmer (born November 14, 1952 in Pratt, Kansas) is an American voice actor and comedian, best known for being the current voice of the Disney characters Goofy, Pluto and Horace Horsecollar.\n\nDescription above from the Wikipedia article William Farmer, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1952-11-14', NULL, 'Pratt, Kansas, USA', '2025-05-09 10:20:09', '2025-05-09 10:20:09'),
(349, 34737, 'Pat Fraley', '/snkbfNQ9JNUCEzG7SdRIR083P0u.jpg', 'Patrick Howard Fraley (born February 18, 1949) is an American voice actor and voice-over teacher, known as the voice of Krang, Casey Jones, Baxter Stockman and numerous other characters in the 1987 Teenage Mutant Ninja Turtles animated television series and voiced Falcon in the 2003 Stuart Little animated television series. Fraley is also a member of Voice and Speech Trainers of America.', '1949-02-18', NULL, 'Seattle, Washington, USA', '2025-05-09 10:20:10', '2025-05-09 10:20:10'),
(350, 36821, 'Nicholas Guest', '/dSA11Xw5JX7uJ3SSFWc1eimtoY4.jpg', 'From Wikipedia, the free encyclopedia.\n\nNicholas Haden-Guest (born May 5, 1951) is an American actor. He primarily works as a voice actor, but is best known for a TV role, as the principal in the NBC teen sitcom, USA High.\n\nDescription above from the Wikipedia article Nicholas Guest, licensed under CC-BY-SA, full list of contributors on Wikipedia.​', '1951-05-05', NULL, 'New York City, New York, USA', '2025-05-09 10:20:10', '2025-05-09 10:20:10'),
(351, 2021237, 'Darren T. Knaus', NULL, '', NULL, NULL, NULL, '2025-05-09 10:20:11', '2025-05-09 10:20:11'),
(352, 3332960, 'John Taylor', NULL, '', NULL, NULL, NULL, '2025-05-09 10:20:11', '2025-05-09 10:20:11'),
(353, 53650, 'Anthony Mackie', '/eZSIDrtTzhvabyjrmIITQLsjx8h.jpg', 'Anthony Dwane Mackie (born September 23, 1978) is an American actor. He gained wide recognition for portraying Sam Wilson / Falcon / Captain America in the Marvel Cinematic Universe, beginning with the film Captain America: The Winter Soldier (2014), and headlining the Disney+ miniseries The Falcon and the Winter Soldier (2021) and its continuation film Captain America: Brave New World (2025).\n\nMackie made his film debut in 8 Mile (2002), and earned critical recognition for his roles in Brother to Brother (2004), which garnered him an Independent Spirit Award nomination for Best Actor, and The Hurt Locker (2008), which earned him a nomination for Best Supporting Actor at the AAFCA Awards. He also played Tupac Shakur in Notorious (2009) and Martin Luther King Jr. in the HBO film All the Way (2016).\n\nOn television, Mackie starred as Takeshi Kovacs in the second season of Netflix\'s Altered Carbon (2020) and currently leads the Peacock series Twisted Metal (2023–present). In theatre, he has performed in Broadway and Off-Broadway adaptations, including Ma Rainey\'s Black Bottom, A Soldier\'s Play, and Carl Hancock Rux\'s Talk, for which he won an Obie Award in 2002.\n\nDescription above from the Wikipedia article Anthony Mackie, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1978-09-23', NULL, 'New Orleans, Louisiana, USA', '2025-05-09 10:20:12', '2025-05-09 10:20:12'),
(354, 3, 'Harrison Ford', '/zVnHagUvXkR2StdOtquEwsiwSVt.jpg', 'Legendary Hollywood Icon Harrison Ford was born on July 13, 1942 in Chicago, Illinois. His family history includes a strong lineage of actors, radio personalities, and models. Ford attended public high school in Park Ridge, Illinois where he was a member of the school Radio Station WMTH. Ford worked as the lead voice for sports reporting at WMTH for several years. Acting wasn\'t a major interest to Ford until his junior year at Ripon College when he first took an acting class. Ford\'s career started in 1964 when he travelled to California in search of a voice-over job. He never received that position, but instead signed a contract with Columbia Pictures where he earned $150 weekly to play small fill in roles in various films.\n\nThrough the \'60s Ford worked on several TV shows including Gunsmoke, Ironside, Kung Fu, and American Style. It wasn\'t until 1967 that he received his first credited role in the Western film, A Time for Killing. Dissatisfied with the meager roles he was being offered, Ford took a hiatus from acting to work as a self-employed carpenter. This seemingly odd diversion turned out to be a blessing in disguise for Harrison\'s acting career when he was soon hired by famous film producer George Lucas. This was a turning point in Ford\'s life that led to him be casted in milestone roles such as Han Solo and Indiana Jones.\n\nSince his most famous roles in the original Star Wars trilogy and Raiders of the Lost Ark, Ford has appeared in over 40 films. Many criticize his late-career work, saying his performances have been lackluster, leading to commercially disappointing films. Ford has always worked hard to protect his off-screen private life, keeping details about his children and marriages quiet. He has a total of five children including one recent adoption with third and current wife Calista Flockhart. In addition to acting, Ford is passionate about environmental conservation, aviation, and archeology.', '1942-07-13', NULL, 'Chicago, Illinois, USA', '2025-05-09 10:20:13', '2025-05-09 10:20:13'),
(355, 1773397, 'Danny Ramirez', '/1CMMfxwMYOme8AOrl4kZS12nJpM.jpg', 'Danny Ramirez (born September 17, 1992) is an American actor. He is best known as Wes in The Gifted, Mario Martinez in On My Block, Joaquin Torres / Falcon in the Marvel Cinematic Universe, and Lt. Mickey \"Fanboy\" Garcia in Top Gun: Maverick (2022). Ramirez portrays Manny in The Last of Us (2025).\n\nDescription above from the Wikipedia article Danny Ramirez, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1992-09-17', NULL, 'Chicago, Illinois, USA', '2025-05-09 10:20:13', '2025-05-09 10:20:13'),
(356, 1394332, 'Shira Haas', '/yba227TTf6HxHrItC91HCs56OIr.jpg', 'Shira Haas (Hebrew: שירה האס; born 11 May 1995) is an Israeli actress.\n\nShe initially gained national prominence for her roles in local film and television, winning two Israeli Ophir Awards out of five nominations since 2014. In 2020, she gained international acclaim for her role in the Netflix miniseries Unorthodox. For this performance, she was nominated for a Golden Globe Award and a Primetime Emmy Award. In the same year, Haas won the Tribeca Film Festival Award for Best International Actress for her performance in the Israeli drama film Asia (2020). She has since starred in the Netflix science fiction series Bodies (2023).', '1995-05-11', NULL, 'Hod HaSharon, Israel', '2025-05-09 10:20:13', '2025-05-09 10:20:13');
INSERT INTO `actors` (`id`, `tmdb_id`, `name`, `profile_path`, `biography`, `birth_date`, `death_date`, `place_of_birth`, `created_at`, `updated_at`) VALUES
(357, 1462, 'Tim Blake Nelson', '/rWuTGiAMaaHIJ30eRkQS23LbRSW.jpg', 'Timothy Blake Nelson (born May 11, 1964) is an American actor and playwright. Described as a \"modern character actor, his roles include Delmar O\'Donnell in O Brother, Where Art Thou? (2000), Gideon in Minority Report (2002), Doctor Steve Pendanski in Holes (2003), Doctor Jonathan Jacobo in Scooby-Doo 2: Monsters Unleashed (2004), Danny Dalton Jr. in Syriana (2005), Samuel Sterns in the Marvel Cinematic Universe, Richard Schell in Lincoln (2012), the titular character of The Ballad of Buster Scruggs (2018), and Henry McCarty in Old Henry (2021). He portrayed Wade Tillman / Looking Glass in the HBO limited series Watchmen (2019), for which he received a Critics\' Choice Television Awards nomination for Best Supporting Actor in a Drama Series in 2020.\n\nNelson\'s directorial credits include Eye of God (1997), which was nominated for the Sundance Grand Jury Prize and an Independent Spirit Award; O (2001), a modern-day adaptation of Othello; and the Holocaust drama The Grey Zone (2001). Eye of God and The Grey Zone were both adapted from Nelson\'s own plays. Nelson has also co-directed music videos for Billy Woods and Kenny Segal, including \"Babylon by Bus\" and \"Soft Landing.\" He also co-directed the music video for Armand Hammer feat. Pink Siifu\'s \"Trauma Mic.\"\n\nNelson recently published his debut novel, City of Blows (2023), an epic group portrait of four men grappling for control of a script in a radically changing Hollywood.\n\nDescription above from the Wikipedia article Tim Blake Nelson, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1964-05-11', NULL, 'Tulsa, Oklahoma, USA', '2025-05-09 10:20:14', '2025-05-09 10:20:14'),
(358, 29382, 'Carl Lumbly', '/ew1URcenWNl1Uclsz9ADiRb0uBD.jpg', 'Carl Winston Lumbly (born August 14, 1951) is an American actor. He is known for his roles as television\'s first black superhero in M.A.N.T.I.S., Dick Hallorann in Doctor Sleep, NYPD detective Marcus Petrie on the CBS police drama Cagney & Lacey, CIA agent Marcus Dixon on the ABC espionage drama series Alias, and as the voice of J\'onn J\'onnz / Martian Manhunter in the animated series Justice League, Static Shock, and Justice League Unlimited, all part of the DC Animated Universe. As a reference to his voice work as J\'onn, Lumbly portrayed J\'onn J\'onnz\'s father, M\'yrnn, on The CW\'s Arrowverse on Supergirl from 2017 until 2019. He also plays Isaiah Bradley, the first Black super-soldier in the Marvel Cinematic Universe (MCU) installments The Falcon and the Winter Soldier (2021) and the forthcoming Captain America: Brave New World (2025).\n\nHe was married to Vonetta McGee from 1987 until her death in 2010.\n\nDescription above from the Wikipedia article Carl Lumbly, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1951-08-14', NULL, 'Minneapolis, Minnesota, USA', '2025-05-09 10:20:14', '2025-05-09 10:20:14'),
(359, 4808, 'Giancarlo Esposito', '/rcXnr82TwDzU4ZGdBeNXfG0ZQnZ.jpg', 'Giancarlo Giuseppe Alessandro Esposito (born April 26, 1958) is an American actor. He is known for portraying Gus Fring in the AMC crime drama series Breaking Bad from 2009 to 2011 and its prequel series Better Call Saul from 2017 to 2022. He won the Critics\' Choice Television Award for Best Supporting Actor in a Drama Series twice for this role. He earned three nominations for the Primetime Emmy Award for Outstanding Supporting Actor in a Drama Series.\n\nHis other television roles include federal agent Mike Giardello in the NBC series Homicide: Life on the Street (1998–1999), Sidney Glass / Magic Mirror in the ABC fantasy series Once Upon a Time (2011–2017), Tom Neville in the NBC series Revolution (2012–2014), Dr. Edward Ruskins in the Netflix series Dear White People (2017–2021), Stan Edgar in the Amazon series The Boys (2019–present) and The Boys Presents: Diabolical (2022), and Moff Gideon in the Disney+ series The Mandalorian (2019–2023), the lattermost of which earned him two Primetime Emmy Award nominations. He also portrayed Adam Clayton Powell Jr. in the MGM+ series Godfather of Harlem (2019–present), acted in the HBO drama series Westworld (2016), and starred in the Netflix television series Kaleidoscope (2023), The Gentlemen (2024), and The Residence (2025).\n\nHe is also known for his collaboration with Spike Lee, acting in several of his films, such as School Daze (1988), Do the Right Thing (1989), Mo\' Better Blues (1990), and Malcolm X (1992). His other major films include Taps (1981), King of New York (1990), Bob Roberts (1992), Fresh (1994), The Usual Suspects (1995), Ali (2001), Monkeybone (2001), Last Holiday (2006), Rabbit Hole (2010), Okja (2017), Megalopolis (2024), MaXXXine (2024), and Captain America: Brave New World (2025). He voiced Akela in the live-action remake of The Jungle Book (2016).\n\nDescription above from the Wikipedia article Giancarlo Esposito, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1958-04-26', NULL, 'Copenhagen, Denmark', '2025-05-09 10:20:14', '2025-05-09 10:20:14'),
(360, 882, 'Liv Tyler', '/aYlqS4wYuNCiN9wmvDwKRAE9BQ9.jpg', 'Liv Rundgren Tyler (born Liv Rundgren; July 1, 1977) is an American actress. She began a modelling career at age 14 before making her film debut in Silent Fall (1994); she went on to achieve critical recognition with starring roles in Heavy and Empire Records (both 1995), as well as That Thing You Do! and Stealing Beauty (both 1996). She then appeared in films such as Inventing the Abbotts (1997), Armageddon (1998), Cookie\'s Fortune and Onegin (both 1999), Dr. T & the Women (2000), and One Night at McCool\'s (2001). She then played the elf Arwen Undómiel in the Lord of the Rings film trilogy (2001–2003), which became one of the highest-grossing film series in history.\n\nFollowing the success of Lord of the Rings, Tyler has appeared in a variety of roles, including the films Jersey Girl (2004), Lonesome Jim (2005), Reign Over Me (2007), The Strangers, The Incredible Hulk (both 2008), Robot & Frank (2012), Space Station 76 (2014), Wildling (2018), and Ad Astra (2019). Outside of film, she starred in the HBO supernatural drama series The Leftovers (2014–2017), the BBC period drama series Gunpowder (2017), the ITV/Hulu period drama series Harlots (2018–2019), and the Foxprocedural drama series 9-1-1: Lone Star (2020).\n\nTyler is also a singer. Having sung with composer Howard Shore, she appeared as a guest vocalist on The Lemonheads\' album Varshons (2009), singing a cover of the Leonard Cohen song \"Hey, That\'s No Way to Say Goodbye.\" She appeared on the 2017 bonus disc of Evan Dando\'s album Baby I\'m Bored (2003), providing featured vocals for the song \"Shots Is Fired.\" In 2011, she released her debut single, \"Need You Tonight.\".\n\nTyler has served as a UNICEF Goodwill Ambassador for the United States since 2003 and as a spokesperson for Givenchy\'s line of perfume and cosmetics. She is the daughter of Steven Tyler and Bebe Buell, although she has a very close relationship with her adoptive father, Todd Rundgren.\n\nDescription above from the Wikipedia article Liv Tyler, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1977-07-01', NULL, 'New York City, New York, USA', '2025-05-09 10:20:15', '2025-05-09 10:20:15'),
(361, 109565, 'Xosha Roquemore', '/k596seeX26xKN8bZ3Uir9zFJ2gS.jpg', 'Xosha Kai Roquemore (/ˈzoʊʃə ˈroʊkmɔːr/ ZOH-shə ROHK-mor; born December 11, 1984) is an American actress. She is best known for her roles as Jo Ann in Precious and Tamra in The Mindy Project.\n\nRoquemore was born in 1984 in Los Angeles and is named after the Xhosa people of South Africa. She started acting when she joined The Amazing Grace Conservatory in ninth grade. After graduating from high school, she moved to New York City and graduated from the Tisch program at New York University.\n\nRoquemore starred in her first major film as Jo Ann in Precious. In 2013, she was cast in a recurring role on Kirstie, based on her work in the series pilot. Her role, however, was recast after she was added as a series regular to The Mindy Project after a three-episode guest star stint.\n\nRoquemore was in a relationship with actor LaKeith Stanfield in August 2015. In March 2017, the couple announced Roquemore\'s pregnancy. Roquemore and Stanfield broke up after the birth of their daughter.\n\nDescription above from the Wikipedia article Xosha Roquemore, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1984-12-11', NULL, 'Los Angeles, California, USA', '2025-05-09 10:20:15', '2025-05-09 10:20:15'),
(362, 238164, 'Jóhannes Haukur Jóhannesson', '/oqZftP0WS1rD5NFpR7vLp6JU52I.jpg', 'Jóhannes Haukur Jóhannesson (born 26 February 1980) is an Icelandic actor known for his roles in the TV series Game of Thrones (2016), Vikings: Valhalla (2022), and Succession (2023), and in the films Atomic Blonde (2017) and Alpha (2018).\n\nDescription above from the Wikipedia article Jóhannes Haukur Jóhannesson, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1980-02-26', NULL, 'Hafnarfjörður, Island', '2025-05-09 10:20:15', '2025-05-09 10:20:15'),
(363, 1498700, 'William Mark McCullough', '/jFuNpt0h8mf36dhIfSIip4GTe8T.jpg', '', NULL, NULL, NULL, '2025-05-09 10:20:16', '2025-05-09 10:20:16'),
(364, 1082509, 'Takehiro Hira', '/2N1viBfPY4cRlz6W6YfM2F6UbSH.jpg', 'Takehiro Hira (平 岳大, Hira Takehiro, born July 27, 1974) is a Japanese theatre, film, and television actor.\n\nHira was born in Setagaya, Tokyo, Japan, to actors Mikijirō Hira and Yoshiko Sakuma. He was raised in Japan until he was 15 years old. He went to high school at Moses Brown School in Providence, Rhode Island, United States, and then attended Brown University.\n\nHe made his theatrical debut in 2002 with Rokumeikan, which was written by Yukio Mishima. He worked closely with his father, Mikijirō Hira, who was also a Japanese actor. Takehiro played the role of Iago in the production of Othello with his father playing Othello. He received major recognition when he played the last shogun, Yoshinobu Tokugawa, in the NHK taiga drama Atsuhime. He has appeared in several films of Takashi Miike, including Hara-Kiri: Death of a Samurai, Ace Attorney, and Aku no Kyoten. He plays Natsuka Masaie in the big-budget film Nobou\'s Castle.\n\nHe played the role of the Player Queen in the English stage production of Hamlet in 2005, in which the title role was played by Michael Maloney. This three-month tour was received well at many places in the UK.\n\nHira played the lead role in the 2019 British TV series Giri/Haji. He has also had notable parts in the American films Lost Girls & Love Hotels (2020) and Snake Eyes (2021) and a minor role in Gran Turismo. In 2024, Hira starred in FX\'s adaptation of Shōgun.\n\nDescription above from the Wikipedia article Takehiro Hira, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1974-07-27', NULL, 'Setagaya, Tokyo, Japan', '2025-05-09 10:20:16', '2025-05-09 10:20:16'),
