(398, 3229900, 'Jarrett Michael Collins', '/4gFTvBn6tpgOyvoozeLfMsRMXkH.jpg', 'Jarrett Michael Collins, born in Dayton, Ohio, was drawn to the arts early on, winning accolades as a young writer before exploring music and performance. Relocating to Detroit and later Atlanta, he pursued his musical passions while nurturing relationships. A friend\'s suggestion led him to professional acting training, unlocking new artistic dimensions and a deeper purpose.\n\nHis dedication yielded roles in TV, music videos, and films, earning awards as a leading man. Co-creating \"The BookingRoom ATL\" acting class became his platform to support Atlanta\'s acting community. Jarrett\'s coaching endeavors echo his commitment to giving back. With aspirations in writing and directing, he remains driven and grounded in both his craft and community.', NULL, NULL, 'Dayton, Ohio, USA', '2025-05-09 10:20:28', '2025-05-09 10:20:28'),
