(429, 63, 'Milla Jovovich', '/usWnHCzbADijULREZYSJ0qfM00y.jpg', 'Milla Jovovich (born December 17, 1975) is an Ukrainian-born American actress, supermodel, musician, and fashion designer. Over her career, she has appeared in a number of science fiction and action themed films, for which music channel VH1 has referred to her as the \"reigning queen of kick-butt\".\n\nShe has appeared on the cover of more than a hundred magazines, and has also starred in films such as The Fifth Element (1997), Ultraviolet (2006), and the \'Resident Evil\' franchise. Jovovich began modeling at eleven, when Richard Avedon featured her in Revlon\'s \"Most Unforgettable Women in the World\" advertisements, and she continued her career with other campaigns for L\'Oréal cosmetics, Banana Republic, Christian Dior, Donna Karan, and Versace.\n\nIn 1988, she had her first professional acting role in the television film The Night Train to Kathmandu, and later that year she appeared in her first feature film, Two Moon Junction. Following more small television appearances such as the \"Fair Exchange\" (1989) and a 1989 role as a French girl (she was 14 at the time then) on a Married with Children episode and film roles, she gained notoriety with the romance film Return to the Blue Lagoon (1991). She appeared in 1993\'s Dazed and Confused alongside Ben Affleck and Matthew McConaughey. Jovovich then acted alongside Bruce Willis in the science fiction film The Fifth Element (1997), and later played the title role in The Messenger: The Story of Joan of Arc (1999). In 2002, she starred in the video game adaptation Resident Evil, which spawned five sequels: Resident Evil: Apocalypse (2004), Resident Evil: Extinction (2007), Resident Evil: Afterlife (2010), Resident Evil: Retribution (2012) and Resident Evil: The Final Chapter (2016).\n\nIn addition to her modelling and acting career, Jovovich released a music album, The Divine Comedy in 1994. She continues to release demos for other songs on her official website and contributes to film soundtracks as well; Jovovich has yet to release another album. In 2003, she and model Carmen Hawk created the clothing line Jovovich-Hawk, which ceased operations in early 2008. In its third season prior to its demise, the pieces could be found at Fred Segal in Los Angeles, Harvey Nichols, and over 50 stores around the world.', '1975-12-17', NULL, 'Kiev, Ukraine', '2025-05-09 10:20:42', '2025-05-09 10:20:42'),
(430, 543530, 'Dave Bautista', '/snk6JiXOOoRjPtHU5VMoy6qbd32.jpg', 'David Michael Bautista Jr. (born January 18, 1969) is an American actor and retired professional wrestler. Regarded as one of his generation\'s most prolific professional wrestlers, he rose to fame for his multiple stints in WWE between 2002 and 2019.\n\nBautista began his wrestling career in 1999 and signed with WWE (then WWF) in 2000. From 2002 to 2010, he gained fame under the ring name Batista, initially as a member of Evolution. He would go on to win the WWE Championship twice, the World Heavyweight Championship four times (with his first reign remaining the longest in history at 282 days), the World Tag Team Championship three times (twice with Ric Flair and once with John Cena), and the WWE Tag Team Championship once (with Rey Mysterio). He also won the 2005 and 2014 Royal Rumble matches and subsequently headlined WrestleMania 21 and WrestleMania XXX, with the former being one of the top five highest-grossing PPV events in wrestling history. Having largely stepped back from professional wrestling in 2020, he retired after WrestleMania 35 in 2019.\n\nAs an actor, Bautista is known for portraying Drax in the Marvel Cinematic Universe (2014–2023) and Rabban in Dune (2021) and its 2024 sequel. Bautista has additionally starred in Spectre (2015), Blade Runner 2049 (2017), Final Score, Master Z: Ip Man Legacy (both 2018), Army of the Dead (2021), Glass Onion: A Knives Out Mystery (2022), Knock at the Cabin, and Parachute (both 2023).\n\nDescription above from the Wikipedia article Dave Bautista, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1969-01-18', NULL, 'Washington, D.C., USA', '2025-05-09 10:20:42', '2025-05-09 10:20:42'),
(431, 66147, 'Arly Jover', '/zmznPrQ9GSZwcOIUT0c3GyETwrP.jpg', 'Araceli Jover was born in Melilla, a Spanish region. After living there for five years, her family was forced to move to Mallorca, in the Balearic Islands (Spain) because of her father\'s work as a soldier. She is the youngest of seven siblings, four sisters and three brothers.\n\nDuring her early years, she wanted to become a dancer. She began dancing at the age of 8. At 14 she dropped out of school and at 15 she won a scholarship from the Comité Hispano Norteamericano. Because of this, she left Spain and moved to New York City in order to continue to study at the School of American Ballet under Martha Graham. After two years and half in the United States, her career then moved on to becoming an actress sometime around 1995–1996. She had her first role in an episode of the TV show Women: Stories of Passion and starred in two international films Tango, and The Ballad of Johnny-Jane. After that, she did more work in TV, before making her first American film debut in Blade, in 1998, as Mercury; the vampire lover of Deacon Frost.', '1971-02-02', NULL, 'Melilla, Spain', '2025-05-09 10:20:42', '2025-05-09 10:20:42'),
