(451, 2424459, 'Gagan Arora', '/mvrxw2ADqwLpSiIe4sx4gUihpBg.jpg', 'Gagan Arora was born on 16 September 1993 in New Delhi, India. With an undergraduate degree in commerce, Gagan moved to Mumbai to study filmmaking from XIC . After learning filmmaking Gagan started his bollywood journey as an assistant director on the feature film Stree(2018).', '1993-09-16', NULL, 'New Dehli, India', '2025-05-09 10:20:50', '2025-05-09 10:20:50'),
