(463, 974169, 'Jenna Ortega', '/7oUAtVgZU0uLdUSvDHKkINt1y7Y.jpg', 'Jenna Marie Ortega (born September 27, 2002) is an American actress. She began her career as a child and received recognition for her role as a younger version of Jane in The CW comedy-drama series Jane the Virgin (2014–2019). She then won an Imagen Award for her leading role as Harley Diaz in the Disney Channel series Stuck in the Middle (2016–2018). She played Ellie Alves in the thriller series You (2019) and starred in the family film Yes Day (2021), both for Netflix.\n\nIn the drama film The Fallout, Ortega received praise for her performance as a traumatised high school student (2021). She gained wide recognition for portraying Wednesday Addams in the Netflix horror-comedy series Wednesday (2022–present), for which she received nominations at the Golden Globe, Primetime Emmy, and Screen Actors Guild Awards. She also starred in the slasher films Scream (2022), X (2022), Scream VI (2023), and the fantasy film Beetlejuice Beetlejuice (2024).\n\nMedia publications have dubbed Ortega \"Gen Z\'s scream queen.\" She was featured on The Hollywood Reporter\'s Power 100 list in 2023 and Forbes\'s 30 Under 30 list in 2024. Ortega has also been noted for her fashion and for supporting various charitable causes.\n\nDescription above from the Wikipedia article Jenna Ortega, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '2002-09-27', NULL, 'Coachella Valley, Palm Desert, California, USA', '2025-05-09 10:20:54', '2025-05-09 10:20:54'),
(464, 22226, 'Paul Rudd', '/6jtwNOLKy0LdsRAKwZqgYMAfd5n.jpg', 'Paul Stephen Rudd (born April 6, 1969) is an American actor. Rudd studied theatre at the University of Kansas and the American Academy of Dramatic Arts before making his acting debut in 1991. He was included on the Forbes Celebrity 100 list in 2019 and was named People magazine\'s \"Sexiest Man Alive\" in 2021.\n\nRudd appeared in the films Clueless (1995), Halloween: The Curse of Michael Myers (1995), Romeo + Juliet (1996), Wet Hot American Summer (2001), Anchorman: The Legend of Ron Burgundy (2004), The 40-Year-Old Virgin (2005), Knocked Up (2007), I Love You, Man (2009), and This Is 40 (2012). He has played the superhero Scott Lang / Ant-Man in the Marvel Cinematic Universe (MCU), from Ant-Man (2015) to Ant-Man and the Wasp: Quantumania (2023), and Gary Grooberson in the Ghostbusters films Afterlife (2021) and Frozen Empire (2024).\n\nRudd has also appeared on numerous television shows, including the sitcom Friends (2002–2004) as Mike Hannigan, and has been featured as a guest host of Saturday Night Live multiple times. He had a dual role in the comedy series Living with Yourself (2019), which earned him a Golden Globe Award nomination. He starred in the miniseries The Shrink Next Door (2021). He was featured in the Hulu comedy series Only Murders in the Building (2023–2024), earning him a Primetime Emmy Award nomination.\n\nDescription above from the Wikipedia article Paul Rudd, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1969-04-06', NULL, 'Passaic, New Jersey, USA', '2025-05-09 10:20:55', '2025-05-09 10:20:55'),
(465, 20766, 'Richard E. Grant', '/6UXv8E4WWvRCKMQx1FQ0FJVyu0a.jpg', 'Richard E. Grant (born Richard Grant Esterhuysen; May 5, 1957) is a Swaziland-born English actor and presenter. He made his film debut as Withnail in the comedy Withnail and I (1987). Grant received critical acclaim for his role as Jack Hock in Marielle Heller\'s drama film Can You Ever Forgive Me? (2018), winning various awards including the Independent Spirit Award for Best Supporting Male. He also received Academy Award, BAFTA, Golden Globe, and Screen Actors Guild Award nominations for Best Supporting Actor.\n\nGrant is also known for his roles in the feature films Warlock (1989), Henry & June (1990), Hudson Hawk (1991), Bram Stoker\'s Dracula (1992), The Age of Innocence (1993), The Portrait of a Lady (1996), The Little Vampire (2000), Gosford Park (2001), Penelope (2006), The Iron Lady (2011), Jackie (2016), Star Wars: The Rise of Skywalker (2019), and Saltburn (2023). He is also known for his roles in television, including Frasier (2004), Dig (2015), Game of Thrones (2016), Hang Ups (2018), A Series of Unfortunate Events (2019), and Suspect (2022).\n\nDescription above from the Wikipedia article Richard E. Grant, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1957-05-05', NULL, 'Mbabane, Swaziland [now Eswatini]', '2025-05-09 10:20:55', '2025-05-09 10:20:55'),
(466, 4939, 'Téa Leoni', '/vWijsKTlNs9bgKdUVgsr2w4msGo.jpg', 'Elizabeth Téa Pantaleoni (born February 25, 1966), better known by her stage name Téa Leoni, is an American actress. She has starred in a wide range of films including Jurassic Park III, The Family Man, Deep Impact, Fun with Dick and Jane, Spanglish, Bad Boys and Ghost Town.\n\nDescription above from the Wikipedia article Téa Leoni, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1966-02-25', NULL, 'New York City, New York, USA', '2025-05-09 10:20:56', '2025-05-09 10:20:56'),
(467, 1375002, 'Sunita Mani', '/xQo4rkMEphSAt8F9D1OyWv0GBLx.jpg', 'Sunita Mani is an actress, dancer, and comedian most commonly recognized for her gyrations in the viral music video \"Turn Down for What\" (dir. The Daniels) and as part of the Cocoon Central Dance Team. She also appears in \"Don\'t Think Twice\" as Amy, \"Mr. Robot\" as Trenton, and in the Netflix original series, G.L.O.W as Arthie. Sunita has also guest starred on network television shows including \"Broad City\" on Comedy Central, Search Party on TBS, and The Good Place on NBC.', '1986-12-13', NULL, 'Dickson, Tennessee, USA', '2025-05-09 10:20:56', '2025-05-09 10:20:56'),
(468, 4025, 'Steve Park', '/wDa3CYi7GPUcFBoi7Fg0fcCCXDc.jpg', 'Stephen Park is an American comedian and actor. The son of Korean immigrants, Park began his entertainment career as a stand-up comedian before transitioning into acting. He is best known for being a cast member of the sketch comedy television series In Living Color during the 1991–1992 season. He is also known for the film roles of Mike Yanagita in Fargo (1996), Sonny in Do the Right Thing (1989), and Detective Brian in Falling Down (1993).\n\nPark\'s other acting work includes the role of Mike Sorayama in the Adult Swim animated television series The Venture Bros. and the role of Judge Pete in the critically acclaimed independent film Rocket Science (2007). Park has acted in two Coen brothers films, Fargo (1996) and A Serious Man (2009).', '1962-05-04', NULL, 'Brooklyn, New York City, New York, USA', '2025-05-09 10:20:56', '2025-05-09 10:20:56'),
(469, 1180346, 'Anthony Carrigan', '/nHlu6rBHLardtTAHma3lvX27hkA.jpg', 'Anthony Carrigan (born January 2, 1983) is an American actor. From 2018 to 2023, he portrayed Chechen mobster NoHo Hank in the HBO series Barry, for which he was nominated three times for the Primetime Emmy Award for Outstanding Supporting Actor in a Comedy Series in 2019, 2022, and 2023. He is also known for playing Tyler Davies in the television series The Forgotten (2009–2010), Victor Zsasz in the FOX series Gotham (2014–2019), and robot Dennis Caleb McCoy in Bill & Ted Face the Music (2020).\n\nCarrigan was born January 2, 1983, in Winchester, Massachusetts. He graduated from Winchester High School and attended Carnegie Mellon University.\n\nSince childhood, Carrigan has had alopecia areata, an autoimmune disease that causes hair loss. He had mild symptoms growing up with only small, manageable bald spots, but he started losing more hair in his 20s and has spoken of wearing makeup and artificial eyebrows while filming The Forgotten. He is now known for his complete lack of hair, eyebrows, and eyelashes, and has incorporated this into his career, often being typecast as a television villain.\n\nDescription above from the Wikipedia article Anthony Carrigan, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1983-01-02', NULL, 'Boston, Massachusetts, USA', '2025-05-09 10:20:57', '2025-05-09 10:20:57'),
(470, 47730, 'Jessica Hynes', '/eyJ9aC1FXyPAI5xose0HqA26bnm.jpg', 'Jessica Hynes (née Stevenson) (born 30 October 1972) is a British actress, director and writer. Best known as a comedy actress, she has played Cheryl in The Royle Family (1998–2010), Siobhan Sharpe in Twenty Twelve (2011–2012) and W1A (2014–2017) and Emily Yates in There She Goes (2018–2023). She was also one of the stars, creators and writers of Spaced (1999–2001). She has also had starring roles in television film Tomorrow La Scala! and BBC dramas Years and Years (2019) and Miss Austen (2025). In film, Hynes has appeared in the Bridget Jones (2004–2016), Nativity (2012–2018) and Paddington (2017–2024) film series. Hynes has been nominated for two International Emmy Awards, a Tony Award, a Laurence Olivier Award, five BAFTAs (winning two), three Royal Television Society Awards (winning two) and three British Comedy Awards (winning two).\n\nHynes was born in Lewisham, London, and grew up in Brighton, where she attended St Luke\'s Infant and Junior Schools and Dorothy Stringer High School. After her parents split up, she was raised by her mother. She moved back to London as a young adult. Her maternal grandmother came from the village of Llanelian, north Wales, where her uncle also ran a farm. Her mother is a fluent Welsh speaker who later moved back to north Wales. In 2023, Hynes took part in the S4C series Iaith ar Daith where she began to learn the Welsh language; she cited being able to speak Welsh to her mother as a reason why she wanted to take part in the programme. Early in her career, Hynes teamed up with future Spaced co-star Katy Carmichael in a comedy double-act called the Liz Hurleys, appeared in two productions at Sheffield\'s Crucible Theatre, and acted for television shows including Staying Alive, Six Pairs of Pants, (Un)natural Acts, and Asylum (on which the Spaced team of Hynes, Simon Pegg and Edgar Wright first assembled). From 1998 to 2000, she played the supporting role of Cheryl in the hit sitcom The Royle Family; she reprised the role for special episodes in 2006, 2009 and 2010. In 1999, she co-wrote and starred in Spaced, for which she won two comedy awards and was nominated for an International Emmy and a Bafta for writing and creating the show alongside Simon Pegg. In 2017 , she directed her first feature film, The Fight, produced by Jamie Adams and Unstoppable media. In 2018, she played the role of a mother in the BBC Four programme There She Goes. She stars alongside David Tennant, raising a daughter with a severe learning disability. It is based on the real life of writer Shaun Pye and his wife Sarah Crawford whose daughter was born with a chromosomal disorder. She won a Bafta for her role in the series and was nominated for an International Emmy for her role in \'414\' the special made in 2023.  In 2019, she starred in the BBC and HBO production Years and Years for which she won a Royal Television Society award.', '1972-10-30', NULL, 'Lewisham, London, England, UK', '2025-05-09 10:20:57', '2025-05-09 10:20:57'),
(471, 74487, 'David Pasquesi', '/oQplec891LMv0wndTtKh1bIS11Z.jpg', 'David Pasquesi is an American actor and comedian. His screen credits include Groundhog Day, Strangers with Candy, Curb Your Enthusiasm, Return to Me, The Ice Harvest, Veep, At Home with Amy Sedaris, and Lodge 49.', '1960-12-23', NULL, ' Chicago, Illinois, U.S.', '2025-05-09 10:20:57', '2025-05-09 10:20:57'),
