(473, 49824, 'Kathryn Erbe', '/gJ3hlTzTjpTVBsGadvUQGiBgjsV.jpg', 'Kathryn Elsbeth Erbe (born July 5, 1965) is an American actress. She is best known for her role as Alexandra Eames on Law & Order: Criminal Intent, a spin-off of Law & Order, and Shirley Bellinger in the HBO series Oz.', '1965-07-05', NULL, 'Newton, Massachusetts, USA', '2025-05-09 10:20:58', '2025-05-09 10:20:58'),
