(479, 84223, 'Anna Kendrick', '/yirl6fEmeXY5xcvJw3nTcCNq9Cw.jpg', 'Anna Cooke Kendrick (born August 9, 1985) is an American actress. Her first starring role was in the 1998 Broadway musical High Society, for which she earned a nomination for the Tony Award for Best Featured Actress in a Musical. She made her film debut in the musical comedy Camp (2003), and had a supporting role in The Twilight Saga (2008–2012). She achieved wider recognition for the comedy-drama film Up in the Air (2009), which earned her a nomination for the Academy Award for Best Supporting Actress, and for her starring role in the Pitch Perfect film series (2012–2017).\n\nKendrick has also starred in the comedies Scott Pilgrim vs. the World (2010) and 50/50 (2011), the crime drama End of Watch (2012), the musical fantasy Into the Woods (2014), and the thrillers The Accountant (2016) and A Simple Favor (2018). She has also performed a voice role in the animated musical films Trolls (2016) and Trolls World Tour (2020). For starring in the short form series Dummy, she received a nomination for a Primetime Emmy Award for Outstanding Actress.', '1985-08-09', NULL, 'Portland, Maine, USA', '2025-05-09 10:21:01', '2025-05-09 10:21:01'),
(480, 59175, 'Blake Lively', '/oWQG50XE8uTYYskUOs5LLj4dMZS.jpg', 'Blake Ellender Lively (born August 25, 1987) is an American actress, model, and director. Born in Los Angeles, Lively is the daughter of actor Ernie Lively, and made her professional debut in his directorial project Sandman (1998). She starred as Bridget Vreeland in The Sisterhood of the Traveling Pants (2005) alongside its sequel The Sisterhood of the Traveling Pants 2 (2008) to commercial success. She appeared opposite Justin Long in the comedy Accepted (2006), and gained recognition for portraying Serena van der Woodsen in the CW drama television series Gossip Girl (2007–2012).', '1987-08-25', NULL, 'Los Angeles, California, USA', '2025-05-09 10:21:01', '2025-05-09 10:21:01'),
(481, 2349355, 'Michele Morrone', '/saKjzGAuw8Fiutlv9LweLjAti0Z.jpg', 'Michele Morrone (Italian pronunciation: [miˈkɛːlemorˈroːne]; born 3 October 1990) is an Italian actor, model, singer, and fashion designer. He gained international recognition after portraying the role of Massimo Torricelli in the 2020 erotic thriller 365 Days and its sequels, 365 Days: This Day and The Next 365 Days in 2022.\n\nDescription above from the Wikipedia Michele Morrone, article licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1990-10-03', NULL, 'Melegnano, Italy', '2025-05-09 10:21:02', '2025-05-09 10:21:02'),
(482, 1807132, 'Henry Golding', '/iiTLFGXgMrobajYvgpvZxQNqFvy.jpg', 'Henry Ewan Golding (born 5 February 1987) is a Malaysian and British actor and television host. Golding has been a presenter on BBC\'s The Travel Show since 2014. He is known for his film work, playing the role of Nick Young in Crazy Rich Asians (2018), the title character in the action-adventure Snake Eyes (2021), Sean Townsend in the thriller A Simple Favor (2018), and Tom in the romantic comedy Last Christmas (2019), the latter two directed by Paul Feig.', '1987-02-05', NULL, 'Betong, Malaysia', '2025-05-09 10:21:02', '2025-05-09 10:21:02'),
(483, 19, 'Allison Janney', '/hpBKWV1jjoXQbr1s0iUZTSvw582.jpg', 'Allison Brooks Janney (born November 19, 1959) is an American actress. In a career spanning three decades, she is known for her performances across multiple genres of screen and stage. Janney has received various accolades, including an Academy Award, a British Academy Film Award, a Golden Globe Award, and seven Primetime Emmy Awards, in addition to nominations for two Tony Awards.\n\nBorn in Boston and raised in Dayton, Ohio, Janney received a scholarship to study at the Royal Academy of Dramatic Art following her graduation from Kenyon College. After years of minor and uncredited film and television appearances, Janney\'s breakthrough came with the role of C. J. Cregg in the NBC political drama The West Wing (1999–2006), for which she received four Primetime Emmy Awards. In 2014, she won the Primetime Emmy Award for Outstanding Guest Actress in a Drama Series for her role as Margaret Scully on the Showtime period drama Masters of Sex. For her portrayal of Bonnie Plunkett, a cynical recovering addict on the CBS sitcom Mom (2013–2021), Janney received six Primetime Emmy Award nominations and won twice for Outstanding Supporting Actress in a Comedy Series.\n\nJanney made her professional stage debut with the Off-Broadway production Ladies (1989), and followed with numerous bit parts in various similar productions, before making her Broadway debut with the 1996 revival of Present Laughter. She won two Drama Desk Awards and has been nominated for two Tony Awards: for Best Actress in a Play for her performance in the Broadway revival of A View from the Bridge (1997), and for Best Actress in a Musical for her role in the original Broadway production of the musical 9 to 5 (2009).\n\nHer film roles include Private Parts (1997), Primary Colors (1998), 10 Things I Hate About You (1999), Drop Dead Gorgeous (1999), American Beauty (1999), Nurse Betty (2000), The Hours (2002), Hairspray (2007), Juno (2007), The Help (2011), The Way, Way Back (2013), Tammy (2014), The Rewrite (2014), Spy (2015), Tallulah (2016), The Girl on the Train (2016), Bad Education (2019) and Bombshell (2019). She voiced roles in Finding Nemo (2003), Over the Hedge (2006), Minions (2015), and The Addams Family (2019). For her performance in the black comedy I, Tonya (2017), Janney won an Academy Award, a BAFTA Award, and a Golden Globe Award, all for Best Supporting Actress.', '1959-11-19', NULL, 'Boston, Massachusetts, USA', '2025-05-09 10:21:02', '2025-05-09 10:21:02'),
(484, 20, 'Elizabeth Perkins', '/vTWYllD9V76rgv9XAbtkkjjeunG.jpg', 'Elizabeth Ann Perkins (born November 18, 1960) is an American actress. Her film roles have included About Last Night (1986), Big (1988), Avalon (1990), and He Said, She Said (1991), The Flintstones (1994), Miracle on 34th Street (1994), and her brief voice role as Coral in the Disney/Pixar animated film Finding Nemo (2003). She is also well known for her role as Celia Hodes in the Showtime TV series Weeds, for which she received three Primetime Emmy nominations and two Golden Globe nominations.', '1960-11-18', NULL, 'Queens, New York City, New York, USA', '2025-05-09 10:21:03', '2025-05-09 10:21:03'),
(485, 124620, 'Elena Sofia Ricci', '/6SKKF1MWQXydnPJPQwrRE6WO0oW.jpg', 'Elena Sofia Ricci is an actress.', '1962-03-29', NULL, 'Florence, Tuscany, Italy', '2025-05-09 10:21:03', '2025-05-09 10:21:03'),
(486, 1224113, 'Alex Newell', '/qAEq19Aw6cP6PbPexQxzS0eny4I.jpg', '', '1992-08-20', NULL, 'Lynn, Massachusetts, USA', '2025-05-09 10:21:03', '2025-05-09 10:21:03'),
(487, 990369, 'Andrew Rannells', '/wOXFZssfq3wymBwuiMNVNBpPENB.jpg', 'Andrew Scott Rannells was born on August 23, 1978 in the city of Omaha (Nebraska), in the United States. He studied in the Creighton Preparatory School in his hometown, and after finishing secondary, briefly attended Marymount Manhattan College. Throughout his career, Rannells won a Grammy Award and was nominated for the Tony Awards. He is known for his portrayal as Elder Price in the 2011 Broadway musical \"The Book of Mormon\", for which he received a nomination for the Tony Award for Best Performance by a Leading Actor in a Musical. He won the 2012 Grammy Award for Best Musical Theater Album as a featured soloist on the musical\'s original Broadway cast recording. His other credits on Broadway include the works of \"Jersey Boys\" as Bob Gaudio and \"Hairspray\", as Link Larkin. Andrew began his career in film and television in the mid-90\'s, developed primarily as a voice artist. Between the numerous animated series in which he has worked, titles are counted as \"Street Sharks\", \"One Piece\", \"Yugio: Duel Monsters\", \"Yu-Gi-Oh!\", \"Liberty\'s Kids: Est. 1776\", \"Shaman Kingu,\" Kakutou ryouri densetsu bistro recipe\", \" Cubix, \"Sonic X\", Robots for Everyone\", \"Pokémon\" and\" Shukan Pok mon hosokyoku \". Rannells played the role of Elijah Krantz on the HBO series \"Girls\" and had the leading role of Bryan Buckley in the NBC series \"The New Normal\". Andrew also filmed some feature films - he had a brief participation in \"Sex and the City 2\" (2010), and a role of starring in the comedy starring Kirsten Dunst, \"Bachelorette\" (2012).  In 2014, Rannells filled in as a replacement for Hedwig in the rock musical \"Hedwig and the Angry Inch\". A year later, Rannells briefly played the role of King George III in the hit Broadway musical \"Hamilton\". He soon secured the role of Whizzer Brown in the Broadway revival of \"Falsettos\", directed by James Lapine. In 2018, Rannells portrayed the role of Larry in the Broadway musical \"The Boys in the Band\", alongside other notable actors. He is currently playing the role of Blair Pfaff in the American comedy series \"Black Monday\" on Showtime.', '1978-08-23', NULL, 'Omaha, Nebraska, USA', '2025-05-09 10:21:04', '2025-05-09 10:21:04'),
(488, 2050577, 'Taylor Ortega', '/EQDeznH38E5KP1N879NYBSOhti.jpg', 'Taylor Ortega is a writer, comedian, and actor based in New York City. Most recently, she played Shego in the live-action Kim Possible movie for Disney Channel. She has appeared on Succession (HBO) and is a regular writer and contributor to How Stuff Work\'s pop culture podcast \"The Daily Zeitgeist.\"', '1989-05-26', NULL, 'New York City, New York, USA', '2025-05-09 10:21:04', '2025-05-09 10:21:04'),
