(492, 2123596, 'Ian Ho', '/esTj6L0QYYuIFXynZ9Y1QSLQetD.jpg', 'Ian Ho is a Canadian-born actor from Toronto, Ontario. He landed his first major film role at the age of 7, playing Nicky Nelson in Paul Feig\'s, A Simple Favor. Ian appears in Season 3 of the Hulu series The Handmaids\' Tale - Unfit, and Netflix\'s A Babysitter\'s Guide to Monster Hunting, based on the bestselling book series by Joe Ballarini.\n\nHe stars alongside Adrien Brody and Emily Hampshire as Tane Boone in the new EPIX limited series \"Chapelwaite\", and is featured in Season 6 opening scenes of The Expanse, introducing the Laconia story arc with his twin sister Emma Ho. He will also recur in the Comedy \"Overlord and the Underwoods.\" In 2022, he guest-starred in Star Trek: Strange New Worlds as The First Servant in the Episode, \"Lift Us Where Suffering Cannot Reach.\"\n\nAs a voice actor, he appears many animated series including Rusty Rivets, Blues Clues \'N You, Pikwik Pack, Elinor Wonders Why, and the series regular role of Flicker in Spin Master\'s series, Mighty Express. He continues to discover new characters to voice along the way.\n\nHe is the twin brother of actress Emma Ho.', '2010-04-15', NULL, NULL, '2025-05-09 10:21:05', '2025-05-09 10:21:05'),
