(498, 1775228, 'Holmes', '/pAKMfF7XQzK2HYMMZDNNzYeIXfZ.jpg', 'Chelsea Elizabeth Holmes, known as just Holmes professionally, is an American comedian, actress, and writer best known for her role as Kelly Mallet in the Fox sitcom Welcome to Flatch. Holmes has appeared on stage as a stand-up comic and improvisational actress, and has built up a substantial online following.\n\nAfter limited appearances in short films and television, Holmes landed the co-lead role in the Fox sitcom Welcome to Flatch, which premiered in 2022 and ended in February 2023.', NULL, NULL, NULL, '2025-05-09 10:21:07', '2025-05-09 10:21:07'),
