(522, 135651, 'Michael B. Jordan', '/hz9AOUWZ2zzS0dpPJ1yQv2grA35.jpg', 'Michael Bakari Jordan II (/bɑːˈkɑːri/ bah-KAR-ee; born February 9, 1987) is an American actor and producer. He is best known for his film roles as shooting victim Oscar Grant in the drama Fruitvale Station (2013), boxer Adonis Creed in Creed (2015), and Erik Killmonger in Black Panther (2018), all of which were written and directed by Ryan Coogler. Jordan reprised his role of Creed in Creed II (2018) and Creed III (2023); the latter also marked his directorial debut.\n\nJordan initially broke out in television, playing Wallace in the first season of the HBO crime drama series The Wire (2002). He went on to play Reggie Montgomery on the ABC soap opera All My Children (2003–2006) and Vince Howard in the NBC sports drama series Friday Night Lights (2009–2011). His other films include Chronicle (2012), That Awkward Moment (2014), Fantastic Four (2015), and Just Mercy (2019), in which he portrayed Bryan Stevenson. He has also starred in and produced the HBO film Fahrenheit 451 (2018), for which he was nominated for the Primetime Emmy Award for Outstanding Television Movie.\n\nJordan was named one of the 100 most influential people in the world by Time magazine in 2020 and 2023. Also in 2020, he was named People\'s Sexiest Man Alive, and The New York Times ranked him 15th on its list of the 25 greatest actors of the 21st century. Jordan is also a co-owner of English Premier League football club AFC Bournemouth.\n\nDescription above from the Wikipedia article Michael B. Jordan, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1987-02-09', NULL, 'Santa Ana, California, USA', '2025-05-09 10:21:17', '2025-05-09 10:21:17'),
(523, 4688032, 'Miles Caton', '/5uG9uoRn6THwZpEN4EHawdIf9uX.jpg', 'Miles Caton is an American actor and musician. He is best known for his role as Sammie in the horror film Sinners (2025).', NULL, NULL, 'Brooklyn, New York, USA', '2025-05-09 10:21:17', '2025-05-09 10:21:17'),
(524, 130640, 'Hailee Steinfeld', '/dxSDWkiVaC6JYjrV3XRAZI7HOSS.jpg', 'Hailee Steinfeld (born December 11, 1996) is an American actress and singer. She had her breakthrough with the western film True Grit (2010), which earned her various accolades, including nominations for an Academy Award and a BAFTA Award.\n\nSteinfeld gained wider recognition for her roles in the Pitch Perfect film series (2015–2017) and The Edge of Seventeen (2016), which earned her a Golden Globe nomination. She also starred in Ender\'s Game (2013), Begin Again (2013) and Bumblebee (2018). She voiced Gwen Stacy / Spider-Woman in Spider-Man: Into the Spider-Verse (2018) and its 2023 sequel, and Vi in the Netflix series Arcane (2021–2024). She portrayed Emily Dickinson in the Apple TV+ series Dickinson (2019–2021), and has portrayed Kate Bishop in the Marvel Cinematic Universe since 2021.\n\nSteinfeld gained recognition in music after performing \"Flashlight\" in Pitch Perfect 2 (2015), signing with Republic Records soon after and released her debut single, \"Love Myself\", followed by her debut EP Haiz (2015). She went on to release a series of successful singles, including \"Starving\", \"Most Girls\" and \"Let Me Go\". In 2020, she released her second EP, Half Written Story.\n\nDescription above from the Wikipedia article Hailee Steinfeld, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1996-12-11', NULL, 'Tarzana, Los Angeles, California, USA', '2025-05-09 10:21:17', '2025-05-09 10:21:17'),
(525, 134774, 'Wunmi Mosaku', '/mWDsVCo9sBcekrsjUTsoCFLhtYt.jpg', 'Oluwunmi Mosaku (born 1986) is a Nigerian-born British actress. She is known for her roles as Joy in the BBC Two miniseries Moses Jones (2009) and Holly Lawson in the ITV series Vera (2011–2012). She won the BAFTA TV Award for Best Supporting Actress as Gloria Taylor in the TV film Damilola, Our Loved Boy(2016). In 2019, she starred in the fifth Luther series. In 2020, she starred as Ruby Baptiste in HBO\'s Lovecraft Country. In 2021, she starred as Hunter B-15 in the Marvel Cinematic Universe (MCU) television series Loki. She reprised the role in the 2024 film Deadpool & Wolverine.\n\nShe was nominated for the BAFTA for Best Actress and won the BIFA for Best Performance by an Actress in a British Independent Film for her role as Rial in His House (2020).\n\nDescription above from the Wikipedia article Wunmi Mosaku, licensed under CC-BY-SA, is a full list of contributors on Wikipedia.', '1986-07-31', NULL, 'Zaria, Nigeria', '2025-05-09 10:21:18', '2025-05-09 10:21:18'),
(526, 85065, 'Jack O\'Connell', '/tCzR4clrIkbkijuJBYsNoEuwRDa.jpg', 'Jack O\'Connell (born 1 August 1990) is an English actor. He first gained recognition for playing James Cook in the British television series Skins (2009–2010, 2013). He is also known for his roles in This Is England (2006), the slasher film Eden Lake (2008), the television dramas Dive (2010) and  United (2011), and the Netflix Wild West miniseries Godless (2017), for which he received a Critics\' Choice Television Award nomination.\n\nO\'Connell gave critically acclaimed performances in the independent films Starred Up (2013) and \'71 (2014), garnering nominations for the British Independent Film Awards. He subsequently starred as war hero Louis Zamperini in the war film Unbroken (2014) and received the BAFTA Rising Star Award. He has since starred in the thriller Money Monster (2016), the biographical drama Trial by Fire (2018), the BBC miniseries The North Water (2021), the BBC series SAS: Rogue Heroes (2022–2025), the Amy Winehouse biographical film Back to Black (2024) and the period horror film Sinners (2025).\n\nDescription above from the Wikipedia article Jack O\'Connell, licensed under CC-BY-SA, is a full list of contributors on Wikipedia.', '1990-08-01', NULL, 'Derby, Derbyshire, England, UK', '2025-05-09 10:21:18', '2025-05-09 10:21:18'),
(527, 18792, 'Delroy Lindo', '/kLwUBBmEIdchrLqwsYzgLB2B6q5.jpg', 'Delroy George Lindo (born 18 November 1952) is an English–American actor. He is the recipient of such accolades as an NAACP Image Award, a Satellite Award, and nominations for a Drama Desk Award, a Helen Hayes Award, a Tony Award, two Critics\' Choice Television Awards, and three Screen Actors Guild Awards.\n\nHe moved with his mother to San Francisco when he was 16 after they had left London and lived in Canada for a few years. Here, he completed his education and entered acting. Lindo has played prominent roles in four Spike Lee films: West Indian Archie in Malcolm X (1992), Woody Carmichael in Crooklyn (1994), Rodney Little in Clockers (1995), and Paul in Da 5 Bloods (2020). He has been praised for performing in Da 5 Bloods as a Vietnam War veteran, winning the New York Film Critics Circle Award for Best Actor and the National Society of Film Critics Award for Best Actor.\n\nLindo also played Bo Catlett in Get Shorty (1995), Arthur Rose in The Cider House Rules (1999), and Detective Castlebeck in Gone in 60 Seconds (2000). Lindo starred as Alderman Ronin Gibbons in the TV series The Chicago Code (2011), as Winter in the series Believe (2014), and as Adrian Boseman in The Good Fight (2017–2021).\n\nDescription above from the Wikipedia article Delroy Lindo, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1952-11-18', NULL, 'Eltham, London, England, UK', '2025-05-09 10:21:18', '2025-05-09 10:21:18'),
(528, 334, 'Omar Benson Miller', '/adlrkEpxDIcpxF7bpzMGErLxeHP.jpg', 'Omar Benson Miller (born October 7, 1978) is an American actor. He is known for his work as Walter Simmons on CSI: Miami (2009–2012), as Charles Greane on Ballers (2015–2019), as the voice of Raphael on Rise of the Teenage Mutant Ninja Turtles (2018-2020) and its 2022 film and on the CBS comedy series The Unicorn (2019–2021).\n\nDescription above from the Wikipedia article Omar Benson Miller, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1978-10-07', NULL, 'Anaheim, California, USA', '2025-05-09 10:21:19', '2025-05-09 10:21:19'),
(529, 2455272, 'Jayme Lawson', '/ntwbhdUeW8K5KYJENqyiSZcsIj9.jpg', 'Jayme Lawson (born September 19, 1997) is an American actress, best known for her role in The Batman (2022). She studied drama at The Juilliard School and graduated in 2019, where she played Juliet in Romeo and Juliet, the title role in Hamlet, as well as Lady Macbeth onstage.', '1997-09-19', NULL, 'USA', '2025-05-09 10:21:19', '2025-05-09 10:21:19'),
(530, 1321015, 'Li Jun Li', '/ztkl70rWIUM6hDpyFxn0B5GXBA3.jpg', 'Li Jun Li (Chinese: 李麗君; pinyin: Lǐ Lìjūn) is an American actress, known for her roles as Iris Chang in the ABC series Quantico, Rose Cooper in the Fox series The Exorcist, Jenny Wah in the Netflix series Wu Assassins, Lady Fay Zhu in the period drama Babylon (2022), and Grace Chow in Sinners (2025).\n\nDescription above from the Wikipedia article Li Jun Li, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1983-11-06', NULL, 'Shanghai, China', '2025-05-09 10:21:20', '2025-05-09 10:21:20'),
(531, 3495960, 'Yao', '/hRMKy14F6zvDnwM3nRGOCVMTDmQ.jpg', 'Yao – whose real name is Thomas Pang – is a Malaysian actor of Chinese and Filipino descent. He is a 2015 graduate of  the Lasalle College of the Arts who was prominent in Singapore’s theatre and film scene, earning three Best Actor nominations in The Straits Times Life Theatre Awards, and winning it in 2018 for his performance in Hand To God by Singapore Repertory Theatre. Yao remained in the United States after obtaining a Master of Fine Arts degree in 2023 from the David Geffen School of Drama at Yale University in Connecticut, not far from his current home in New York. He is best known for his role as Bo Chow in the 2025 movie Sinners, directed by Ryan Coogler.', NULL, NULL, NULL, '2025-05-09 10:21:20', '2025-05-09 10:21:20'),
(532, 1345418, 'Lola Kirke', '/xXEBb9OoET7SgtkSmh1XtMs5YKC.jpg', 'Lola Clementine Kirke (born 27 September 1990) is an English-born American actress and singer-songwriter.\n\nDescription above from the Wikipedia article Lola Kirke, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1991-01-01', NULL, 'Westminster, London, England, UK', '2025-05-09 10:21:20', '2025-05-09 10:21:20'),
(533, 1805225, 'Peter Dreimanis', '/lMqeuP0G9Gqvei6eJ65xabNkz5Y.jpg', 'The basic structural facts of rock band July Talk are this: two front people, Leah Fay Goldstein and Peter Dreimanis, surrounded by whiplashing guitarists Ian Docherty and Josh Warburton, and double drummers Danny Miles and Dani Nash. For this compulsively DIY, rigorously self-realizing group, the essence of July Talk has always been the tension between precision and chaos. To understand this tension, we can reduce it to sets of twos, or we can magnify it and look deeper as to why we feel the need to frame it one way or the other. What we see says more about what we’re looking for. With July Talk, as with most things, what have we missed?  We need not ask what July Talk’s two writhing frontpeople’s relationship is to each other, but rather what their relationship is to us, their audience, and to the world, this tender, villainous, confounding world. These bodies welcome our gaze, they revel and recoil in it while they furiously push back, asking of us what they ask of each other: please see me for who I am. If we see July Talk as a woman and a man, in opposition to one another, what we are seeing is our own projections upon these bodies.\n\nWhat goes on between these bodies, all of them, that kinetic, staticky, sticky space, is where the truth of July Talk takes shape. On stage, July Talk unfurls and explodes. The action pings from slo-motion commotion to back-bendy communion, fluid (as in bodily) and liquid (as in the dark goo phase of metamorphosis). Things get weird, occasionally grotesque, always enthralling. Each show offers moments of grace that reveal for a moment the inner workings of this unknowable universe. Hold onto those until the next time.', NULL, NULL, 'Edmonton, AB Canada', '2025-05-09 10:21:21', '2025-05-09 10:21:21'),
(534, 53399, 'Buddy Guy', '/9J2mWgbZ39QCRASLKtiTeQV23Wr.jpg', 'George \"Buddy\" Guy (born July 30, 1936) is an American blues guitarist and singer. He is an exponent of Chicago blues and has influenced eminent guitarists including Eric Clapton, Jimi Hendrix, Jimmy Page, Keith Richards, Stevie Ray Vaughan, Jeff Beck and John Mayer. In the 1960s, Guy played with Muddy Waters as a house guitarist at Chess Records and began a musical partnership with the harmonica player Junior Wells.\n\nGuy was ranked 30th in Rolling Stone magazine\'s \"100 Greatest Guitarists of All Time\". His song \"Stone Crazy\" was ranked 78th in the Rolling Stone list of the \"100 Greatest Guitar Songs of All Time\". Clapton once described him as \"the best guitar player alive\". In 1999, Guy wrote the book Damn Right I\'ve Got the Blues, with Donald Wilcock.[6] His autobiography, When I Left Home: My Story, was published in 2012.', '1936-07-30', NULL, 'Lettsworth, Louisiana, US', '2025-05-09 10:21:21', '2025-05-09 10:21:21'),
(535, 1985, 'Saul Williams', '/5VQZl7h6jVyx6hSttUZwtYBVrYy.jpg', 'Saul Stacey Williams (born February 29, 1972) is an American rapper, singer, songwriter, musician, poet, writer, and actor. He is known for his blend of poetry and alternative hip hop and his lead roles in the 1998 independent film Slam and the 2013 jukebox musical Holler If Ya Hear Me.\n\nDescription above from the Wikipedia article Saul Williams, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1972-02-29', NULL, 'Newburgh, New York, USA', '2025-05-09 10:21:21', '2025-05-09 10:21:21'),
