(543, 2300625, 'Percy Bell', '/izt1F4xiZGQD49esXgJDGA1qJ2K.jpg', 'Percy Bell was born in Epps, Louisiana the youngest of three boys. He spent most of his life playing sports, but always had a love for acting. He attended Nicholls State University, where he obtained a bachelors degree in Athletic Training. During this time he also worked as an Athletic Trainer for the New Orleans Saints. After obtaining his bachelors degree, he relocated to Nashville, Tennessee to pursue a master\'s degree. At that same time he began to seriously pursue acting and modeling. He began by enrolling in various acting classes and workshops, which soon led to him landing an agent. Percy has been in various commercials and print ads. He completed three feature films in 2016, and was nominated for Best Actor for his lead role in the short film Circumvent (2015).', NULL, NULL, 'Epps, Louisiana, USA', '2025-05-09 10:21:24', '2025-05-09 10:21:24'),
