(546, 60722, 'Nathaniel Arcand', '/zGi472JSPXlY71ocGh8PQOn5Ag6.jpg', 'Nathaniel Arcand (born November 13, 1971) is a Canadian actor and is Nēhilawē (Plains Cree), from the Alexander First Nation Reserve.\n\nHis first major role was as troubled teen William MacNeil for 3 seasons in the Canadian drama series North of 60. In 1997, he was nominated for a Gemini Award in the category \"Best Performance by an Actor in a Featured Supporting Role in a Dramatic Series\" for the North of 60 episode \"Traces and Tracks.\"\n\nHe had a major role as Clinton Skye in the CBS crime drama FBI: Most Wanted, and one of his longest running roles is that of Scott Cardinal on the CBC series Heartland. He has also appeared on Murdoch Mysteries, Smallville, Longmire, Bull, Supernatural, and Into the West, to name a few.\n\nHe portrays Victor Merasty on Blackstone, \"an unmuted exploration of First Nations’ power and politics\" set in a small Plains Cree community. He also portrays Nathan in the comedic drama Two Indians Talking, which won the 2010 Vancouver International Film Festival Most Popular Canadian Film Award. He appeared in Cold Pursuit with Liam Neeson, as well as many other films.', '1971-11-13', NULL, 'Edmonton, Alberta, Canada', '2025-05-09 10:21:25', '2025-05-09 10:21:25'),
