(554, 1296517, 'Theodus Crane', '/ublHrKfx6rfw3qmzgAkJC38G1fZ.jpg', 'Theodus Crane is an American actor.', NULL, NULL, NULL, '2025-05-09 10:21:28', '2025-05-09 10:21:28'),
(555, 1245, 'Scarlett Johansson', '/6NsMbJXRlDZuDzatN2akFdGuTvx.jpg', 'Scarlett Ingrid Johansson (born November 22, 1984) is an American actress. The world\'s highest-paid actress in 2018 and 2019, she has featured multiple times on the Forbes Celebrity 100 list. Her films have grossed over $14.3 billion worldwide, making Johansson the ninth-highest-grossing box office star of all time. She has received various accolades, including a Tony Award and a British Academy Film Award, in addition to nominations for two Academy Awards and five Golden Globe Awards.\n\nJohansson aspired to be an actress from an early age and first appeared on stage in an Off-Broadway play as a child actor. She made her film debut in the fantasy comedy North (1994), and gained early recognition for her roles in Manny & Lo (1996), The Horse Whisperer (1998), and Ghost World (2001). Johansson shifted to adult roles in 2003 with her performances in Lost in Translation, which won her a BAFTA Award for Best Actress, and Girl with a Pearl Earring. She was nominated for Golden Globe Awards for these films, and for playing a troubled teenager in the drama A Love Song for Bobby Long (2004) and a seductress in psychological thriller Match Point (2005). The latter was her first collaboration with Woody Allen, who later directed her in Scoop (2006) and Vicky Cristina Barcelona (2008).\n\nJohansson\'s other works of this period include The Prestige (2006) and the albums Anywhere I Lay My Head (2008) and Break Up (2009), both of which charted on the Billboard 200. In 2010, Johansson debuted on Broadway in a revival of A View from the Bridge, which won her a Tony Award for Best Featured Actress, and began portraying Black Widow in the Marvel Cinematic Universe film Iron Man 2. She reprised the role in eight films, most recently in her solo feature Black Widow (2021), gaining global recognition for her performances. During this period, Johansson starred in the science fiction films Her (2013), Under the Skin (2013) and Lucy (2014).\n\nShe received two simultaneous Academy Award nominations—Best Actress and Best Supporting Actress—for the respective roles of an actress going through a divorce in the drama Marriage Story (2019) and a single mother in Nazi Germany in the satire Jojo Rabbit (2019). Labeled a sex symbol, Johansson has been referred to as one of the world\'s most attractive women by various media outlets. She is a prominent brand endorser and supports several charitable causes. Divorced from actor Ryan Reynolds and businessman Romain Dauriac, Johansson has been married to comedian Colin Jost since 2020. She has two children, one with Dauriac and another with Jost.', '1984-11-22', NULL, 'New York City, New York, USA', '2025-05-09 10:21:29', '2025-05-09 10:21:29'),
(556, 3293, 'Rachel Weisz', '/9tfHL5tholha1YF6bSKt422ETPM.jpg', 'Rachel Hannah Weisz (/vaɪs/; born 7 March 1970) is an English actress. Known for her roles in independent films and blockbusters, she has received several awards, including an Academy Award, a BAFTA Award, a Golden Globe Award, and a Laurence Olivier Award.\n\nWeisz began acting in stage and television productions in the early 1990s and made her film debut in Death Machine (1994). She won a Critics\' Circle Theatre Award for her role in the 1994 revival of Noël Coward\'s play Design for Living. She went on to appear in the 1999 Donmar Warehouse production of Tennessee Williams\' drama Suddenly Last Summer. Her film breakthrough came with her starring role as Evelyn Carnahan in the Hollywood action films The Mummy (1999) and The Mummy Returns(2001). Weisz went on to star in several films of the 2000s, including Enemy at the Gates (2001), About a Boy (2002), Runaway Jury (2003), Constantine (2005), The Fountain (2006), The Lovely Bones (2009) and The Whistleblower (2010).\n\nFor her performance as an activist in the 2005 thriller The Constant Gardener, she won the Academy Award for Best Supporting Actress. For playing Blanche DuBois in a 2009 revival of A Streetcar Named Desire, she won the Laurence Olivier Award for Best Actress. In the 2010s, Weisz continued to star in big-budget films such as the action film The Bourne Legacy (2012) and the fantasy film Oz the Great and Powerful (2013) and achieved critical acclaim for her performances in the independent films The Deep Blue Sea (2011), Denial (2016), and The Favourite (2018). For her portrayal of Sarah Churchill in The Favourite, she won the BAFTA Award for Best Actress in a Supporting Role and received a second Academy Award nomination. Weisz portrayed Melina Vostokoff in the Marvel Cinematic Universe film Black Widow (2021) and starred as twin obstetricians in the thriller miniseries Dead Ringers (2023).\n\nDescription above from the Wikipedia article Wendell Pierce, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1970-03-07', NULL, 'Westminster, London, England, UK', '2025-05-09 10:21:30', '2025-05-09 10:21:30'),
(557, 5538, 'Ray Winstone', '/kDShEv6zPfArgcwXliGWKR65Mmo.jpg', 'Raymond Andrew Winstone (born February 19, 1957) is an English television, stage, film, and voice-over actor with a career spanning five decades. Having worked with many prominent directors, including Martin Scorsese and Steven Spielberg, he is perhaps best known for his \"tough guy\" roles (usually delivered in his distinctive London accent), beginning with that of Carlin in the 1979 film Scum, and Will Scarlet in the cult TV adventure series Robin of Sherwood.\n\nHis film résumé includes Fool\'s Gold, Cold Mountain, King Arthur, The Proposition, The Departed, Beowulf, Indiana Jones and the Kingdom of the Crystal Skull, and Edge of Darkness. He is known for starring in very profane and violent films such as Nil By Mouth, Sexy Beast and 44 Inch Chest. He has also branched out into film production.  Description above from the Wikipedia article Ray Winstone, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1957-02-19', NULL, 'Hackney, London, England, UK', '2025-05-09 10:21:30', '2025-05-09 10:21:30'),
(558, 1743933, 'Ever Anderson', '/eMXNpIiQuOYSH8gtIif6wQyrBVt.jpg', 'Ever Gabo Anderson, born on November 3, 2007, in Toronto, Canada, is a Canadian-American actress and model. She is the daughter of American actress Milla Jovovich and British director Paul W. S. Anderson, and has two younger sisters, Dashiel and Osian. Her ancestry includes Russian and Serbian roots from her mother\'s side and English heritage from her father\'s lineage.\n\nDespite initial attempts by her parents to dissuade her from pursuing acting, Ever remained steadfast in her pursuit. Fluent in English and Russian, she is also proficient in French, residing in Hollywood Hills, Los Angeles, California, where she practices taekwondo.\n\nAt the age of nine, Ever graced the cover of Vogue Bambini, photographed by Ellen von Unwerth, and captured the attention of renowned photographers like Karl Lagerfeld, Mikael Jansson, and Peter Lindbergh.\n\nHer debut in a feature film occurred in \"Resident Evil: The Final Chapter\" (2016), directed by her father. In this film, she portrayed a younger version of Alicia Marcus, a character her mother portrayed as an adult. Ever gained recognition for her portrayal of the young Natasha Romanoff in the film \"Black Widow\". Additionally, she played the role of Wendy Darling in the film \"Peter Pan & Wendy\", marking significant milestones in her burgeoning career as an actress.', '2007-11-03', NULL, 'Los Angeles, California, USA', '2025-05-09 10:21:31', '2025-05-09 10:21:31'),
(559, 113970, 'O-T Fagbenle', '/baIiZBDYpYXfG4SlonbcqyYg6l.jpg', 'Born in London and raised across London, Spain, and Nigeria, Fagbenle was a world traveler at a young age. As a child, music was his passion and he played the saxophone in bands across Europe, performing at the Edinburgh Festival, Wembley Arena, the Royal Albert Hall, and even touring Spain. When he was 16 years old, Fagbenle landed his first proper role in a Nigerian adaptation of the William Shakespeare play Macbeth. Originally hired to play the saxophone, Fagbenle was also given several lines in the play, and he knew at that moment that acting was his calling. The director was so impressed by Fagbenle\'s work, by the second revival of the play he had secured the lead role. Fagbenle went on to attend the prestigious Royal Academy of Dramatic Arts, graduating early in 2001 and joining alumni such as Sean Bean, Ralph Fiennes, and Anthony Hopkins. Theatre became his passion, as he appeared in dozens of plays across the UK, working in notable productions including the national tours of shows such as Ragamuffin, Romeo & Juliet [as Mercutio], and the West End debut of Porgy and Bess, the musical. Fagbenle was soon offered his first lead role for the stage, in John Guare\'s award winning play Six Degrees of Separation. His work was met by outstanding reviews, and a M.E.N. Theatre Award for Best Actor in a Leading Role. While Fagbenle\'s career flourished on the theatre front, he also made his break into film and television.\n\nIn 2006, Fagbenle made his feature film debut, appearing in The Weinstein Company\'s Breaking and Entering (2006) opposite Jude Law, Robin Wright, and Juliette Binoche. He was next seen in I Could Never Be Your Woman (2007) in 2007 alongside Michelle Pfeiffer, Paul Rudd, and Saoirse Ronan. In 2008, he made his first appearance on US television, starring on NBC\'s Quarterlife (2007) playing John, a singer songwriter-- where Fagbenle was able pen and perform all the songs his character played on the show. 2008 also brought starring roles for Fagbenle in the UK; as he appeared in the critically acclaimed Walter\'s War (2008) as Walter Tull, a biopic of the first mixed heritage officer in the British Army, and Consuming Passion (2008) for the BBC. In 2010, Fagbenle took a leading role as Chris in the BBC One flagship show Material Girl (2010). He also starred in the television series Thorne: Sleepyhead (2010) and Thorne: Scaredycat (2010), adaptations of the Mark Billingham novels Sleepyhead and Scaredy Cat. Directed by 24 (2001) producer Stephen Hopkins, the six one hour episodes also starred Sandra Oh, and David Morrissey, and was sold to over 100 countries. 2010 also brought Fagbenle back to the states, where he starred opposite Tia and Tamera Mowry in the Lifetime movie Double Wedding (2010).\n\nIn his down time, Fagbenle loves to go backpacking, play basketball, and volunteers at numerous schools, putting on free drama and music classes for kids.', '1981-01-22', NULL, 'London, England, UK', '2025-05-09 10:21:31', '2025-05-09 10:21:31'),
(560, 227, 'William Hurt', '/j3mjmuHLBW4XQSw53C8Sh0Lh3ZQ.jpg', 'William Hurt (March 20, 1950 – March 13, 2022) was an American stage, film and television actor, trained at the Juilliard School, Manhattan, New York, USA. For his leading role in the feature film \"Kiss of the Spider Woman\", he received an Academy Award in 1986, followed by 3 more nominations for roles in the movies \"Children of a Lesser God\", \"Broadcast News\", and \"A History of Violence\".', '1950-03-20', '2022-03-13', 'Washington, D.C., USA', '2025-05-09 10:21:31', '2025-05-09 10:21:31'),
(561, 2072566, 'Ryan Kiera Armstrong', '/yc59dX19baAR9wHF6035EjkUFUr.jpg', 'Ryan Kiera Armstrong is an American actress known for portraying Minnie May Berry in Anne with an E and Young Antonia Dreykov in Black Widow.', '2010-03-10', NULL, 'New York, New York, USA', '2025-05-09 10:21:32', '2025-05-09 10:21:32'),
