(563, 101065, 'Michelle Lee', '/r6QzFK8IBxO1Kp3zm3GJ3FUuwwR.jpg', 'Michelle Charlene Lee has appeared in many films and television series such as Pirates of the Caribbean: At Worlds End (2007), Venom (2018), and Black Widow (2021), just to name a few. Michelle\'s ability to show strength through both acting and physicality has been recognized with a SAG Nomination for Best Ensemble Cast and on the cover of Inside Kung Fu Magazine. Michelle has a black belt in Wushu and a BA in Economics specializing in Computer Programming from UCLA.\n\nA native of Los Angeles, Michelle spent some time in Silicon Valley but currently resides back in LA.', '1978-08-02', NULL, 'Long Beach, California, USA', '2025-05-09 10:21:33', '2025-05-09 10:21:33'),
