(688, 2424172, 'John Wolfe', '/pAi854GfMOaNf9FoNQ2PAWyQCCl.jpg', 'John Wolfe, a native of the west coast of Scotland, calls it his current home. He holds a prestigious degree from Regents University London as a trained director and cinematographer. Additionally, he has honed his skills as an actor and scriptwriter through his education at LAMDA, earning him numerous awards.\n\nNotably, John has pursued additional certifications in both screen combat and firearms training for stage and screen performances. With extensive experience as both an actor and a member of the crew, his portfolio showcases an impressive list of film and television projects that he has contributed to.', NULL, NULL, NULL, '2025-05-09 10:21:57', '2025-05-09 10:21:57'),
