(702, 17604, 'Jeremy Renner', '/yB84D1neTYXfWBaV0QOE9RF2VCu.jpg', 'Jeremy Lee Renner (born January 7, 1971) is an American actor.\n\nHe began his career by appearing in independent films such as Dahmer (2002) and Neo Ned (2005). Renner earned supporting roles in bigger films, such as S.W.A.T. (2003) and 28 Weeks Later (2007).\n\nRenner was nominated for the Academy Award for Best Actor for his performance in The Hurt Locker (2008) and for the Academy Award for Best Supporting Actor for his performance in The Town (2010).\n\nRenner played Clint Barton / Hawkeye in the Marvel Cinematic Universe films Thor (2011), The Avengers (2012), Avengers: Age of Ultron (2015), Captain America: Civil War (2016), Avengers: Endgame (2019), and Black Widow (2021) in an uncredited voice cameo; with a further appearance in the Disney+ show Hawkeye (2021). He also appeared in Mission: Impossible – Ghost Protocol (2011), The Bourne Legacy (2012), Hansel and Gretel: Witch Hunters (2013), American Hustle (2013), Mission: Impossible – Rogue Nation (2015), and Arrival (2016).', '1971-01-07', NULL, 'Modesto, California, USA', '2025-05-09 10:22:00', '2025-05-09 10:22:00'),
(703, 1923572, 'Dale Liner', '/g4frvT3XRUmLhS9DLZm1E1Oed0Q.jpg', 'Dale L. Liner is an American actor, presenter, former weapons lead, writer and producer and stuntman.', NULL, NULL, NULL, '2025-05-09 10:22:00', '2025-05-09 10:22:00'),
(704, 221841, 'Zach Roerig', '/fjNS8QTDnGsuoOz66aP6JlN93FQ.jpg', 'Zach Roerig (born February 22, 1985) is an American actor who is best known for roles of Casey Hughes on As the World Turns, Hunter Atwood on One Life to Live and Matt Donovan on The Vampire Diaries.', '1985-02-22', NULL, 'Montpelier, Ohio, United States', '2025-05-09 10:22:04', '2025-05-09 10:22:04'),
(705, 1954, 'Billy Zane', '/wr4fuwLzQvW1G0MS7cmQ3ObFjvL.jpg', 'William George \"Billy\" Zane, Jr. (born February 24, 1966) is an American actor, producer and director. He is probably best known for his roles as Caledon \"Cal\" Hockley in Titanic, The Phantom from The Phantom, John Wheeler in Twin Peaks and Mr. E in CQ.', '1966-02-24', NULL, 'Chicago, Illinois, USA', '2025-05-09 10:22:04', '2025-05-09 10:22:04'),
(706, 3006897, 'Cara Jade Myers', '/5oHV0iqIja1qmX5cKyQHWA0eVXB.jpg', 'A member of the Wichita tribe, Myers was born in Phoenix, Arizona. Influenced by the arts from a young age, her grandfather, Bobby Hill, was a well-known painter who worked under the name White Buffalo and her grandmother was an acclaimed beader whose work has been displayed in the Smithsonian. Myers was raised in Prescott Valley where she had an innate love for bringing characters to life, and in her early twenties began taking acting courses driving over four hours a day to class, which she now says prepared her for the traffic in L.A.\n\nIn 2011 she made the move to southern California, where she began to hone her craft in writing. She was accepted into the 4th Annual Native American Writers Lab, and that same year was a semi-finalist in the ABC/Disney writers program. In 2020 Myers was one of twelve writers selected as a part of A3 Artist Agency\'s The Colony program, creating a television pilot which is now in production. She finished the year as a Fellow of the Native American Feature Film Writers\' Lab. Recent credits for Myers include roles on NBC\'s award-winning series \"This Is Us,\" and \"Rutherford Falls.\"\n\nCurrent writing projects include two scripts that are in development, a documentary that is in production and one feature in preproduction. In addition to her work in film and television, Myers is passionate about helping others, and created CRASH Cares whose main focus is to create care packages for the homeless in Hollywood. She currently lives in Los Angeles with her husband Josh and their pup.', '1985-09-02', NULL, 'Phoenix, Arizona, USA', '2025-05-09 10:22:04', '2025-05-09 10:22:04'),
(707, 78110, 'Scott Adkins', '/9NRr2a1riIn5CWn5McZLJlk4vxR.jpg', 'An English actor and martial artist who is perhaps best known for playing Boyka in Undisputed II: Last Man Standing and Undisputed III: Redemption and Bradley Hume in Holby City and Ed Russell in Mile High. Adkins has also appeared in Dangerfield, Hollyoaks, The Tournament and many other TV series as well as many films.\n\nDescription above from the Wikipedia article Scott Adkins, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1976-06-17', NULL, 'Sutton Coldfield, Birmingham, England', '2025-05-09 10:22:05', '2025-05-09 10:22:05'),
(708, 85477, 'Trace Adkins', '/9MMbYFI0WL2rp5iQG9DeYL0Pgvl.jpg', 'Tracy Darrell \"Trace\" Adkins (born January 13, 1962) is an American country music artist. He made his debut in 1996 with the album Dreamin\' Out Loud, released on Capitol Records Nashville. Since then, Adkins has released seven more studio albums and two Greatest Hits compilations. In addition, he has charted more than twenty singles on the Billboard country music charts, including the Number One hits \"(This Ain\'t) No Thinkin\' Thing\", \"Ladies Love Country Boys\", and \"You\'re Gonna Miss This\", which peaked in 1997, 2007, and 2008, respectively. \"I Left Something Turned on at Home\" went to #1 on Canada\'s country chart. All but one of his studio albums have received gold or platinum certification in the United States; his highest-selling to date is 2005\'s Songs About Me, which has been certified 2× Multi-Platinum for shipping two million copies.\n\nHe has also made several appearances on television, including as a panelist on the game shows Hollywood Squares and Pyramid, as a finalist on The Celebrity Apprentice, as the voice for recurring character Elvin on King of the Hill, and in television commercial voice-overs for the KFC restaurant chain. In addition, Adkins has written an autobiography entitled A Personal Stand: Observations and Opinions from a Free-Thinking Roughneck, which was released in late 2007.\n\nDescription above from the Wikipedia article Trace Adkins, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1962-01-13', NULL, 'Springhill, Louisiana, USA', '2025-05-09 10:22:05', '2025-05-09 10:22:05'),
(709, 1391409, 'Yelawolf', '/wVFIuFCCmjWonGHrxvITnHmx9uF.jpg', 'Michael Wayne Atha (born December 30, 1979), better known as Yelawolf, is an American hip hop recording artist from Gadsden, Alabama. In his early years, Yelawolf released his first independent album Creek Water, which was released in 2005. During 2005 to 2010, he\'s been putting the releases of one extended play and four mixtapes. One extended play (EP), titled Trunk Muzik, amassed a strong attention that would follow the rapper\'s signing a record deal to Interscope Records, which re-released the mixtape as Trunk Muzik 0-60 later that year.', '1979-12-30', NULL, 'Gadsden, Alabama, USA ', '2025-05-09 10:22:06', '2025-05-09 10:22:06'),
(710, 4021370, 'Struggle Jennings', NULL, 'William Harness (born May 31, 1980), professionally known as Struggle Jennings, is an American rapper from Nashville, Tennessee.[1] He is the grandson of instrumental rock guitarist Duane Eddy and country musician Jessi Colter, the step-grandson of Waylon Jennings, and the nephew of Shooter Jennings, from whom Harness adopted his stage name. Jennings was one of the original members of Yelawolf\'s Slumerican label roster along with Bubba Sparxxx.\n\nFrom Wikipedia the free encyclopedia.', '1980-05-31', NULL, NULL, '2025-05-09 10:22:06', '2025-05-09 10:22:06'),
