(732, 587020, 'Theo James', '/lSC4cMhcQeCjPFkK6qCjSGDSeR3.jpg', 'Theodore Peter James Kinnaird Taptiklis (born 16 December 1984) is an English actor. He is known for portraying Tobias \"Four\" Eaton in The Divergent Series film trilogy. James starred in the horror films Underworld: Awakening (2012) and Underworld: Blood Wars (2016), the action film How It Ends (2018), and the science fiction film Archive (2020). In television, he appeared in the crime drama series Golden Boy (2012) and the romance series The Time Traveler\'s Wife (2022).\n\nDescription above from the Wikipedia article Theo James, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1984-12-16', NULL, 'High Wycombe, England, UK', '2025-05-09 10:22:15', '2025-05-09 10:22:15'),
(733, 61134, 'Tatiana Maslany', '/mVdss3kBhKiWYWFFcrdOSAAfwC0.jpg', 'Tatiana Gabriele Maslany (/mæsˈlæni/ mas-LAN-ee; born September 22, 1985) is a Canadian actress. She rose to prominence for playing multiple characters in the science-fiction thriller television series Orphan Black (2013–2017), which won her a Primetime Emmy Award (2016) and five Canadian Screen Awards (2014–2018). Maslany is the first Canadian to win an Emmy in a major dramatic category for acting in a Canadian series.\n\nMaslany also appeared in television series such as Heartland (2008–2010), The Nativity (2010), Being Erica (2009–2011), Perry Mason (2020), and She-Hulk: Attorney at Law (2022) in the lead role of Jennifer Walters / She-Hulk. Her other notable films include Diary of the Dead (2007), Eastern Promises (2007), The Vow (2012), Picture Day (2012), Cas and Dylan (2013), Woman in Gold (2015), Stronger (2017), and Destroyer (2018). For starring in the romantic drama The Other Half (2016), she won the Canadian Screen Award for Best Actress.\n\nDescription above from the Wikipedia article Tatiana Maslany, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1985-09-22', NULL, 'Regina, Saskatchewan, Canada', '2025-05-09 10:22:16', '2025-05-09 10:22:16'),
(734, 1721268, 'Christian Convery', '/c1l5tNjmxzDAIaTHvzEfooUsAf8.jpg', 'Christian Convery (born November 10, 2009) is a Canadian and American child actor. He is best known for his leading role as Gus in the Netflix series Sweet Tooth (2021–2024) and his performance in the comedy horror film Cocaine Bear (2023).\n\nDescription above from the Wikipedia article Christian Convery, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '2009-11-10', NULL, 'Los Angeles, California, USA', '2025-05-09 10:22:16', '2025-05-09 10:22:16'),
(735, 3257962, 'Colin O\'Brien', '/qF38oBiO1b7nEua71FY2XfIayZl.jpg', 'Colin O\'Brien (born October 15, 2010) is an American actor. He is best known for his role as Edward on the television series Dear Edward (2023). He also had roles in the films Mr. Harrigan\'s Phone (2022), Wonka (2023) and The Monkey (2025).', '2010-10-15', NULL, 'Houston, Texas, USA', '2025-05-09 10:22:16', '2025-05-09 10:22:16'),
(736, 36801, 'Adam Scott', '/b82C29R6fGiPoqIglQ4lzS6q2YX.jpg', 'Adam Scott (born April 3, 1973) is an American actor, producer, screenwriter, director and podcaster. He is best known for his roles as Ben Wyatt in the NBC comedy Parks and Recreation, Henry Pollard in the Starz comedy series Party Down, Palek in the HBO drama Tell Me You Love Me and Derek Huff in the 2008 film Step Brothers. He has appeared in the Adult Swim comedy Childrens Hospital. He was also on the show NTSF:SD:SUV::, and the annual Adult Swim special The Greatest Event in Television History, which he also created and produced. Scott is the co-host and co-creator of the Earwolf podcast U Talkin\' U2 To Me? with Scott Aukerman.', '1973-04-03', NULL, 'Santa Cruz, California, USA', '2025-05-09 10:22:17', '2025-05-09 10:22:17'),
(737, 109, 'Elijah Wood', '/7UKRbJBNG7mxBl2QQc5XsAh6F8B.jpg', 'Elijah Jordan Wood (born January 28, 1981) is an American actor and producer. He rose to international fame for his portrayal of Frodo Baggins in The Lord of the Rings film trilogy (2001–2003) and The Hobbit: An Unexpected Journey (2012).\n\nWood made his film debut with a small part in Back to the Future Part II (1989). He went on to achieve recognition as a child actor with multiple roles such as Avalon (1990) and The Good Son (1993). As a teenager, he starred in several films including North (1994), Flipper (1996), and The Ice Storm (1997). Following the success of The Lord of the Rings, Wood has appeared in a wide range of films, including Eternal Sunshine of the Spotless Mind (2004), Paris, je t\'aime (2006), and I Don\'t Feel at Home in This World Anymore (2017).\n\nWood\'s voice roles include Mumble in the Happy Feet film franchise (2006–2011), the title protagonist in 9 (2009), Spyro the Dragon in the Legend of Spyro video game trilogy (2006–2008), Beck on Disney XD\'s Tron: Uprising (2012–2013), Sigma in Season 10 of Red vs. Blue, and Wirt in the Cartoon Network miniseries Over the Garden Wall (2014). He played Ryan Newman on the FX dark comedy series Wilfred (2011–2014), for which he received a Satellite Award nomination for Best Actor, and Todd Brotzman in the BBC America series Dirk Gently\'s Holistic Detective Agency (2016–2017).\n\nWood founded the record label Simian Records in 2005, which was dissolved in 2015. He directed the 2007 music video \"Energy\" for The Apples in Stereo. In 2010, Wood co-founded a film production company for horror films, The Woodshed, renamed SpectreVision in 2013. Wood is a disc jockey, and has toured globally with his friend Zach Cowie as the duo Wooden Wisdom.\n\nDescription above from the Wikipedia article Elijah Wood, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1981-01-28', NULL, 'Cedar Rapids, Iowa, USA', '2025-05-09 10:22:17', '2025-05-09 10:22:17'),
(738, 1196041, 'Rohan Campbell', '/52LIlmT5Pv7sqhlKBRHCkBkl1qT.jpg', 'Rohan Campbell (born September 23, 1997) is a Canadian actor. He is known for starring as Frank Hardy in the 2020s television series adaptation The Hardy Boys, opposite Alexander Elliot as Joe and Corey Cunningham in the 2022 slasher film Halloween Ends.\n\nCampbell was born in Calgary, Alberta, and raised in Cochrane. His parents are English immigrants. He has also appeared in the television productions Mayerthorpe and Klondike, and on the series Mech-X4, The 100, and iZombie. He moved to Vancouver at seventeen.', '1997-09-23', NULL, 'Calgary, Alberta, Canada', '2025-05-09 10:22:17', '2025-05-09 10:22:17'),
(739, 1392149, 'Sarah Levy', '/l37vAd4fkzv9EH8r9eChuzrSPxu.jpg', 'Sarah Levy (born September 10, 1987) is a Canadian actress, best known for her role in Schitt\'s Creek as Twyla Sands. She is Eugene Levy\'s daughter.', '1987-09-10', NULL, 'Toronto, Ontario, Canada', '2025-05-09 10:22:18', '2025-05-09 10:22:18'),
(740, 90609, 'Osgood Perkins', '/sshAqrQ2DV2TUsgBAr1XaYqqxkm.jpg', 'Osgood Robert \"Oz\" Perkins II (born February 2, 1974) is an American filmmaker and actor. He began his career as a child actor, portraying the young version of his father, Anthony Perkins\' character Norman Bates in Psycho II (1983), and later appeared in films such as Six Degrees of Separation (1993), Legally Blonde (2001), Not Another Teen Movie (2001), Star Trek (2009), and Nope (2022). \n\nHe made his directorial debut with the horror film The Blackcoat\'s Daughter (2015) and has since become known for directing horror films such as I Am the Pretty Thing That Lives in the House (2016), Gretel & Hansel (2020), Longlegs (2024), and The Monkey (2025).', '1974-02-02', NULL, 'New York City, New York, USA', '2025-05-09 10:22:18', '2025-05-09 10:22:18'),
