(752, 64915, 'Janet Kidder', '/vQaIlXJkAa2H5TOL3MZtAqD6Yks.jpg', 'From Wikipedia, the free encyclopedia\n\nJanet Kidder (born 1972) is a Canadian actress.\n\nJanet Kidder is the niece of actress Margot Kidder, who played Lois Lane in the Superman movies. They both appeared in Walk on By, an episode of La Femme Nikita, as the younger and older Roberta, Nikita\'s mother. Janet\'s participation was in brief flashback sequences.', '1972-01-01', NULL, 'Cranbrook, British Columbia, USA', '2025-05-09 10:22:22', '2025-05-09 10:22:22'),
