(766, 60073, 'Brie Larson', '/xSGvMwNNJcEQvVcjiIUTyxyMfkZ.jpg', 'Brianne Sidonie Desaulniers (born October 1, 1989), known professionally as Brie Larson, is an American actress. As a teenager, she played supporting roles in comedies and has since expanded to leading roles in independent films and blockbusters. Her accolades include an Academy Award, a Golden Globe Award, and a Primetime Emmy Award. Time magazine named her one of the 100 most influential people in the world in 2019.\n\nAt age six, Larson was the youngest student admitted to a training program at the American Conservatory Theater, and she began her acting career in 1998 with a comedy sketch on The Tonight Show with Jay Leno. She appeared as a regular in the 2001 sitcom Raising Dad. Briefly, she dabbled with a music career, releasing the album Finally Out of P.E. in 2005. She subsequently had supporting roles in the comedy films Hoot (2006), Scott Pilgrim vs. the World (2010), and 21 Jump Street (2012), and appeared as a sardonic teenager in the television series United States of Tara (2009–2011).\n\nHer breakthrough came with a leading role in the independent drama Short Term 12 (2013). She continued to take on supporting parts in the romance The Spectacular Now (2013) and the comedy Trainwreck (2015). For playing a kidnapping victim in the drama Room (2015), she won the Academy Award for Best Actress. The 2017 adventure film Kong: Skull Island marked her first big-budget release, after which she starred as Captain Marvel in the Marvel Cinematic Universe, beginning with Captain Marvel (2019). Larson has since starred in the miniseries Lessons in Chemistry (2023), for which she was nominated for a Primetime Emmy Award for Outstanding Lead Actress.\n\nLarson has co-written and co-directed two short films and made her feature film directorial debut with the independent comedy-drama Unicorn Store (2017). For producing the virtual reality series The Messy Truth VR Experience (2020), she won a Primetime Emmy Award for Outstanding Interactive Program. A gender equality activist and an advocate for sexual assault survivors, Larson is vocal about social and political issues.\n\nDescription above from the Wikipedia article Brie Larson, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1989-10-01', NULL, 'Sacramento, California, USA', '2025-05-09 10:22:29', '2025-05-09 10:22:29'),
(767, 2231, 'Samuel L. Jackson', '/AiAYAqwpM5xmiFrAIeQvUXDCVvo.jpg', 'Samuel Leroy Jackson (born December 21, 1948) is an American actor and producer. One of the most widely recognized actors of his generation, the films in which he has appeared have collectively grossed over $27 billion worldwide, making him the second highest-grossing actor of all time. The Academy of Motion Picture Arts and Sciences gave him an Academy Honorary Award in 2022 as \"A cultural icon whose dynamic work has resonated across genres and generations and audiences worldwide\".\n\nJackson started his career on stage making his professional theatre debut in Mother Courage and her Children in 1980 at The Public Theatre. From 1981 to 1983 he originated the role of Private Louis Henderson in A Soldier\'s Play Off-Broadway. He also originated the role of Boy Willie in August Wilson\'s The Piano Lesson in 1987 at the Yale Repertory Theatre. He returned to the play in the 2022 Broadway revival playing Doaker Charles. Jackson early film roles include Coming to America (1988), Goodfellas (1990), Patriot Games (1992), Juice (1992), True Romance (1993), and Jurassic Park (1993), Menace II Society (1993), and Fresh (1994). His collaborations with Spike Lee led to greater prominence with films such as School Daze (1988), Do the Right Thing (1989), Mo\' Better Blues (1990), Jungle Fever (1991), Oldboy (2013), and Chi-Raq (2015).\n\nJackson\'s breakout role was in Quentin Tarantino\'s Pulp Fiction (1994) which earned him a BAFTA Award win and a nomination for the Academy Award for Best Supporting Actor. He further collaborated with Tarantino, acting in Jackie Brown (1997), Django Unchained (2012), and The Hateful Eight (2015). He\'s known for having appeared in a number of big-budget films, including Die Hard with a Vengeance (1995), A Time to Kill (1996), The Long Kiss Goodnight (1996), The Negotiator (1997), Deep Blue Sea (1999), Unbreakable (2000), Shaft (2000) and its reboot (2019), XXX (2002), S.W.A.T. (2003), Coach Carter (2005), Snakes on a Plane (2006), Kingsman: The Secret Service (2014), Kong: Skull Island (2017), and Glass (2019).\n\nHe also gained widespread recognition as the Jedi Mace Windu in the Star Wars prequel trilogy (1999–2005), later voicing the role in the animated film Star Wars: The Clone Wars (2008) and the video game Lego Star Wars: The Clone Wars (2011). With his permission, his likeness was used for the Ultimate version of the Marvel Comics character Nick Fury; he subsequently played Fury in 11 Marvel Cinematic Universe films, beginning with a cameo appearance in Iron Man (2008), as well as guest-starring in the television series Agents of S.H.I.E.L.D. He will reprise this role in the upcoming Disney+ series Secret Invasion, which is set to premiere on June 21, 2023. Jackson has provided his voice for several animated films, documentaries, television series, and video games, including Lucius Best / Frozone in the Pixar films The Incredibles (2004) and Incredibles 2 (2018).', '1948-12-21', NULL, 'Washington, D.C., USA', '2025-05-09 10:22:29', '2025-05-09 10:22:29'),
(768, 77335, 'Ben Mendelsohn', '/uRB2ufOpCNun8G1LPsZJPnfhavb.jpg', 'Paul Benjamin Mendelsohn (born 3 April 1969) is an Australian actor. He first rose to prominence in Australia for his break-out role in The Year My Voice Broke (1987). He gained international attention for his starring role in the crime drama Animal Kingdom (2010). He has since had roles in films such as The Dark Knight Rises (2012), Starred Up (2013), Lost River (2014), Mississippi Grind (2015), Rogue One (2016), Darkest Hour (2017), and Ready Player One (2018).\n\nMendelsohn starred in the Netflix drama series Bloodline (2015–2017), for which he won the Primetime Emmy Award for Outstanding Supporting Actor in a Drama Series in 2016. He played the Sheriff of Nottingham in Robin Hood (2018). He joined the Marvel Cinematic Universe as Talos in the superhero film Captain Marvel (2019) and the Disney+ series Secret Invasion (2023). He has also starred in the HBO crime miniseries The Outsider (2020). In 2024, he began portraying fashion designer Christian Diorin the television series The New Look.\n\nDescription above from the Wikipedia article Ben Mendelsohn, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1969-04-03', NULL, 'Melbourne, Victoria, Australia', '2025-05-09 10:22:30', '2025-05-09 10:22:30'),
(769, 9642, 'Jude Law', '/9H577IoqFgCXonDzR3QEkF2xo5m.jpg', 'David Jude Heyworth Law (born December 29, 1972) is an English actor. He has received multiple awards including a BAFTA Film Award as well as nominations for two Academy Awards and two Tony Awards. In 2007, he received an Honorary César and was named a knight of the Order of Arts and Letters by the French government.\n\nBorn and raised in London, Law started acting in theatre. After finding small roles in feature films, Law gained recognition for his role in Anthony Minghella\'s The Talented Mr. Ripley (1999), for which he won the BAFTA Award for Best Actor in a Supporting Role and was nominated for an Academy Award. He found further critical and commercial success in Enemy at the Gates (2001), Steven Spielberg\'s A.I. Artificial Intelligence (2001) and Sam Mendes\' Road to Perdition (2002). He continued to gain praise for starring in the war film Cold Mountain (2003), the drama Closer (2004), and the romantic comedy The Holiday (2006), gaining Academy Award and BAFTA nominations for the first of these.\n\nLaw played Dr. Watson in Sherlock Holmes (2009) and Sherlock Holmes: A Game of Shadows (2011), a younger Albus Dumbledore in Fantastic Beasts: The Crimes of Grindelwald (2018), and Yon-Rogg in Captain Marvel (2019); all of which rank among his highest-grossing releases. His other notable roles were in Contagion (2011), Hugo (2011), Side Effects (2013), The Grand Budapest Hotel (2014), and Spy (2015); and the television series The Young Pope (2016) and The New Pope (2020).\n\nLaw has also had an accomplished career on stage, performing in several West End and Broadway productions such as Les Parents terribles in 1994, Hamlet in 2010, and Anna Christie in 2011. He received Tony Award nominations for the first and second of these.\n\nLaw\'s Riff Raff Entertainment, founded with business partner Ben Jackson, inked a first-look deal for both feature films and television production with New Republic Pictures on April 13, 2021.', '1972-12-29', NULL, 'Lewisham, London, England, UK', '2025-05-09 10:22:30', '2025-05-09 10:22:30'),
(770, 516, 'Annette Bening', '/sBiiRwAVXd0FCRZ87m0I89qGBvy.jpg', 'Annette Carol Bening (born May 29, 1958) is an American actress. In a career spanning more than four decades, she has received many accolades, including a BAFTA Award and two Golden Globes as well as nominations for a Primetime Emmy Award, two Tony Awards, and five Academy Awards.\n\nBening began her career on stage with the Colorado Shakespeare Festival company in 1980, and played Lady Macbeth in 1984 at the American Conservatory Theater. She made her Broadway debut in the Tina Howe play Coastal Disturbances (1987) for which she received a nomination for the Tony Award for Best Featured Actress in a Play. She played the title role in a Geffen Playhouse production of Hedda Gabler (1999). She returned to Broadway in the revival of Arthur Miller\'s All My Sons (2019) earning another Tony nomination for Best Actress in a Play.\n\nBening won the BAFTA Award for Best Actress in a Leading Role for playing a materialistic wife in American Beauty (1999), and received nominations for five Academy Awards for her roles in The Grifters (1990), American Beauty, Being Julia (2004), The Kids Are All Right (2010), and Nyad (2023). She was nominated for a Primetime Emmy Award for playing the title role in the television film Mrs. Harris (2005). Her other notable films include Postcards from the Edge (1990), Bugsy (1991), Richard III (1995), The American President (1995), 20th Century Women (2016), Film Stars Don\'t Die in Liverpool (2017), The Seagull (2018), The Report (2019), Captain Marvel (2019), and Death on the Nile (2022).\n\nDescription above from the Wikipedia article Annette Bening, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1958-05-29', NULL, 'Topeka, Kansas, USA', '2025-05-09 10:22:31', '2025-05-09 10:22:31'),
(771, 938, 'Djimon Hounsou', '/tpvtxxvCx2Mb5DV632hmuYlHoiY.jpg', 'Djimon Gaston Hounsou (born April 24, 1964) is a Beninese-American actor and model. He began his career appearing in music videos, made his film debut in Without You I\'m Nothing and earned widespread recognition for his role as Cinqué in the Steven Spielberg film Amistad. As an actor, Hounsou has been nominated for two Academy Awards.\n\nHounsou became a naturalized American citizen in 2007. He was reluctant to renounce his Beninese citizenship and therefore opted to become a dual citizen of both Benin and the United States, effectively rendering him a Beninese-American.\n\nDjimon Hounsou was born in Cotonou, Benin, in 1964, to lbertine and Pierre Hounsou. He immigrated to Lyon in France at the age of thirteen with his brother, Edmond. In 1987, he became a model and established a career in Paris. He moved to the U.S. in 1990. One year before obtaining his college degree, he dropped out of school.\n\nIn 1989, he appeared in a music video of Straight Up by Paula Abdul. Hounsou\'s film debut was in the 1990 Sandra Bernhard film Without You I’m Nothing, and he has had television roles on Beverly Hills, 90210 and ER and a guest starring role on Alias, but received a larger role in the science fiction film Stargate. His first on-screen appearance was in the 1990 Janet Jackson video “Love Will Never Do (Without You).” He also starred in a 2002 Gap commercial directed by Peter Lindbergh, dancing to a rendition of John Lee Hooker\'s \"Boom Boom\" by Arrested Development\'s Baba Oje.\n\nHe received wide critical acclaim and a Golden Globe Award nomination for his role as Cinqué in the 1997 Steven Spielberg film Amistad. He gained further notice as Juba, in the 2000 film Gladiator. He was nominated for the Academy Award for Best Supporting Actor, for In America, in 2004, becoming the fourth African male to be nominated for an Oscar (along with Basil Rathbone, Cecil Kellaway and Omar Sharif). In 2006, he won the National Board of Review Award for Best Supporting Actor for his performance in Blood Diamond; he received Broadcast Film Critics Association, Screen Actors Guild Award, and Academy Award nominations for this performance.\n\nIn 2007, Hounsou began dating model/CEO of Baby Phat, Kimora Lee Simmons. In 2008 Hounsou and Simmons visited Hounsou\'s family and while there, the two participated in a traditional commitment ceremony. On May 30, 2009, Simmons gave birth to their son, Kenzo Lee Hounsou, reportedly named because Kenzo means 3 (Kimora\'s third child).', '1964-04-24', NULL, 'Cotonou, Dahomey [now Benin]', '2025-05-09 10:22:31', '2025-05-09 10:22:31'),
(772, 72095, 'Lee Pace', '/eeTc0d2AX1vFYVxZ6Qw7qZpg4Tz.jpg', 'Lee Grinner Pace (born March 25, 1979) is an American actor.\n\nPace has been featured in film, stage and television. He currently stars as protagonist Joe MacMillan in AMC\'s Halt and Catch Fire. He also played Roy Walker/the Masked Bandit in the 2006 film The Fall. He has appeared in film series, including The Twilight Saga: Breaking Dawn – Part 2 as Garrett and The Hobbit trilogy as Thranduil. He played villain Ronan the Accuser in the film Guardians of the Galaxy, and starred as Ned in the ABC series Pushing Daisies for which he was nominated for the Golden Globe Award and Primetime Emmy Award for Outstanding Lead Actor in a Comedy Series in 2008. Most recently, he played Greg in the A24 horror film Bodies Bodies Bodies (2022).\n\nDescription above from the Wikipedia Lee Pace licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1979-03-25', NULL, 'Chickasha, Oklahoma, USA', '2025-05-09 10:22:32', '2025-05-09 10:22:32'),
(773, 1360281, 'Lashana Lynch', '/ypNxRag9uJ5nzPAN2um3amQK340.jpg', 'Lashana Lynch (born 27 November 1987) is a British actor. She first gained recognition for her role as Rosaline Capulet in the ABC period drama series Still Star-Crossed (2017) going on to win the BAFTA Rising Star Award in 2022. She portrayed Maria Rambeau in the Marvel Cinematic Universe beginning with Captain Marvel (2019). She has since had roles in the James Bond film No Time to Die (2021), Matilda the Musical (2022), The Woman King (2022), and Bob Marley: One Love (2024), as well as the television series Day of the Jackal (2024).\n\nDescription above from the Wikipedia article Lashana Lynch, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1987-11-27', NULL, 'London, England, UK', '2025-05-09 10:22:32', '2025-05-09 10:22:32'),
(774, 97576, 'Gemma Chan', '/lm2FKwj2zO8ZsqMNFHm4KMtlNlM.jpg', 'Gemma Chan (born 29 November 1982) is an English actress. A  Worcester College, Oxford graduate, Chan began acting in the late 2000s, making her film debut in 2009. She rose to attention with her leading role in the Channel 4 science fiction series Humans (2015–2018). She gained prominence with her starring roles in Crazy Rich Asians and as Elizabeth Hardwick in Mary Queen of Scots (both 2018). \n\nShe next starred in the Marvel Cinematic Universe films Captain Marvel (2019) and Eternals (2021), portraying Minn-Erva and Sersi, respectively. She also had a voice role in the Disney animated film Raya and the Last Dragon (2021). She appeared in Olivia Wilde\'s psychological thriller Don\'t Worry Darling (2022) and Gareth Edwards\' science fiction film The Creator (2023). Offscreen, Chan has been labelled a fashion icon.\n\nDescription above from the Wikipedia article Gemma Chan, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1982-11-29', NULL, 'London, England, UK', '2025-05-09 10:22:33', '2025-05-09 10:22:33'),
(775, 9048, 'Clark Gregg', '/zwyhwrxgpiufSPpjC9dxCy5kAB0.jpg', 'Robert Clark Gregg Jr. (born April 2, 1962) is an American actor, director, and screenwriter. He is best known for portraying Phil Coulson in films and television series set in the Marvel Cinematic Universe from 2008 to 2021. Gregg also voiced Coulson in the animated television series Ultimate Spider-Man (2012–2017) and the video games Lego Marvel Super Heroes (2013), Marvel Heroes (2013), and Lego Marvel\'s Avengers (2016).\n\nGregg is also known for his role as FBI Special Agent Mike Casper on the NBC political drama series The West Wing (2001–2004) and as Richard, the ex-husband of Christine Campbell, in the CBS sitcom The New Adventures of Old Christine (2006–2010).\n\nHe wrote the horror film What Lies Beneath (2000) and wrote and directed the black comedy Choke (2008) and the comedy-drama Trust Me (2013). He appeared in the films The Adventures of Sebastian Cole (1998), One Hour Photo (2002), We Were Soldiers (2002), In Good Company (2004), When a Stranger Calls (2006), 500 Days of Summer (2009), Much Ado About Nothing (2012), The To Do List (2013), Labour Day (2013), Live by Night (2016), and Being the Ricardos (2021).\n\nDescription above from the Wikipedia article Clark Gregg, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1962-04-02', NULL, 'Boston, Massachusetts, USA', '2025-05-09 10:22:33', '2025-05-09 10:22:33'),
(776, 76618, 'Rune Temte', '/uTP4vXJzckoeIlFXnucVzr7ghCx.jpg', 'Rune Temte is a Norwegian actor and former football player.', '1965-09-29', NULL, 'Solbergelva, Nedre Eiker, Norway', '2025-05-09 10:22:33', '2025-05-09 10:22:33'),
(777, 86381, 'Algenis Perez Soto', '/pUCNFbXpXuEelbrbiOo52vG3daa.jpg', 'Algenis Perez Soto is a Dominican actor. He is best known for his title role in the film Sugar (2008) and his portrayal of Att-Lass in the film Captain Marvel (2019).\n\nDescription above from the Wikipedia article Algenis Perez Soto, licensed under CC-BY-SA, full list of contributors on Wikipedia.', NULL, NULL, 'Quisqueya, Dominican Republic', '2025-05-09 10:22:34', '2025-05-09 10:22:34'),
(778, 1172108, 'Mckenna Grace', '/s0SJ0Yce1H3C7kI9DvGxmmQq3cg.jpg', 'Mckenna Grace (born June 25, 2006) is an American actress and singer. Born in Grapevine, Texas, she began acting professionally at age five and relocated to Los Angeles, California, as a child. Her earliest roles included Jasmine Bernstein in the Disney XD sitcom Crash & Bernstein (2012–2014) and Faith Newman in the soap opera The Young and the Restless (2013–2015). After several minor roles, she starred as a child prodigy in Gifted (2017), a breakthrough for which she received the Critics\' Choice Movie Award for Best Young Performer.\n\nGrace subsequently appeared in the films I, Tonya (2017), Troop Zero (2019), and Captain Marvel (2019). During this time, she appeared in several horror projects, including The Bad Seed(2018), The Haunting of Hill House (2018), and Annabelle Comes Home (2019). For playing the abused teenager Esther Keyes in The Handmaid\'s Tale (2021–2022), Grace was nominated for the Primetime Emmy Award for Outstanding Guest Actress in a Drama Series, making her the first child recognized for a guest acting Emmy. She appeared in the supernatural comedy films Ghostbusters: Afterlife (2021) and Ghostbusters: Frozen Empire (2024) as Phoebe Spengler, receiving critical praise and a Critics\' Choice Super Award nomination. In 2022, Grace wrote, executive produced, starred in The Bad Seed Returns and portrayed Jan Broberg in A Friend of the Family.\n\nAfter signing with Photo Finish Records in 2020, Grace released her debut single, \"Haunted House\", in 2021 as part of the Ghostbusters: Afterlife soundtrack. She released two extended plays in 2023: Bittersweet 16 and Autumn Leaves, which explored pop rock and folk sounds, respectively.\n\nDescription above from the Wikipedia article Mckenna Grace, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '2006-06-25', NULL, 'Grapevine, Texas, USA', '2025-05-09 10:22:34', '2025-05-09 10:22:34'),
(779, 2258733, 'Akira Akbar', '/4h4MsWOx5hFysgycsKfOn1z6DBJ.jpg', 'Akira Akbar is a actress, dancer, and model, known for NBC\'s This Is Us (2019) and Captain Marvel (2019).', '2006-10-02', NULL, NULL, '2025-05-09 10:22:34', '2025-05-09 10:22:34'),
