(782, 6623, 'Vik Sahay', '/690bPfmzaXsrZ1eDcUOCDT5TPpq.jpg', 'Vikram \"Vik\" Sahay is a Canadian actor best known for playing Lester Patel, a member of the Nerd Herd in the NBC television series Chuck on which he became a series regular from the second season, and Rama in the Roxy Hunter Saga.', '1971-07-03', NULL, 'Ottawa, Ontario, Canada', '2025-05-09 10:22:35', '2025-05-09 10:22:35'),
(783, 74539, 'Colin Ford', '/yTnewMLRahvIWHHieoi4bV5GqYU.jpg', 'Colin Ford (born September 12, 1996) is an American actor. He is known for his roles as Josh Wheeler in Daybreak, Joe McAlister in Under the Dome, the voice of Jake on Jake and the Never Land Pirates, Mikey on Can You Teach My Alligator Manners?, which earned him a Young Artist Award, young Sam Winchester in Supernatural and Dylan Mee in the family film We Bought a Zoo.', '1996-09-12', NULL, 'Nashville, Tennessee, USA', '2025-05-09 10:22:36', '2025-05-09 10:22:36'),
(784, 28868, 'Kenneth Mitchell', '/8p9WeJZk3acU6QEBgJHgMKrr5kQ.jpg', 'Kenneth Mitchell (November 25, 1974 – February 24, 2024) was a Canadian actor, best known for playing several Klingon characters in Star Trek: Discovery. He also had a role on the television series Jericho, starred in the 2004 sports biopic Miracle, and played Captain Marvel’s father in the 2019 film.\n\nMitchell was married to actress Susan May Pratt and had two children.\n\nMitchell died at the age of 49 from complications with amyotrophic lateral sclerosis (ALS).', '1974-11-25', '2024-02-24', 'Toronto, Ontario, Canada', '2025-05-09 10:22:36', '2025-05-09 10:22:36'),
(785, 1514930, 'Stephen A. Chang', '/gZxyFXDPDrZBAHqBXyujoYaW6Hn.jpg', 'Stephen Change is an American actor, who was born in California and grew up in the Bay Area. He is best known as Maurice \"Mo\" Bassi in Bosch: Legacy,  Jesse (voice) in the video game \"The Last of Us: Part II\", and Sebastian Wu in the Twitch series \"Artificial\" (2019).', '1985-03-23', NULL, 'California, U.S.', '2025-05-09 10:22:37', '2025-05-09 10:22:37'),
(786, 1163622, 'Pete Ploszek', '/9ZFxQLUQzfMNEHVqYjwK346vaCK.jpg', 'Pete Ploszek is an American actor. He was born in Hinsdale, Illinois but grew up across New Jersey, Maine, and Ohio before settling in St. Charles, Illinois. He played football at Princeton University and earned an MFA in Acting at USC (\'12). He currently resides in Los Angeles with his wife.  - IMDb Mini Biography', '1987-01-20', NULL, 'Hinsdale - Illinois - USA', '2025-05-09 10:22:37', '2025-05-09 10:22:37'),
