(797, 7624, 'Stan Lee', '/kKeyWoFtTqOPsbmwylNHmuB3En9.jpg', 'Stan Lee (born Stanley Martin Lieber /ˈliːbər/; December 28, 1922–November 12, 2018) was an American comic book writer, editor, publisher, and producer. He rose through the ranks of a family-run business called Timely Comics, which later became Marvel Comics. He was Marvel\'s primary creative leader for two decades, expanding it from a small publishing house division to a multimedia corporation that dominated the comics and film industries.\n\nIn collaboration with others at Marvel—particularly co-writers and artists Jack Kirby and Steve Ditko—he co-created iconic characters, including Spider-Man, the X-Men, Iron Man, Thor, the Hulk, Ant-Man, the Wasp, the Fantastic Four, Black Panther, Daredevil, Doctor Strange, the Scarlet Witch, and Black Widow. These and other characters\' introductions in the 1960s pioneered a more naturalistic approach in superhero comics. In the 1970s, Lee challenged the restrictions of the Comics Code Authority, indirectly leading to changes in its policies. In the 1980s, he pursued the development of Marvel properties in other media, with mixed results.\n\nFollowing his retirement from Marvel in the 1990s, Lee remained a public figurehead for the company. He frequently made cameo appearances in films and television shows based on Marvel properties, on which he received an executive producer credit, which allowed him to become the person with the highest-grossing film total ever. He continued independent creative ventures until his death, aged 95, in 2018. Lee was inducted into the comic book industry\'s Will Eisner Award Hall of Fame in 1994 and the Jack Kirby Hall of Fame in 1995. He received the NEA\'s National Medal of Arts in 2008.\n\nDescription above from the Wikipedia article Stan Lee, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1922-12-28', '2018-11-12', 'New York City, New York, USA', '2025-05-09 10:22:41', '2025-05-09 10:22:41'),
(798, 1038379, 'Robert Kazinsky', '/u9MCG0KgTyCgpiV5qmMr5gIvglU.jpg', 'Robert John Appleby (born November 11, 1983) , known professionally as Robert Kazinsky, is an English actor. He is known for his roles as Casper Rose in the Sky One drama Dream Team, the Don in Captain Marvel, Sean Slater in the BBC soap opera EastEnders, Chuck Hansen in Pacific Rim, and Macklyn Warlow in the sixth season of HBO\'s True Blood. In 2016, he played Orgrim Doomhammer in Warcraft and Jimmy Pritchard in the Fox television series Second Chance.', '1983-11-18', NULL, 'Haywards Heath, Sussex, England, UK', '2025-05-09 10:22:41', '2025-05-09 10:22:41'),
(799, 88928, 'Nelson Franklin', '/2YYnTxpFmS5i9qRkb6H4Nxky2px.jpg', 'Franklin was born to father Howard Franklin, a screenwriter and director. His stepmother is DJ Anne Litt. Franklin attended high school at Campbell Hall School in Studio City, California. He graduated from New York University Tisch School of the Arts.\n\nFranklin\'s first major role was a recurring role as Nick, the I.T. worker on NBC\'s The Office. Franklin later went on to appear as a series regular on the short-lived FOX comedy series Traffic Light. He appears with another Office actor, David Denman, who played Pam\'s ex-fiancée Roy. His side projects include a short for Funny or Die: a fake commercial promoting the Dudes-N-Bros Talking Points System, which is a service that helps guys who aren\'t dudes or bros hold a conversation with dudes and bros. He co-starred on the CBS sitcom The Millers and appeared on FOX sitcom New Girl, the HBO political comedy Veep, Black-ish, and Abby\'s.', '1985-07-02', NULL, NULL, '2025-05-09 10:22:42', '2025-05-09 10:22:42'),
