(811, 16828, 'Chris Evans', '/3bOGNsHlrswhyW79uvIHH1V43JI.jpg', 'Christopher Robert Evans (born June 13, 1981) is an American actor. He began his career with roles in television series, such as in Opposite Sex in 2000. Following appearances in several teen films including 2001\'s Not Another Teen Movie, he gained attention for his portrayal of Marvel Comics character the Human Torch in 2005\'s Fantastic Four, and its sequel Fantastic Four: Rise of the Silver Surfer (2007). Evans made further appearances in film adaptations of comic books and graphic novels: TMNT (2007), Scott Pilgrim vs. the World (2010), and Snowpiercer (2013).\n\nHe gained wider recognition for his portrayal of Steve Rogers / Captain America in several Marvel Cinematic Universe films, namely Captain America: The First Avenger (2011), Captain America: The Winter Soldier (2014), and Captain America: Civil War (2016), and the ensemble films The Avengers (2012), Avengers: Age of Ultron (2015), Avengers: Infinity War (2018), and Avengers: Endgame (2019). His work on the Marvel series established him as one of the world\'s highest-paid actors.\n\nAside from comic book roles, Evans starred in the drama Gifted (2017), the mystery film Knives Out (2019), and the television miniseries Defending Jacob (2020). He made his directorial debut in 2014 with the romantic drama Before We Go, which he also produced and starred in. Evans made his Broadway debut in the 2018 revival of Kenneth Lonergan\'s play Lobby Hero, which earned him a Drama League Award nomination.\n\nDescription above from the Wikipedia article Chris Evans (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1981-06-13', NULL, 'Boston, Massachusetts, USA', '2025-05-09 10:22:46', '2025-05-09 10:22:46'),
(812, 1896, 'Don Cheadle', '/oZ1u1GmudvUGpbMfi9Hxonzp3lF.jpg', 'Donald Frank Cheadle Jr. (/ˈtʃiːdəl/, CHEE-dəl; born November 29, 1964) is an American actor. Known for his roles in film and television, he has received multiple accolades, including two Golden Globe Awards, two Grammy Awards, and a Tony Award, as well as nominations for an Academy Award, two BAFTA Awards, and 11 Primetime Emmy Awards. He is among a few actors who have received nominations for the EGOT.\n\nCheadle\'s career started with supporting roles in Hamburger Hill (1987), Colors (1988), Devil in a Blue Dress (1995), Rosewood (1997), Boogie Nights (1997), and Bulworth (1998). He collaborated with director Steven Soderberghacting in Out of Sight (1998), Traffic (2000), The Ocean\'s Trilogy (2001–2007), and No Sudden Move (2021). Cheadle was nominated for an Academy Award for Best Actor for portraying Paul Rusesabagina in the historical drama film Hotel Rwanda (2004). He was the co-producer of Crash, which won the Academy Award for Best Picture in 2005. Cheadle joined the Marvel Cinematic Universe portraying James \"Rhodey\" Rhodes / War Machine, beginning with Iron Man 2 (2010).\n\nOn television, Cheadle earned nominations for the Primetime Emmy Award for Outstanding Lead Actor in a Comedy Series for his roles as Marty Kaan in House of Lies (2012–2016) and Maurice Monroe in Black Monday (2019–2021). He was further Emmy-nominated for The Rat Pack (1998), A Lesson Before Dying (1999), Things Behind the Sun (2001), ER (2002), and The Falcon and the Winter Soldier (2021).\n\nIn 2016, he received his first Grammy Award, winning Best Compilation Soundtrack for Visual Media for Miles Ahead\'s soundtrack. In 2022, he received a second Grammy for Best Spoken Word Album for his narration of the audiobook Carry On: Reflections for a New Generation from John Lewis; he also received a Tony Award for Best Musical as a producer for the musical A Strange Loop.\n\nDescription above from the Wikipedia article Don Cheadle, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1964-11-29', NULL, 'Kansas City, Missouri, USA ', '2025-05-09 10:22:47', '2025-05-09 10:22:47'),
(813, 103, 'Mark Ruffalo', '/5GilHMOt5PAQh6rlUKZzGmaKEI7.jpg', 'Mark Alan Ruffalo (/ˈrʌfəloʊ/; born November 22, 1967) is an American actor. He began acting in the late 1980s and gained recognition for his work in Kenneth Lonergan\'s play This Is Our Youth (1996) and the drama film You Can Count on Me (2000). He went on to star in the romantic comedies 13 Going on 30 (2004) and Just like Heaven (2005) and the thrillers In the Cut (2003), Zodiac (2007), and Shutter Island (2010). He received a Tony Award nomination for his supporting role in the Broadway revival of Awake and Sing! in 2006. Ruffalo has gained international recognition for playing Bruce Banner / The Hulk since 2012 in the Marvel Cinematic Universe superhero franchise.\n\nRuffalo earned a record-tying four nominations for the Academy Award for Best Supporting Actor for playing a sperm donor in the comedy-drama The Kids Are All Right (2010), Dave Schultz in the biopic Foxcatcher (2014), Michael Rezendes in the drama Spotlight (2015), and a debauched lawyer in the comic fantasy Poor Things (2023). He won a Screen Actors Guild Award for Best Actor for playing a gay activist in the television drama film The Normal Heart (2015) and a Primetime Emmy Award for Outstanding Lead Actor for his dual role as identical twins in the miniseries I Know This Much Is True (2020).\n\nDescription above from the Wikipedia article Mark Ruffalo, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1967-11-22', NULL, 'Kenosha, Wisconsin, USA', '2025-05-09 10:22:47', '2025-05-09 10:22:47'),
(814, 2518232, 'Kelly Sue DeConnick', '/q9VLVEVCRVLyoMqJZL2UJip2228.jpg', 'Kelly Sue DeConnick is an American comic book writer,  editor and English–language adapter of manga. She is known for writing many of the modern day Captain Marvel comic books the Captain Marvel film series is based on.\n\nDescription above from the Wikipedia article Kelly Sue DeConnick, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1970-07-15', NULL, 'Columbus, Ohio, USA', '2025-05-09 10:22:47', '2025-05-09 10:22:47'),
