(817, 202930, 'Anthony Molinari', '/8Gl1b5Y7QLrdv5vvOwAmJk29joM.jpg', 'Anthony Molinari (born May 9, 1974) is an American actor, stunt performer and stunt coordinator. He played Neary in The Fighter. Three-time Screen Actors Guild Award nominee.\n\nFrom Wikipedia, the free encyclopedia.', '1974-05-09', NULL, 'Worcester, Massachusetts, United States', '2025-05-09 10:22:48', '2025-05-09 10:22:48'),
(818, 34502, 'Kellan Lutz', '/pLzdFABlU6oS2BvlHlAN990woY1.jpg', 'Kellan Christopher Lutz (born March 15, 1985) is an American fashion model, and film and television actor, who is best known for playing Emmett Cullen in the Twilight series.\n\nHe made his film debut in Stick It (2006). He has since played Poseidon in the 2011 film Immortals, voiced the title character in the 2013 animated film Tarzan, played John Smilee in The Expendables 3 (2014), and Hercules in The Legend of Hercules (2014). He co-starred in the CBS thriller series FBI: Most Wanted (2020–2021).', '1985-03-15', NULL, 'Dickinson, North Dakota, USA', '2025-05-09 10:22:51', '2025-05-09 10:22:51'),
(819, 55086, 'Cam Gigandet', '/kdSVRqCR0p8KZTvVkRccBLoim7L.jpg', '​Cam Joslin Gigandet is an American actor, whose roles have included Twilight, The O.C., Never Back Down and Burlesque. In 2003, Gigandet made his acting debut making a guest appearance in the Crime television series CSI: Crime Scene Investigation. In 2004 and 2005 Gigandet continued his television career making noticeable recurring roles in television shows such as The Young and The Restless and Jack and Bobby.\n\nIn 2006, Gigandet successfully auditioned for the role of Kevin Volchok on the Fox teen drama television series The O.C..  In December 2007, Summit Entertainment cast Gigandet in the planned film adaptation of the best selling vampire book trilogy Twilight (series) by Stephanie Meyer. In 2008, Gigandet won the award for \"One to Watch\" at the 10th Annual Young Hollywood Awards. \n\nGigandet and his girlfriend, Dominique Geisendorff, had a daughter, Everleigh Rae Gigandet, on April 14, 2009. In an early 2011 interview, he referred to Geisendorff as his \"wife.\"', '1982-08-16', NULL, 'Tacoma, Washington, USA', '2025-05-09 10:22:51', '2025-05-09 10:22:51'),
