(821, 53185, 'Texas Battle', '/zPzagAtKxbHKrQLAQ69KSYLZxjA.jpg', 'Texas Quency Battle (born August 9, 1980) is an American film and television actor, known for his role as Marcus Forrester on the CBS soap opera The Bold and the Beautiful.', '1980-08-09', NULL, 'Houston, Texas, USA', '2025-05-09 10:22:52', '2025-05-09 10:22:52'),
