(825, 2404433, 'Helena Haro', '/xzKGd2vXNigILipwIfzCeX91zmh.jpg', 'Born in the Dominican Republic to a Spanish father and Dominican mother, Helena immigrated to Madrid, Spain at 5 years old. She has studied with a few of the best professionals of Spain and worked in minor projects until she moved to Los Angeles CA where she was casted in the Pantaya\'s Original series El Juego de las Llaves.', NULL, NULL, 'Dominican Republic', '2025-05-09 10:22:53', '2025-05-09 10:22:53'),
