(853, 1088195, 'Gerard Jordan', '/r94M1g0AuaTaBU3eCXVV1SjcAlm.jpg', 'Gerard Jordan is an actor from Belfast, Northern Ireland\n\nHe is best known for his recurring roles in the Northern Irish TV series Pulling Moves (2004) and in BBC\'s The Fall (2013–2014), and for his portrayal of Biter in the HBO series Game of Thrones (2012–2014). He also starred in the Irish drama film Peacefire (2008) and he played the role of Jim in Oliver Hirschbiegel\'s Five Minutes of Heaven (2009)', NULL, NULL, 'Belfast, Northern Ireland, UK', '2025-05-09 10:23:04', '2025-05-09 10:23:04'),
