(855, 90633, 'Gal Gadot', '/qCJB1ACi5VjtY4ypXuv3hjAvbSu.jpg', 'Gal Gadot (born 30 April 1985) is an Israeli actress. She gained recognition for portraying Wonder Woman in the DC Extended Universe films (2016–2023). In 2018, Gadot was named one of Time\'s 100 most influential people and ranked by Forbes as the tenth-highest-paid actress, later rising to third in 2020. She became the first Israeli actor to receive a star on the Hollywood Walk of Fame in 2025.\n\nGadot grew up in Rosh HaAyin, and first gained attention locally after winning the Miss Israel 2004, followed by two years of service in the Israel Defense Forces as a combat trainer. During this time, she participated in a Maxim photo shoot that boosted her public profile. Gadot then began modeling and endorsing various brands. She made her television debut in the Israeli drama Bubot in 2008, followed by her film debut in a supporting role as Gisele Yashar in Fast & Furious (2009), reprising it in multiple sequels.\n\nGadot first portrayed Wonder Woman in Batman v Superman. The success of the film led to her starring in Wonder Woman (2017), which became a major box office hit. She also reprised the role in Justice League (2017) and Wonder Woman 1984 (2020), the latter of which she also co-produced. Since then, she has starred in Red Notice (2021), Death on the Nile (2022), Heart of Stone (2023), which she co-produced, and portrayed the Evil Queen in Snow White (2025).', '1985-04-30', NULL, 'Petah Tikva, Israel', '2025-05-09 10:23:05', '2025-05-09 10:23:05');
