(856, 62064, 'Chris Pine', '/d8hGMH1igEFnpNFEEFdP3yFHV3U.jpg', 'Christopher Whitelaw Pine (born August 26, 1980) is an American actor. He is best known for his roles as James T. Kirk in the Star Trek reboot film series (2009–2016) and Steve Trevor in the DC Extended Universe films Wonder Woman (2017) and Wonder Woman 1984 (2020).\n\nPine rose to prominence for his roles in the romantic comedies The Princess Diaries 2 (2004) and Just My Luck (2006). His roles include Cinderella\'s Prince in Into the Woods (2014), Jack Ryan in Jack Ryan: Shadow Recruit (2014), Bernie Webber in The Finest Hours (2016), and Robert the Bruce in Outlaw King (2018). He starred in Unstoppable (2010), Rise of the Guardians (2012), Hell or High Water (2016), The Contractor, Don\'t Worry Darling (both 2022), and Dungeons & Dragons: Honor Among Thieves (2023). Pine made his directorial debut with Poolman (2023).\n\nDescription above from the Wikipedia article Chris Pine, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1980-08-26', NULL, 'Los Angeles, California, USA', '2025-05-09 10:23:05', '2025-05-09 10:23:05'),
(857, 935, 'Connie Nielsen', '/lvQypTfeH2Gn2PTbzq6XkT2PLmn.jpg', 'Connie Inge-Lise Nielsen (born July 3, 1965) is a Danish actress. She is known for her roles in the English language films Gladiator, The Devil\'s Advocate, Basic, and The Ice Harvest.', '1965-07-03', NULL, 'Elling, Frederikshavn, Denmark', '2025-05-09 10:23:06', '2025-05-09 10:23:06'),
(858, 32, 'Robin Wright', '/d3rIv0y2p0jMsQ7ViR7O1606NZa.jpg', 'Robin Gayle Wright (born April 8, 1966) is an American actress. She is best known for her roles as Jenny Curran in Forrest Gump, as Buttercup in The Princess Bride, and as Mary Surratt in The Conspirator. She has also been credited as Robin Wright Penn.', '1966-04-08', NULL, 'Dallas, Texas, USA', '2025-05-09 10:23:06', '2025-05-09 10:23:06'),
(859, 6413, 'Danny Huston', '/7Wdh73SltnllH4KVd64PvqKQ5NJ.jpg', 'Daniel Sallis Huston (born May 14, 1962) is an American actor, director and screenwriter. A member of the Huston family of filmmakers, he is the son of director John Huston and half-brother of actress Anjelica Huston.\n\nHe is known for his roles in films such as Ivans Xtc (2000), for which he was nominated for an Independent Spirit Award for Best Male Lead, 21 Grams (2003), Birth (2004), The Aviator (also 2004), The Constant Gardener (2005), Marie Antoinette (2006), Children of Men (also 2006), The Kingdom (2007), 30 Days of Night (also 2007), Robin Hood (2010), Hitchcock (2012), The Congress (2013), Big Eyes (2014), Wonder Woman (2017), Game Night (2018), Stan & Ollie (also 2018), and Angel Has Fallen (2019).\n\nHuston portrayed The Axeman on the FX series American Horror Story: Coven and Massimo Dolcefino on American Horror Story: Freak Show. He played Ben \"The Butcher\" Diamond on Magic City (2012–13), Dan Jenkins in the first two seasons of the Paramount Network drama series Yellowstone (2018–19), and Jamie Laird on the second season of Succession (2019). His directing credits include the films Mr. North (1988), The Maddening (1995) and The Last Photograph (2017).\n\nDescription above from the Wikipedia article Danny Huston, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1962-05-14', NULL, 'Rome, Italy', '2025-05-09 10:23:06', '2025-05-09 10:23:06'),
(860, 11207, 'David Thewlis', '/sNuYyT8ocLlQr3TdAW9CoKVbCU8.jpg', 'David Wheeler (born March 20, 1963), better known as David Thewlis, is an English actor and filmmaker. He is known as a character actor and has appeared in a wide variety of genres in both film and television. He has received the Cannes Film Festival Award for Best Actor and nominations for two BAFTA Awards, Golden Globe Award, Primetime Emmy Award and a Screen Actors Guild Award.\n\nThewlis made his film debut in Little Dorrit (1987) and acted in the Mike Leigh films Life is Sweet (1990) and Naked (1993), winning the Cannes Film Festival Award for Best Actor for the latter. He then appeared in films such as Black Beauty (1994), Restoration (1995), James and the Giant Peach (1996), Dragonheart (1996), and Seven Years in Tibet (1997). He became more widely known to film audiences for his roles as Remus Lupin in the Harry Potter franchise (2004–2011) and Ares / Sir Patrick Morgan in Wonder Woman (2017). Other film roles include Kingdom of Heaven (2005), The Boy in the Striped Pyjamas (2008), War Horse (2011), The Theory of Everything (2014), Anomalisa (2015), I\'m Thinking of Ending Things (2020), and Enola Holmes 2 (2022).\n\nThewlis\' most notable television roles include V. M. Varga in the third season of FX\'s Fargo (2017), the voice of the Shame Wizard in the Netflix animated sitcoms Big Mouth (2017–present) and Human Resources (2022–present), Christopher Edwards in the HBO miniseries Landscapers (2021), and John Dee in the Netflix drama series The Sandman (2022). His performance in Fargo earned him nominations for an Emmy, a Golden Globe, and a Critics\' Choice Award.', '1963-03-20', NULL, 'Blackpool, Lancashire, England, UK', '2025-05-09 10:23:07', '2025-05-09 10:23:07'),
(861, 5419, 'Saïd Taghmaoui', '/kuxI08YpwQFGweIXK7TELknwexr.jpg', 'Saïd Taghmaoui (born July 19, 1973) is a French actor and screenwriter of Moroccan background. One of his defining screen roles was that of Saïd in the award winning 1995 French film La Haine directed by Mathieu Kassovitz.However, Saïd has also appeared in a number of more recent English Language films, with roles such as the U.S.-trained philosophical Iraqi interrogator Captain \'My Main Man\' Saïd in Three Kings, and as \"Omar\", the close radical Islamic associate of Don Cheadle (Samir), in the 2008 thriller Traitor.\n\nDescription above from the Wikipedia article Saïd Taghmaoui, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1973-07-19', NULL, 'Villepinte, Seine-Saint-Denis, France', '2025-05-09 10:23:07', '2025-05-09 10:23:07'),
(862, 1125, 'Ewen Bremner', '/d8ZVdFiJHRl43tApt2w43Ha6prf.jpg', 'Ewen Bremner (born January 23, 1972) is a Scottish character actor. His roles have included Julien in Julien Donkey-Boy and Daniel \"Spud\" Murphy in Trainspotting and its 2017 sequel T2 Trainspotting.\n\nBremner was born in Edinburgh, the son of two art teachers. He attended Davidson\'s Mains Primary School and Portobello High School. He originally wanted to be a circus clown, but was offered a chance at screen acting by television director Richard D. Brooks. One of his first notable roles was as a Glasgow schoolboy in Charles Gormley\'s Heavenly Pursuits (1986). He also played the lead in the BBC Scotland feature-length adaptation of the William McIlvanney short story \"Dreaming\" (1990).\n\nBremner portrayed Spud in Danny Boyle\'s film adaptation of Irvine Welsh\'s 1993 novel Trainspotting, and later Mullet, a street thug in Guy Ritchie\'s Snatch. In the 1994 stage version of Trainspotting, Bremner played the lead role of Mark Renton, the role played by Ewan McGregor in the 1996 film. He has played supporting roles in blockbusters such as Pearl Harbor and Black Hawk Down.\n\nIn 2017 he produced the short film No Song to Sing.\n\nHe has one daughter, with actress Marcia Rose, whom he met during the filming of Skin.', '1972-01-23', NULL, 'Edinburgh, Scotland, UK', '2025-05-09 10:23:07', '2025-05-09 10:23:07'),
(863, 1823591, 'Eugene Brave Rock', '/27RL3pfNTBTu2zeNvFQTLFvCrJv.jpg', '', '1978-01-01', NULL, 'Stand Off, Canada', '2025-05-09 10:23:08', '2025-05-09 10:23:08'),
(864, 11111, 'Lucy Davis', '/A1ymILbxQA5w5TduCNaU0xD9C5a.jpg', 'Lucy Clare Davis (born 17 February 1973) is an English actress. She played the role of Dawn Tinsley in the BBC comedy The Office, as well as Dianne in the horror-comedy movie Shaun of the Dead, Hayley in The Archers, and Etta Candy in Wonder Woman (2017).\n\nDescription above from the Wikipedia article Lucy Davis, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1973-02-17', NULL, 'Solihull, West Midlands, England, UK', '2025-05-09 10:23:08', '2025-05-09 10:23:08'),
(865, 3623, 'Elena Anaya', '/vZ5ewGX4mzwERL7MCFthRBcq2jz.jpg', 'Elena Anaya (born July 17, 1975) is a Spanish actress whose career dates back to 1995. Anaya was born in Palencia, Spain on July 17, 1975. She is the youngest of 5 children. She first received international attention in 2001 for her role in the sexually explicit drama Lucía y el sexo (Sex and Lucía) and also appeared in Pedro Almodóvar\'s Hable con ella (Talk to Her). Her best-known Hollywood film role was as a vampire in 2004\'s Van Helsing, playing Dracula\'s bride, Aleera. She is also featured in Justin Timberlake\'s music video for his 2006 single, SexyBack. In 2004, she was named as one of European films\' Shooting Stars by European Film Promotion.\n\nDescription above from the Wikipedia article Elena Anaya, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1975-07-17', NULL, 'Palencia, Palencia, Castilla y León, Spain', '2025-05-09 10:23:09', '2025-05-09 10:23:09'),
