(869, 1360156, 'Ann Ogbomo', '/5EGoq8xksh6w1MZJBDgEi7LofDC.jpg', '', NULL, NULL, NULL, '2025-05-09 10:23:10', '2025-05-09 10:23:10'),
(870, 1590758, 'Emily Carey', '/tWUHikgtPCAPgYVrReXAPjMYNAW.jpg', 'Emily Joanna Carey (born 30 April 2003) is an English actress. She began her career as a child actor on stage and in the BBC One soap opera Casualty (2014–2017, 2021). She went on to play young versions of characters, such as Diana Prince in Wonder Woman (2017), Lara Croft in Tomb Raider (2018), and young Alicent Hightower in the HBO fantasy series House of the Dragon (2022). She also appeared in BBC iPlayer teen series Get Even (2020).\n\nCarey uses both she/her and they/them pronouns.', '2003-04-30', NULL, 'Barnet, London, England, UK', '2025-05-09 10:23:10', '2025-05-09 10:23:10'),
(871, 2467, 'James Cosmo', '/4QZnZ3wyGALVuwZ70HdXZk4O14W.jpg', 'From Wikipedia, the free encyclopedia\n\nJames Cosmos is known for his film roles as Angus MacLeod in Highlander, Campbell in Braveheart and as Father Christmas in the adaptation of The Chronicles of Narnia: The Lion, the Witch and the Wardrobe. Over the years he has also had roles in films such as Trainspotting, The Last Legion, Troy, and 2081 . He also appeared in Take the High Road as Alex Geddes from 1982-83.\n\nHe is also a staple of British television, with credits in hundreds of television shows, Cosmo made a name for himself playing Scottish \"tough guy\" characters.', '1948-05-24', NULL, 'Clydebank, West Dunbartonshire, Scotland, UK', '2025-05-09 10:23:11', '2025-05-09 10:23:11'),
(872, 659, 'Wolf Kahler', '/qj8kHiwkluEAH7kwfsBgmDyjGH1.jpg', 'From Wikipedia, the free encyclopedia.\n\nWolf Kahler (3 April 1940) is a German actor born in Kiel.  Since 1975, he has appeared in many English language US and UK television and film productions. An early role for him was Kaiser Wilhelm II in Michael York\'s adventure film The Riddle of the Sands.  One of his most well-known roles was that of Dietrich in Raiders of the Lost Ark. Kahler\'s voice also appears in video games including as Kaiser Vlad in Battalion Wars. Kahler played the Prince of Tübingen in Stanley Kubrick\'s 1975 film, Barry Lyndon In 2001 he portrayed aWehrmacht General in the World War II TV miniseries, Band of Brothers.  Kahler played the German Ambassador in the long-running \"Ambassador\'s Reception\" TV advertisement for Ferrero Rocher chocolate, uttering the line \"Excellente!\".\n\nHe also appears as a famous Germanic architect in US television advertisements for the Kohler Company. In 2011 Kahler appeared as Dr. Hoffmanstahl in Sherlock Holmes: A Game of Shadows.', '1940-04-03', NULL, 'Kiel, Germany', '2025-05-09 10:23:11', '2025-05-09 10:23:11'),
