(883, 1820151, 'Marko Leht', '/4WmZVY3aAQ6aGkH0WiA4juuVL2m.jpg', 'Marko Leht (born May 9, 1984 in Viljandi) is an Estonian actor.\n\nHe graduated from Tartu Miina Härma High School in 2003. In the years 2003–2006, he studied sociology, social work and social policy at the University of Tartu. In 2010, he graduated from the XXIV flight of the Estonian Academy of Music and Theater School of Performing Arts. After graduating from stage school, he worked as a freelance actor. Since 2014, he has been working as an actor in England.\n\nHe is a member of the Estonian Theater Association and the Actors\' Union.', '1984-05-09', NULL, 'Viljandi, Estonian SRR, USSR [now Estonia]', '2025-05-09 10:23:15', '2025-05-09 10:23:15'),
(884, 143892, 'Steffan Rhodri', '/lxa7b7uKkBMfXpLkzQawtTcl24L.jpg', 'The Welsh actor Steffan Rhodri was born and raised in Morriston, Swansea, Wales. He is best known for his work in the films \"Submarine\"(2010); \"Harry Potter and the Deathly Hallows: Part 1\" (2010); \"Ironclad\" (2011) and \"Under Milk Wood\" (2015).\n\nOn television he portrayed Dave Coaches in \"Gavin and Stacey\".', '1967-03-01', NULL, 'Swansea, Glamorgan, Wales, UK', '2025-05-09 10:23:15', '2025-05-09 10:23:15'),
