(897, 139900, 'Florence Kasumba', '/v7armAbV6haib0fTl6ZktTUMRmg.jpg', 'Florence Kasumba (born October 26, 1976) is a German actress of Ugandan origin. She is known for playing the role of Ayo in Captain America: Civil War, Black Panther (2018), Avengers: Infinity War (2018), The Falcon and the Winter Soldier (2021) and Black Panther: Wakanda Forever (2022). She also played Senator Acantha in Wonder Woman, and the Wicked Witch of the East in the NBC television series Emerald City.', '1976-10-26', NULL, 'Kampala, Uganda', '2025-05-09 10:23:20', '2025-05-09 10:23:20'),
(898, 62976, 'Eleanor Matsuura', '/8PTKH2LHXVxoxPm4kULlQ0OdwTg.jpg', 'Eleanor Matsuura is a Japanese-born British actress. She was born in Tokyo, Japan, but raised in London, England; she is half-Japanese and half-English. She is best known for her roles as Yumiko in The Walking Dead, Hannah Santo in Spooks: The Greater Good, Bev in Utopia, and as PC Donna Prager in Cuffs.\n\nShe trained at the Central School of Speech and Drama and graduated in 2004. She worked on stage at the Royal Court Theatre, Old Vic Theatre and several West End theatres. She has also appeared in several British TV dramas, including EastEnders, Thorne, Extras, Holby City, Lead Balloon, Doctor Who and Hustle, as well as British films. She appeared as Isobel in Bull at the Crucible Theatre, Sheffield.', '1983-01-01', NULL, 'Tokyo, Japan', '2025-05-09 10:23:21', '2025-05-09 10:23:21'),
(899, 174708, 'Josette Simon', '/uLvLGR6a60To8AAlj0C5124d7Xu.jpg', 'Josette Patricia Simon OBE (born 15 November 1960) is a British actress. She trained for the stage at the Central School of Speech and Drama in London, and played the part of Dayna Mellanby in the third and fourth series of the television sci-fi series Blake\'s 7 from 1980 to 1981.', '1960-11-15', NULL, 'Leicester, Leicestershire, England, UK', '2025-05-09 10:23:21', '2025-05-09 10:23:21'),
(900, 1009999, 'Doutzen Kroes', '/lUxvWe6Dd3DbugBa18N60rEizse.jpg', 'Doutzen Kroes (born 23 January 1985) is a Dutch Frisian model and actress. She began her modelling career in 2003 in the Netherlands and quickly was sent by her agency to New York where she was cast by lingerie giant Victoria’s Secret. She became a Victoria\'s Secret Angel for the brand in 2008. She has been a brand ambassador and spokesperson for L\'Oréal Paris for over 5 years. Kroes has been in the top five of best-paid models, with an estimated income of more than five million per year since 2008. In 2014, she came in second on the Forbes top-earning models list, estimated to have earned $8 million in one year. She is considered one of the \"New Supers\" and described as \"Helen of Troy of advertising\" by Models.com.\n\nUnlike most fellow top models, Kroes got acquainted with the fashion world relatively late. She is one of few highly successful professional models who was not discovered by any scouting agency. She got accepted at Paparazzi Model Management in Amsterdam after sending some of her holiday pictures. Her first breakthrough was when she was featured on cover of Vogue Italia in 2005. Steven Meisel shot her pictures for the cover. Just as she started her career as model for Victoria\'s Secret, she was voted as \"Model of The Year\" on Vogue.com in the year 2005. The year 2013 was a significantly successful year for her modeling career. In September 2013, she appeared on covers of four international editions of Vogue, making her the first model/celebrity in the history. The September issues are generally regarded as the most important issue of the year for fashion magazines, especially Vogue. She had been featured on a total of 9 Vogue covers, a count more than any other model, just in the year 2013.\n\nHer first film debut was in Nova Zembla (2011). She is one of the active members to contribute to Dance4Life, a Dutch non-profit organization that uses song and dance to educate youth about HIV and AIDS prevention. She is also one of the supporters of Wildlife Conservation and World Wildlife Fund.', '1985-01-23', NULL, 'Eastermar, Netherlands', '2025-05-09 10:23:21', '2025-05-09 10:23:21'),
(901, 1831280, 'Hayley Warnes', '/2dPqpifxaxXc6urLimtC6bdkh5s.jpg', '', NULL, NULL, NULL, '2025-05-09 10:23:22', '2025-05-09 10:23:22'),
(902, 1890450, 'Caitlin Burles', '/k508jIWbCk6HOliJklZJS3KqPRn.jpg', '', NULL, NULL, NULL, '2025-05-09 10:23:22', '2025-05-09 10:23:22'),
(903, 1824295, 'Jemma Moore', '/nmrfGN0xVTWFsOvWMS3v2FtPux8.jpg', 'Hong Kong born, British actor Jemma Moore stars in the award winning horror \'HOST\' (Dir by. Rob Savage 2020). \'HOST\' won FANGORIA\'s Golden Chainsaw Award for \'Best Streaming Premiere\' and was nominated for multiple BIFA awards. It is \'Certified Fresh\' on rotten tomatoes, one of Variety\'s top ten \'Best Found Footage Horror Movies of All Time\' 2022 and one of EMPIRE magazine\'s \'Best Movies of 2020\' with Jemma\'s character making it into EMPIRE magazine\'s \'The 100 Best Horror Movie Characters\' list. Jemma was long-listed for BAFTA breakthrough UK 2021 and won the \'ABC Discovers UK Digital Talent\' Competition in 2017, which led to a year long talent deal with ABC. Jemma is also known for her roles in SILENT WITNESS (BBC, 2023), BAFTA SCOTLAND and ROYAL TELEVISION SOCIETY SCOTLAND award winning show \'TWO DOORS DOWN\' (BBC, 2022), \'DOOM: ANNIHILATION\' (Universal, 2019), \'SHAKESPEARE & HATHAWAY\' (BBC, 2019) and \'WONDER WOMAN\' (Warner Brothers, 2018). Jemma is also a filmmaker with her comedy short film \'STALLING IT\' recently screening at BAFTA and BIFA-qualifying festivals in 2021/22.', NULL, NULL, 'Hong Kong', '2025-05-09 10:23:23', '2025-05-09 10:23:23'),
(904, 1272968, 'Samantha Win', '/vizHwiI9JXCtNxIM3bx2F6Gr7iF.jpg', 'Samantha Win (born Samantha Win Tjhia, formerly known as Samantha Jo; born March 29, 1991) is a Canadian actress and martial artist who was a part of Canada\'s national representation at international wushu tournaments in 2005-2008. She competed at the 2008 Beijing Wushu Tournament as a part of Team Canada in 2008. In 2012, she debuted as an actress in the role of Kitana in Mortal Kombat: Legacy, followed by her role as Car-Vex in 2013\'s Man of Steel. She has appeared in various projects since these, and in 2021 played Chambers in Zack Snyder\'s Army of the Dead.', '1991-03-29', NULL, 'Barrie, Ontario, Canada', '2025-05-09 10:23:23', '2025-05-09 10:23:23'),
(905, 1831281, 'Brooke Ence', '/1xm90B63kg6q3dYVIiRjl56OPhH.jpg', '', '1989-08-10', NULL, 'California, USA', '2025-05-09 10:23:23', '2025-05-09 10:23:23'),
