INSERT INTO `movies` (`id`, `tmdb_id`, `title`, `original_title`, `storyline`, `image`, `backdrop_path`, `category_id`, `rating`, `vote_count`, `release_date`, `duration`, `created_at`, `updated_at`, `status`, `tagline`, `budget`, `revenue`, `homepage`, `imdb_id`, `overview`, `poster_path`, `runtime`, `vote_average`) VALUES
(1, '1233069', 'Exterritorial', 'Exterritorial', NULL, NULL, '/bVm6udIB6iKsRqgMdQh6HywuEBj.jpg', NULL, 0, 231, '2025-04-29', NULL, '2025-05-08 19:50:02', '2025-05-09 10:17:57', 'Released', '', 0, 0, 'https://www.netflix.com/title/81571720', 'tt30876483', 'When her son vanishes inside a US consulate, ex-special forces soldier Sara does everything in her power to find him — and uncovers a dark conspiracy.', '/jM2uqCZNKbiyStyzXOERpMqAbdx.jpg', 109, 6.725),
(2, '1241436', 'Warfare', 'Warfare', NULL, NULL, '/cJvUJEEQ86LSjl4gFLkYpdCJC96.jpg', NULL, 0, 144, '2025-04-09', NULL, '2025-05-09 10:18:08', '2025-05-09 10:18:08', 'Released', 'Everything is based on memory.', 20000000, 29503791, 'https://a24films.com/films/warfare', 'tt31434639', 'A platoon of Navy SEALs embarks on a dangerous mission in Ramadi, Iraq, with the chaos and brotherhood of war retold through their memories of the event.', '/j8tqBXwH2PxBPzbtO19BTF9Ukbf.jpg', 96, 7.236),
(3, '986056', 'Thunderbolts*', 'Thunderbolts*', NULL, NULL, '/rthMuZfFv4fqEU4JVbgSW9wQ8rs.jpg', NULL, 0, 623, '2025-04-30', NULL, '2025-05-09 10:18:20', '2025-05-09 10:18:20', 'Released', 'Everyone deserves a second shot.', 180000000, 177327963, 'https://www.marvel.com/movies/thunderbolts', 'tt20969586', 'After finding themselves ensnared in a death trap, seven disillusioned castoffs must embark on a dangerous mission that will force them to confront the darkest corners of their pasts.', '/m9EtP1Yrzv6v7dMaC9mRaGhd1um.jpg', 127, 7.546),
(4, '1197306', 'A Working Man', 'A Working Man', NULL, NULL, '/fTrQsdMS2MUw00RnzH0r3JWHhts.jpg', NULL, 0, 590, '2025-03-26', NULL, '2025-05-09 10:18:36', '2025-05-09 10:18:36', 'Released', 'Human traffickers beware.', 40000000, 89722806, 'https://www.amazon.com/salp/aworkingman?hhf', 'tt9150192', 'Levon Cade left behind a decorated military career in the black ops to live a simple life working construction. But when his boss\'s daughter, who is like family to him, is taken by human traffickers, his search to bring her home uncovers a world of corruption far greater than he ever could have imagined.', '/6FRFIogh3zFnVWn7Z6zcYnIbRcX.jpg', 116, 6.505),
(5, '710258', 'Rust', 'Rust', NULL, NULL, '/12tEzU0bNYKIjXXEwI5abuOotHF.jpg', NULL, 0, 34, '2025-05-01', NULL, '2025-05-09 10:18:54', '2025-05-09 10:18:54', 'Released', 'Redemption isn\'t given, it\'s taken.', 0, 0, '', 'tt11001074', 'Infamous outlaw Harland Rust breaks his estranged grandson Lucas out of prison, after Lucas is convicted to hang for an accidental murder. The two must outrun legendary U.S Marshal Wood Helm and bounty hunter Fenton \"Preacher\" Lang who are hot on their tails. Deeply buried secrets rise from the ashes and an unexpected familial bond begins to form as the mismatched duo tries to survive the merciless American Frontier.', '/tbJ3RkA2s6X5qrBzrYHYTxvDBui.jpg', 0, 6.4),
(6, '950387', 'A Minecraft Movie', 'A Minecraft Movie', NULL, NULL, '/2Nti3gYAX513wvhp8IiLL6ZDyOm.jpg', NULL, 0, 840, '2025-03-31', NULL, '2025-05-09 10:19:01', '2025-05-09 10:19:01', 'Released', 'Be there and be square.', 150000000, 874636560, 'https://www.minecraft-movie.com', 'tt3566834', 'Four misfits find themselves struggling with ordinary problems when they are suddenly pulled through a mysterious portal into the Overworld: a bizarre, cubic wonderland that thrives on imagination. To get back home, they\'ll have to master this world while embarking on a magical quest with an unexpected, expert crafter, Steve.', '/iPPTGh2OXuIv6d7cwuoPkw8govp.jpg', 101, 6.167),
(7, '668489', 'Havoc', 'Havoc', NULL, NULL, '/65MVgDa6YjSdqzh7YOA04mYkioo.jpg', NULL, 0, 548, '2025-04-24', NULL, '2025-05-09 10:19:16', '2025-05-09 10:19:16', 'Released', 'No law. Only disorder.', 90000000, 0, 'https://www.netflix.com/title/81330790', 'tt14123284', 'When a drug heist swerves lethally out of control, a jaded cop fights his way through a corrupt city\'s criminal underworld to save a politician\'s son.', '/r46leE6PSzLR3pnVzaxx5Q30yUF.jpg', 107, 6.582),
(8, '37135', 'Tarzan', 'Tarzan', NULL, NULL, '/86z1Yrwj7yN1xehSa0gIwHnR7xl.jpg', NULL, 0, 6923, '1999-06-18', NULL, '2025-05-09 10:19:41', '2025-05-09 10:19:41', 'Released', 'An immortal legend. As you\'ve only imagined.', 130000000, 448200000, '', 'tt0120855', 'Tarzan was a small orphan who was raised by an ape named Kala since he was a child. He believed that this was his family, but on an expedition Jane Porter is rescued by Tarzan. He then finds out that he\'s human. Now Tarzan must make the decision as to which family he should belong to...', '/bTvHlcqiOjGa3lFtbrTLTM3zasY.jpg', 88, 7.4),
(9, '822119', 'Captain America: Brave New World', 'Captain America: Brave New World', NULL, NULL, '/8eifdha9GQeZAkexgtD45546XKx.jpg', NULL, 0, 1758, '2025-02-12', NULL, '2025-05-09 10:20:12', '2025-05-09 10:20:12', 'Released', 'The future favors the brave.', 180000000, 414757293, 'https://www.marvel.com/movies/captain-america-brave-new-world', 'tt14513804', 'After meeting with newly elected U.S. President Thaddeus Ross, Sam finds himself in the middle of an international incident. He must discover the reason behind a nefarious global plot before the true mastermind has the entire world seeing red.', '/pzIddUEMWhWzfvLI3TwxUG2wGoi.jpg', 119, 6.15),
(10, '1144430', 'Last Bullet', 'Balle perdue 3', NULL, NULL, '/4A5HH9HkCPqAwyYL6CnA0mxbYjn.jpg', NULL, 0, 26, '2025-05-06', NULL, '2025-05-09 10:20:33', '2025-05-09 10:20:33', 'Released', '', 0, 0, 'https://www.netflix.com/title/81701729', 'tt29768333', 'Car genius Lino returns to conclude his vendetta against Areski and the corrupt commander who ruined their lives in this turbo-charged trilogy finale.', '/qycPITRqXgPai7zj1gKffjCdSB5.jpg', 111, 7.5),
(11, '324544', 'In the Lost Lands', 'In the Lost Lands', NULL, NULL, '/op3qmNhvwEvyT7UFyPbIfQmKriB.jpg', NULL, 0, 340, '2025-02-27', NULL, '2025-05-09 10:20:41', '2025-05-09 10:20:41', 'Released', 'She seeks the power to free her people.', 55000000, 4755330, 'https://inthelostlands.com', 'tt4419684', 'A queen sends the powerful and feared sorceress Gray Alys to the ghostly wilderness of the Lost Lands in search of a magical power, where she and her guide, the drifter Boyce, must outwit and outfight both man and demon.', '/dDlfjR7gllmr8HTeN6rfrYhTdwX.jpg', 102, 6.332),
(12, '1225915', 'Jewel Thief: The Heist Begins', 'ज्वेल थीफ: द हीस्ट बिगिन्स', NULL, NULL, '/kFXtAwJYbRTqiyQpE9kDc8qEP3X.jpg', NULL, 0, 35, '2025-04-25', NULL, '2025-05-09 10:20:48', '2025-05-09 10:20:48', 'Released', '', 0, 0, '', 'tt27843798', 'In this high-octane battle of wits and wills, ingenious con artist Rehan devises a diamond heist while trying to outsmart Rajan, his sadistic adversary.', '/eujLbO0kf1eqWC8XpHUJdtAVW2J.jpg', 118, 6.7),
(13, '1153714', 'Death of a Unicorn', 'Death of a Unicorn', NULL, NULL, '/eDBZN0TbWkxoAB0qIDFagVcPPTN.jpg', NULL, 0, 172, '2025-03-27', NULL, '2025-05-09 10:20:54', '2025-05-09 10:20:54', 'Released', 'Payback is a beast.', 15000000, 15983827, 'https://a24films.com/films/death-of-a-unicorn', 'tt28443655', 'A father and daughter accidentally hit and kill a unicorn while en route to a weekend retreat, where his billionaire boss seeks to exploit the creature’s miraculous curative properties.', '/lXR32JepFwD1UHkplWqtBP1K79z.jpg', 107, 6.4),
(14, '974573', 'Another Simple Favor', 'Another Simple Favor', NULL, NULL, '/z3edlTX9YDBrVMoYupMsc8qdiUw.jpg', NULL, 0, 187, '2025-03-07', NULL, '2025-05-09 10:21:01', '2025-05-09 10:21:01', 'Released', 'Every friendship has its twists.', 0, 0, 'https://www.amazon.com/gp/video/detail/B0DWLTDFZ2', 'tt20214908', 'Stephanie and Emily reunite on the beautiful island of Capri, Italy for Emily\'s extravagant wedding to a rich Italian businessman. Along with the glamorous guests, expect murder and betrayal to RSVP for a wedding with more twists and turns than the road from the Marina Grande to the Capri town square.', '/zboCGZ4aIqPMd7VFI4HWnmc7KYJ.jpg', 123, 6.123),
(15, '1471014', 'Van Gogh by Vincent', 'Van Gogh by Vincent', NULL, NULL, '/1AWjIUgbZYaKbwUH5qoJaKCcRkf.jpg', NULL, 0, 14, '2025-03-26', NULL, '2025-05-09 10:21:13', '2025-05-09 10:21:13', 'Released', '', 0, 0, 'https://www.unity-house.co/van-gogh-by-vincent', 'tt36364552', 'In a career that lasted only ten years, Vincent Van Gogh painted one subject more than any other: himself. This is the story of Vincent told using eight of his most iconic self-portraits.', '/z73X4WKZghBh5fri31o8P6vBEB2.jpg', 46, 6.4),
(16, '1233413', 'Sinners', 'Sinners', NULL, NULL, '/nAxGnGHOsfzufThz20zgmRwKur3.jpg', NULL, 0, 618, '2025-04-16', NULL, '2025-05-09 10:21:16', '2025-05-09 10:21:16', 'Released', 'Dance with the devil.', 90000000, 244603597, 'https://www.sinnersmovie.com', 'tt31193180', 'Trying to leave their troubled lives behind, twin brothers return to their hometown to start again, only to discover that an even greater evil is waiting to welcome them back.', '/jYfMTSiFFK7ffbY2lay4zyvTkEk.jpg', 138, 7.571),
(17, '497698', 'Black Widow', 'Black Widow', NULL, NULL, '/6azpBJGcLx9SKif8h9VMnflBfa.jpg', NULL, 0, 10510, '2021-07-07', NULL, '2025-05-09 10:21:29', '2025-05-09 10:21:29', 'Released', 'Her world. Her secrets. Her legacy.', 200000000, 379751131, 'https://www.marvel.com/movies/black-widow', 'tt3480822', 'Natasha Romanoff, also known as Black Widow, confronts the darker parts of her ledger when a dangerous conspiracy with ties to her past arises. Pursued by a force that will stop at nothing to bring her down, Natasha must deal with her history as a spy and the broken relationships left in her wake long before she became an Avenger.', '/kwB7d51AIcyzPOBOHLCEZJkmPhQ.jpg', 134, 7.208),
(18, '1414048', 'Day of Reckoning', 'Day of Reckoning', NULL, NULL, '/1hBtO9tXP60IFBZD27OsbaBmxs5.jpg', NULL, 0, 17, '2025-03-28', NULL, '2025-05-09 10:22:03', '2025-05-09 10:22:03', 'Released', '', 0, 0, '', 'tt35317668', 'Put-upon lawman John Dorsey is on the verge of losing his wife and his job as sheriff, so he posses up with bullish U.S. Marshall Butch Hayden to hold outlaw Emily Rusk hostage. A battle of wills ensues as Emily turns the posse on themselves, but as her marauding husband and his gang approach, Emily and John realize they will need each other to survive.', '/cVSjSQryFUERYSdOmdgJ2m0eBte.jpg', 106, 6.706),
(19, '1356236', 'Saint Catherine', 'Saint Catherine', NULL, NULL, '/svLj9iyRmmeNVRsMreANn7DPPZE.jpg', NULL, 0, 23, '2024-09-24', NULL, '2025-05-09 10:22:13', '2025-05-09 10:22:13', 'Released', '', 0, 0, '', 'tt33319706', 'An orphaned girl is rescued from a satanic ritual and taken to Saint Catherine Institute for homeless youth. There she will learn new skills while facing demons that stalk her.', '/hBJdzKPeDaC96AzlrtMWBomYSZV.jpg', 86, 6.239),
(20, '1124620', 'The Monkey', 'The Monkey', NULL, NULL, '/6dC7ULfiutxwEAs7LjWHL2Tc7Zv.jpg', NULL, 0, 583, '2025-02-14', NULL, '2025-05-09 10:22:15', '2025-05-09 10:22:15', 'Released', 'Everybody dies. And that\'s fucked up.', 10000000, 68752066, 'http://www.neonrated.com/film/the-monkey', 'tt27714946', 'When twin brothers find a mysterious wind-up monkey, a series of outrageous deaths tear their family apart. Twenty-five years later, the monkey begins a new killing spree forcing the estranged brothers to confront the cursed toy.', '/yYa8Onk9ow7ukcnfp2QWVvjWYel.jpg', 97, 5.901),
(21, '299537', 'Captain Marvel', 'Captain Marvel', NULL, NULL, '/qAzYK4YPSWDc7aa4R43LcwRIAyb.jpg', NULL, 0, 16012, '2019-03-06', NULL, '2025-05-09 10:22:29', '2025-05-09 10:22:29', 'Released', 'Higher. Further. Faster.', 152000000, 1131416446, 'https://www.marvel.com/movies/captain-marvel', 'tt4154664', 'The story follows Carol Danvers as she becomes one of the universe’s most powerful heroes when Earth is caught in the middle of a galactic war between two alien races. Set in the 1990s, Captain Marvel is an all-new adventure from a previously unseen period in the history of the Marvel Cinematic Universe.', '/AtsgWhDnHTq68L0lLsUrCnM7TjG.jpg', 124, 6.8),
(22, '1180906', 'Desert Dawn', 'Desert Dawn', NULL, NULL, '/bFmziv84NfEVEGTK8c6EVY3bxve.jpg', NULL, 0, 0, '2025-05-15', NULL, '2025-05-09 10:22:50', '2025-05-09 10:22:50', 'Released', 'There is no turning back.', 0, 0, '', 'tt27611143', 'A newly appointed small-town sheriff and his begrudging deputy get tangled up in a web of lies and corruption involving shady businessmen and the cartel while investigating the murder of a mysterious woman.', '/S21BfLrJSD9njucBfY3CKqp8rD.jpg', 89, 0),
(23, '1136721', 'The Glenarma Tapes', 'The Glenarma Tapes', NULL, NULL, '/nyZjhvcmeXcr8H2Xx6JzKEAxPph.jpg', NULL, 0, 9, '2024-04-02', NULL, '2025-05-09 10:23:01', '2025-05-09 10:23:01', 'Released', '', 0, 0, '', 'tt27761801', 'In Spring 2020 when five students and two faculty members from the Mid Ulster College of Art go missing in a forest on the north coast of Ireland. What happened on the day they disappeared has remained a mystery - until now.', '/m0kojZkP1vcK9F8XSWfw9haJHKz.jpg', 96, 7.111),
(24, '297762', 'Wonder Woman', 'Wonder Woman', NULL, NULL, '/AaABt75ZzfMGrscUR2seabz4PEX.jpg', NULL, 0, 20204, '2017-05-30', NULL, '2025-05-09 10:23:05', '2025-05-09 10:23:05', 'Released', 'Power. Grace. Wisdom. Wonder.', 149000000, 823970682, 'https://www.warnerbros.com/movies/wonder-woman', 'tt0451279', 'An Amazon princess comes to the world of Man in the grips of the First World War to confront the forces of evil and bring an end to human conflict.', '/v4ncgZjG2Zu8ZW5al1vIZTsSjqX.jpg', 141, 7.217);
